INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(1, 'Mozilla : bientôt la fin ?', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Mozilla vs Google.</span></strong></p>\r\n<p><span id=\"docs-internal-guid-a657186c-7fff-87d9-765c-c12b82dc3057\">&nbsp;</span></p>\r\n<p dir=\"ltr\">La Mozilla Corporation, charg&eacute;e du d&eacute;veloppement du navigateur de recherche &laquo; Firefox &raquo;, conna&icirc;t depuis quelques ann&eacute;es une importante perte d&rsquo;affluence. Pour cause, les utilisateurs pr&eacute;f&egrave;rent se diriger vers son concurrent principal : Google Chrome. Mais comment Google Chrome arrive-t-il &agrave; attirer autant de nouveaux utilisateurs ? Selon Andreas Gal, ancien employ&eacute; chez Mozilla, c&rsquo;est gr&acirc;ce au matraquage marketing qui pousse &agrave; l&rsquo;installation de Chrome sur l&rsquo;ensemble des plateformes de l&rsquo;entreprise. Des liens d&rsquo;installation sont disponibles dans plusieurs services comme Google Docs ou encore YouTube. Aujourd&rsquo;hui, Google Chrome occupe plus de 60% des parts de march&eacute; dans le monde contre 4,47% pour Firefox.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/SEO/browser-usage.png\" alt=\"browser-usage.png\" width=\"1200\" height=\"675\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&reg;&nbsp;&nbsp;&nbsp;Captures d&rsquo;&eacute;cran emprunt&eacute;es par Andreas Gal &agrave; Chris Lord, ing&eacute;nieur chez Mozilla.&nbsp;</p>\r\n<p>&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/mozilla/mozillavschrome.png\" alt=\"mozillavschrome.png\" width=\"429\" height=\"480\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quand le coronavirus n&rsquo;arrange rien...</span></strong></p>\r\n<p><span id=\"docs-internal-guid-7c0848b6-7fff-b236-54d4-c3cb6622f63d\">&nbsp;</span></p>\r\n<p dir=\"ltr\">L&rsquo;utilisation du num&eacute;rique a fortement augment&eacute; pendant la crise sanitaire du Covid-19. Nombreux sont les r&eacute;seaux sociaux ou encore les plateformes de streaming &agrave; avoir observ&eacute; une hausse importante de leur nombre d&rsquo;abonn&eacute;s. Cependant, la pr&eacute;sidente de la fondation Mozilla Mitchell Baker explique que &laquo;&nbsp;les conditions &eacute;conomiques r&eacute;sultant de la pand&eacute;mie mondiale du Covid-19 ont eu un impact significatif sur leur chiffre d&rsquo;affaires&nbsp;&raquo;.&nbsp;Par cons&eacute;quent, la fondation Mozilla pourrait licencier pr&egrave;s de 250 employ&eacute;s.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Des am&eacute;liorations et de nouveaux services pour un second souffle.</span></strong></p>\r\n<p><span id=\"docs-internal-guid-84621b98-7fff-6d36-796b-07127ccae20f\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Malgr&eacute; sa perte d&rsquo;utilisateurs et ses difficult&eacute;s &eacute;conomiques, la fondation Mozilla essaye tant bien que mal de rester implant&eacute;e sur le march&eacute;. Elle a apport&eacute; de nombreuses am&eacute;liorations, notamment en rempla&ccedil;ant son moteur de rendu &laquo; Gecko &raquo; pour la nouvelle technologie &laquo; Quantum &raquo;, qui permet de charger les pages web plus rapidement. Elle a &eacute;galement d&eacute;velopp&eacute; le langage de programmation &laquo; Rust &raquo;, con&ccedil;u pour aider les d&eacute;veloppeurs &agrave; concevoir des applications ultra-rapides et s&eacute;curis&eacute;es. Enfin, elle a annonc&eacute; le lancement de son nouveau service de chat room en r&eacute;alit&eacute; virtuelle : Hubs Cloud. Gratuit, disponible &agrave; partir du web et compatible avec la plupart des casques de r&eacute;alit&eacute; virtuelle, c&rsquo;est l&rsquo;offre la plus compl&egrave;te du march&eacute;.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/mozilla/hubs.svg\" alt=\"hubs.svg\" width=\"1200\" height=\"300\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://andreasgal.com/2017/07/19/firefox-marketshare-revisited/\" target=\"_blank\" rel=\"noopener\">https://andreasgal.com/2017/07/19/firefox-marketshare-revisited/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.presse-citron.net/mozilla-songerait-a-mettre-de-cote-son-navigateur-historique-firefox/\" target=\"_blank\" rel=\"noopener\">https://www.presse-citron.net/mozilla-songerait-a-mettre-de-cote-son-navigateur-historique-firefox/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://korben.info/firefox-voie-dextinction.html\" target=\"_blank\" rel=\"noopener\">https://korben.info/firefox-voie-dextinction.html</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://hubs.mozilla.com/cloud\" target=\"_blank\" rel=\"noopener\">https://hubs.mozilla.com/cloud</a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"https://www.blogdumoderateur.com/chiffres-google/\" target=\"_blank\" rel=\"noopener\">https://www.blogdumoderateur.com/chiffres-google/</a></span></p>', 'Le moteur de recherche Mozilla Firefox, qui a vu le jour en septembre 2002, pourrait disparaître d’ici les deux prochaines années. Pour cause ? Google Chrome, qui s’impose désormais comme le leader du « search » avec plus de 95% de parts de trafic. Alors, quel avenir pour la fondation Mozilla ?', 3, '2020-09-29 11:35:17', '2021-05-05 12:20:34'),
(2, 'Z Event 2020 : 5,7 millions d’euros récolté', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-45fdcc95-7fff-8b18-9718-2bea20ee06f9\" style=\"font-size: 14pt;\">Z Event : l&rsquo;&eacute;v&eacute;nement caritatif 2.0</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le but ? Z Event est un projet caritatif qui r&eacute;unit des streamers et influenceurs pour un marathon autour du jeu vid&eacute;o dans le but de r&eacute;colter des dons. Se d&eacute;roulant sur un week-end, ces dons permettront par la suite de soutenir une association. Cette ann&eacute;e, c&rsquo;est pour Amnesty International que revient la belle somme de 5,7&nbsp; millions d&rsquo;euros, r&eacute;colt&eacute;e en 48 h, seulement !</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-de05cdb1-7fff-0429-ac6f-7bf668579593\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Existant depuis 2016, les premi&egrave;res &eacute;ditions promettaient d&eacute;j&agrave; un bel avenir : en 2016 et seulement en 34 h, plus de 170 000 euros ont &eacute;t&eacute; r&eacute;colt&eacute;s pour l&rsquo;association Save The Children (d&eacute;fend les droits de l\'enfant &agrave; travers le monde). En 2017, pour la seconde &eacute;dition, plus de 450 000 euros ont &eacute;t&eacute; r&eacute;colt&eacute; spour la Croix-Rouge fran&ccedil;aise. Pour sa troisi&egrave;me &eacute;dition en 2018, ce n&rsquo;est pas moins d&rsquo;un million d&rsquo;euros qui a &eacute;t&eacute; revers&eacute; &agrave; l&rsquo;association M&eacute;decins sans fronti&egrave;res. Plein de belles victoires qui ont permis d&rsquo;aider les populations &agrave; travers le monde.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><iframe src=\"https://www.youtube.com/embed/0z6VphnKVjs\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Quels streamers peut-on voir &agrave; Z Event ?&nbsp;</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour rappel, un streamer est une personne qui diffuse en direct ses parties de jeux vid&eacute;o. &Agrave; travers des plateformes tel que Twitch ou YouTube Gaming, il diffuse en live ses sessions de jeux aupr&egrave;s de nombreux t&eacute;l&eacute;spectateurs.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Cette ann&eacute;e, 41 participants ont particip&eacute; &agrave; Z Event. Dans le lot, les streamers et vid&eacute;astes Fran&ccedil;ais comme Squeezie et Antoine Daniel. D&rsquo;autres streamers comme Joueur du Grenier ou encore Gotaga &eacute;taient de la partie. Mais aussi, LeStream ou Solary, soci&eacute;t&eacute;s web TV fran&ccedil;aises sp&eacute;cialis&eacute;es dans le e-sport ont &eacute;galement contribu&eacute; &agrave; cet &eacute;v&eacute;nement.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Z%20Event/Les%20streamers%20de%20Z%20event.png\" alt=\"Les streamers de Z event.png\" width=\"1000\" height=\"562\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Une somme incroyable &agrave; destination d&rsquo;Amnesty International</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pas moins de 5,7 millions d&rsquo;euros a &eacute;t&eacute; r&eacute;colt&eacute; par l\'&eacute;v&eacute;nement Z Event. Cette ann&eacute;e, cet argent ira tout droit en faveur de l&rsquo;association Amnesty international qui intervient dans le domaine social aupr&egrave;s de 7 millions de personnes dans 70 pays &agrave; travers le monde. Ses combats sont riches et divers. Elle oeuvre notamment pour les discriminations, la libert&eacute; d&rsquo;expression, les droits des migrants et r&eacute;fugi&eacute;s, la peine de mort ou la torture ou encore pour les droits sexuels et reproductifs.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Elle a contribu&eacute; &agrave; l&rsquo;abolition de la peine de mort au Burkina Faso, et dans l&rsquo;&Eacute;tat de Washington ; &agrave; la d&eacute;p&eacute;nalisation de l&rsquo;homosexualit&eacute; en Inde ; &agrave; l&rsquo;abrogation d&rsquo;un article dans la constitution irlandaise qui interdisait l&rsquo;avortement, ...</p>\r\n<p dir=\"ltr\"><br />Une association pleine de convictions sociales et avec un panel de victoires plus encourageantes que jamais ! Il vous est possible de faire un don en vous rendant directement sur <a href=\"https://www.amnesty.fr/\">https://www.amnesty.fr/</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Z%20Event/amnesty-international.jpg\" alt=\"amnesty-international.jpg\" width=\"1200\" height=\"540\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://zevent.fr/\" target=\"_blank\" rel=\"noopener\">https://zevent.fr/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.presse-citron.net/avec-plus-de-5-millions-deuros-recoltes-le-z-event-entre-de-nouveau-dans-lhistoire/\" target=\"_blank\" rel=\"noopener\">https://www.presse-citron.net/avec-plus-de-5-millions-deuros-recoltes-le-z-event-entre-de-nouveau-dans-lhistoire/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.lefigaro.fr/jeux-video/le-zevent-entre-dans-la-derniere-ligne-droite-avec-2-2-millions-d-euros-recoltes-pour-amnesty-international-20201018\" target=\"_blank\" rel=\"noopener\">https://www.lefigaro.fr/jeux-video/le-zevent-entre-dans-la-derniere-ligne-droite-avec-2-2-millions-d-euros-recoltes-pour-amnesty-international-20201018</a></span></p>', 'Aujourd’hui, grâce à Internet, tout est possible. L\'événement caritatif Z Event, lancé par les streamers Zerator et Dach, l\'a démontré. Z Event a permis de récolter pas moins de 5,7 millions d’euros entre le 16 et 18 octobre 2020. Ces dons seront reversés à l’association Amnesty International.', 3, '2020-10-19 11:39:35', '2021-05-05 12:29:36'),
(3, 'Le Bitcoin dans la tourmente face aux élections américaines', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><span id=\"docs-internal-guid-94f2d0d5-7fff-404c-744d-994e2328181a\"></span></p>\r\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-d6cb593c-7fff-fd4a-1184-1c55a89162af\" style=\"font-size: 14pt;\">C&rsquo;est quoi le bitcoin ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Cr&eacute;&eacute; en 2009 par Satoshi Nakamoto, le Bitcoin est la crypto-monnaie la plus connue dans le monde.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Une crypto-monnaie est une monnaie virtuelle cr&eacute;&eacute;e et &eacute;chang&eacute;e sur un r&eacute;seau informatique dit &ldquo;d&eacute;centralis&eacute;&rdquo;. Sa particularit&eacute; est qu&rsquo;aucune entit&eacute;, comme par exemple l&rsquo;&Eacute;tat ou les banques, n&rsquo;a le contr&ocirc;le sur l&rsquo;ensemble du processus. Elle se caract&eacute;rise donc par son anonymat, sa d&eacute;centralisation et son absence de r&eacute;glementation.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le Bitcoin fonctionne via le protocole Blockchain, qui permet le stockage des jetons et les &eacute;changes en toute transparence, sans organes de contr&ocirc;le. Il permet d&rsquo;effectuer des achats (en ligne ou hors-ligne) et des transactions dans le monde entier. Comme pour toutes les autres devises, il est possible d&rsquo;investir ou de sp&eacute;culer sur sa valeur par le biais des plateformes de trading. 1 Bitcoin est &eacute;gale &agrave; environ 9 800 euros. Fin 2019, pr&egrave;s de 18 millions de jetons ont &eacute;t&eacute; cr&eacute;&eacute;s.</p>\r\n<p><br /><br /></p>\r\n<p dir=\"ltr\">Les &eacute;lections am&eacute;ricaines auront elles recourent au syst&egrave;me de Blockchain ?</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Les &eacute;lections am&eacute;ricaines sont administr&eacute;es et organis&eacute;es localement. Cependant, face &agrave; l&rsquo;&eacute;pid&eacute;mie du Coronavirus, le service postal am&eacute;ricain UPS souhaite int&eacute;grer une blockchain dans ses op&eacute;rations afin d&rsquo;instaurer un syst&egrave;me de vote par correspondance. Un brevet a &eacute;t&eacute; d&eacute;pos&eacute; &agrave; l\'Office am&eacute;ricain des brevets et des marques (USPTO), indiquant qu\'un \"syst&egrave;me de vote peut utiliser la s&eacute;curit&eacute; blockchain associ&eacute;e au courrier pour fournir un syst&egrave;me de vote fiable\" dans lequel les \"&eacute;lecteurs inscrits recevraient un code lisible par leur ordinateur par courrier et confirmeraient leur identit&eacute; ainsi que les informations &eacute;lectorales\".</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Aucune d&eacute;cision n&rsquo;a &eacute;t&eacute; prise &agrave; l&rsquo;heure actuelle.</p>\r\n<p><br /><br /></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong><span id=\"docs-internal-guid-ed56588e-7fff-96f7-859f-6e8958f40b20\">Comment les &eacute;lections pr&eacute;sidentielles des Etats-Unis s&egrave;ment le trouble chez les investisseurs en Bitcoin ? </span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/bitcoin/donald-trump.png\" alt=\"donald-trump.png\" width=\"1125\" height=\"281\" /></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pr&eacute;vues le 3 novembre 2020, les &eacute;lections am&eacute;ricaines arrivent &agrave; grands pas. Pour les investisseurs, les r&eacute;sultats pourraient avoir un impact sur le march&eacute; boursier.&nbsp; En effet, plusieurs sc&eacute;narios s&rsquo;offrent &agrave; eux :</p>\r\n<p>&nbsp;</p>\r\n<p>- Si Donald Trump est &eacute;lu &agrave; la majorit&eacute;, une hausse de la bourse et donc du Bitcoin pourrait &ecirc;tre constat&eacute;e. En effet, Donald Trump a toujours d&eacute;ploy&eacute; de nombreux moyens pour faire monter la bourse.</p>\r\n<p>- Si Joe Biden est &eacute;lu &agrave; la majorit&eacute;, la bourse sera bancale et on pourra alors constater une l&eacute;g&egrave;re baisse du Bitcoin. En effet, dans son programme, Joe Biden pr&eacute;voit une augmentation de la taxation des multinationales.</p>\r\n<p>- Si les r&eacute;sultats sont serr&eacute;s, l&rsquo;incertitude et le moment de flottement pourrait semer la panique au sein de Wall Street. On assistera alors &agrave; une baisse du Bitcoin.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Vous l&rsquo;aurez compris, les &eacute;lections am&eacute;ricaines pourrait avoir une influence sur la valeur en bourse du Bitcoin. Si un des deux candidats est &eacute;lu &agrave; la majorit&eacute;, la transition de pouvoir sera simplifi&eacute; et aura peu d&rsquo;impact sur le prix de la pi&egrave;ce. De l&rsquo;autre c&ocirc;t&eacute;, si l&rsquo;&eacute;lection est cl&ocirc;tur&eacute;e et contest&eacute;e, nous pourrions constater un rebond (inversion des tendances) des actifs sans risque comme l&rsquo;or et le Bitcoin.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :&nbsp;</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://cointelegraph.com/news/how-will-the-us-presidential-election-affect-the-price-of-bitcoin\" target=\"_blank\" rel=\"noopener\">https://cointelegraph.com/news/how-will-the-us-presidential-election-affect-the-price-of-bitcoin</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://fr.cryptonews.com/news/us-postal-service-bets-on-ethereum-blockchain-in-patented-vo-7409.htm\" target=\"_blank\" rel=\"noopener\">https://fr.cryptonews.com/news/us-postal-service-bets-on-ethereum-blockchain-in-patented-vo-7409.htm</a></span></p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-38e9a51a-7fff-e863-0491-5b48cf1a6115\" style=\"font-size: 10pt;\"></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.thecointribune.com/actualites/bitcoinusd-quelle-strategie-adopter-en-vue-de-lelection-us/\" target=\"_blank\" rel=\"noopener\">https://www.thecointribune.com/actualites/bitcoinusd-quelle-strategie-adopter-en-vue-de-lelection-us/</a></span></p>\r\n<p><span id=\"docs-internal-guid-f714e4f1-7fff-03ba-0a17-8287aba9f96d\"></span></p>', 'Le bitcoin est la crypto-monnaie la plus connue dans le monde. Très apprécié en bourse, il pourrait néanmoins connaître certaines fluctuations pendant les élections américaines. Mais à quoi s’attendre ? Quel avenir pour le Bitcoin ?', 3, '2020-10-13 11:40:38', '2021-05-05 12:10:35'),
(4, 'Le SEO, la clé pour augmenter votre visibilité', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>C&rsquo;est quoi exactement le SEO ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Le SEO, en anglais &ldquo;Search Engine Optimization&rdquo;, signifie &laquo; Optimisation pour les moteurs de recherche &raquo;. Selon <a href=\"https://www.seo.fr/\">l&rsquo;Agence SEO</a>, il se traduit par l&rsquo;ensemble des techniques mises en &oelig;uvre pour am&eacute;liorer la position d&rsquo;un site web sur les pages de r&eacute;sultats des moteurs de recherche.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Souvent appel&eacute; R&eacute;f&eacute;rencement Naturel, il englobe :</p>\r\n<p>- L&rsquo;Optimisation On-page, qui d&eacute;signe tous les &eacute;l&eacute;ments des pages d&rsquo;un site web (le titre, les mots cl&eacute;s, &hellip;).</p>\r\n<p>- L&rsquo;Optimisation Off-page, qui repr&eacute;sente l&rsquo;ensemble des &eacute;l&eacute;ments ext&eacute;rieurs &agrave; une page web (les liens qui r&eacute;digent vers le site, la vitesse de chargement des pages, ...).</p>\r\n<p>- L\'Exp&eacute;rience Utilisateur (UX), qui consiste &agrave; penser et &agrave; concevoir un site web de mani&egrave;re &agrave; ce que l\'exp&eacute;rience utilisateur soit la meilleure possible.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Le SEO permet donc d&rsquo;optimiser la visibilit&eacute; d&rsquo;une marque et de son offre et d&rsquo;am&eacute;liorer la visibilit&eacute; de son site web. Il lui permet &eacute;galement d&rsquo;acqu&eacute;rir de nouveaux clients, de se d&eacute;marquer de la concurrence et potentiellement d&rsquo;augmenter son chiffre d&rsquo;affaire.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Quelques chiffres sur le SEO&hellip;</strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/SEO/Infographie%20SEO-1.png\" alt=\"Infographie SEO-1.png\" width=\"750\" height=\"1875\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Le SEO en 2020</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le SEO en 2020, c&rsquo;est &ccedil;a :&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- La notion de &ldquo;mobile fisrt&rdquo; : la plupart des recherches effectu&eacute;es sur le web se font via les appareils mobiles. Il est donc fortement recommand&eacute; d&rsquo;avoir un site dit &ldquo;responsive&rdquo;, c&rsquo;est-&agrave;-dire un site con&ccedil;u et d&eacute;velopp&eacute; de fa&ccedil;on &agrave; pouvoir s\'adapter &agrave; toutes les r&eacute;solutions d\'&eacute;cran (t&eacute;l&eacute;phone, tablette, ordinateur, &hellip;).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- Le passage au HTTPS : Google &agrave; annonc&eacute; privil&eacute;gier les sites HTTPS &agrave; ceux HTTP. Ils permettent de mieux prot&eacute;ger les donn&eacute;es priv&eacute;es des utilisateurs et de s&eacute;curiser leurs transactions bancaires.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- La recherche vocale : 72% des internautes utilisent la recherche vocale. Les requ&ecirc;tes par la voix impliquent entre autres la valorisation du langage conversationnel.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- Le r&eacute;f&eacute;rencement local : En construisant un SEO local, vous appara&icirc;trez sur diverses requ&ecirc;tes li&eacute;es &agrave; votre activit&eacute; dans une zone g&eacute;ographique cibl&eacute;e.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- Le r&eacute;f&eacute;rencement vid&eacute;o : la vid&eacute;o est le format le plus utilis&eacute; sur les r&eacute;seaux sociaux. Il est donc n&eacute;cessaire de produire, optimiser et int&eacute;grer des vid&eacute;os dans vos contenus.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>- Le SXO : il permet d&rsquo;optimiser l&rsquo;exp&eacute;rience utilisateur. Cela permet de rendre votre site plus ergonomique, fluide, intuitif et surtout dot&eacute; d&rsquo;un processus de conversion efficace.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Vous l&rsquo;aurez bien compris, le SEO est en constante &eacute;volution. Il est donc important d&rsquo;effectuer une veille permanente pour &ecirc;tre au courant des derni&egrave;res nouveaut&eacute;s.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :&nbsp;</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://digitiz.fr/blog/statistiques-seo/\" target=\"_blank\" rel=\"noopener\">https://digitiz.fr/blog/statistiques-seo/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.agence90.fr/seo/\" target=\"_blank\" rel=\"noopener\">https://www.agence90.fr/seo/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.seo.fr/definition/seo-definition\" target=\"_blank\" rel=\"noopener\">https://www.seo.fr/definition/seo-definition</a> </span></p>', 'La saviez-vous ? On dénombre 81 000 recherches par seconde sur Google. Alors comment faire pour améliorer la visibilité de votre site ? Générer plus de trafic ? Arriver dans les premiers résultats de Google ? Le SEO, plus communément appelé Référencement Naturel, apporte une réponse à ses différentes questions. Mais comment fonctionne-t-il ?', 2, '2020-10-05 08:38:31', '2021-05-05 12:26:45'),
(5, 'Paypal autorise les achats en crypto-monnaies', 'Robin Couet', '<p style=\"text-align: center; line-height: 1.5;\"><strong><span style=\"color: #000000; font-size: 24pt;\">Acceptation des crypto-monnaies</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">Ce mercredi 21 octobre 2020, paypal rejoint le march&eacute; de la crypto-monnaie. Effectivement, d\'ici les prochaines semaines, les propri&eacute;taires de comptes Paypal am&eacute;ricains pourront avoir dans leur portefeuille&nbsp;des bitcoins et d\'autres crypto-monnaies. Pour les autres pays, il faudra attendre d&eacute;but 2021 pour profiter de cette nouvelle fonctionnalit&eacute;.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Paypal/paypal-bitcoin.jpeg\" alt=\"paypal-bitcoin.jpeg\" width=\"900\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1.5;\"><span style=\"font-size: 24pt; color: #000000;\"><strong>Investissement simplifi&eacute;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">La soci&eacute;t&eacute; aux 346 millions de comptes actifs et aux 222 milliards de transactions au 2eme trimestre se lance dans la d&eacute;mocratisation des crypto-monnaies. Paypal souhaite rendre accessible facilement les crypto-monnaies, son pr&eacute;sident Dan Shulman d&eacute;clare dans une interview pour Reuters : &laquo; Nous travaillons avec les banques centrales et r&eacute;fl&eacute;chissons &agrave; toutes les formes de monnaies num&eacute;riques et &agrave; la mani&egrave;re dont PayPal peut jouer un r&ocirc;le &raquo;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Paypal/crypto-monnaies.jpg\" alt=\"crypto-monnaies.jpg\" width=\"640\" height=\"394\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000000;\"><strong><span style=\"font-size: 24pt;\">Nouveaut&eacute; pour le e-commerce</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">Les e-commerces utilisant Paypal pourront &eacute;galement accepter les paiements en crypto-monnaies, celle-ci sera transform&eacute;e automatiquement en devises fiduciaires telles que le dollar ou l\'euro afin d\'&eacute;viter tout probl&egrave;me de fluctuation, qui est monnaie courante chez les cryptos.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PayPal autorisera initialement les achats de bitcoin et d\'autres crypto-monnaies telles que l\'ethereum, le bitcoin cash et le litecoin.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://andreasgal.com/2017/07/19/firefox-marketshare-revisited/\" target=\"_blank\" rel=\"noopener\">https://www.reuters.com/article/idUSL1N2HB14U</a></span></p>', 'Breaking news : Paypal permet d\'acheter, de vendre et de conserver des bitcoins et d\'autres crypto-monnaies grâce à leur portefeuille en ligne. Le géant du paiement en ligne va également permettre au marchants d\'accepter les paiements en crypto-monnaie.', 3, '2020-10-21 14:26:02', '2021-05-05 12:21:32'),
(6, 'Fredonner l’air d’une musique pour trouver son titre : désormais possible grâce à Google', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les applications de reconnaissance musicale : pr&eacute;sentes depuis plus de 20 ans.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Jusqu\'&agrave; maintenant, Shazam est l&rsquo;application de r&eacute;f&eacute;rence en mati&egrave;re de reconnaissance musicale.&nbsp; D&rsquo;autres applications et logiciels existent comme SoundHound et Tunatic mais sont moins utilis&eacute;s par les utilisateurs.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Cr&eacute;&eacute;e en 1999, Shazam permet de trouver le titre d&rsquo;une chanson et le nom d&rsquo;un artiste en quelques secondes. Pour ce faire, elle utilise le microphone du t&eacute;l&eacute;phone afin de capturer un &eacute;chantillon de musique jou&eacute;e qui sera compar&eacute; &agrave; la base de donn&eacute;es centrale de la soci&eacute;t&eacute;. Il vous est ensuite possible d&rsquo;ajouter le titre &agrave; votre compte iTunes, YouTube, Spotify, Deezer ou Apple Music.</p>\r\n<p dir=\"ltr\">Rachet&eacute;e en 2018 par le groupe Apple, Shazam compte aujourd&rsquo;hui plus de 100 millions d&rsquo;utilisateurs &agrave; travers le monde.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un b&eacute;mol est cependant observ&eacute; par les utilisateurs de ces diff&eacute;rentes applications : les musiques &eacute;lectroniques, notamment entendues lors de DJ Set, n&rsquo;&eacute;taient pas reconnues par les bases de donn&eacute;es.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-b2665c66-7fff-b26a-c3ce-7a70362a178b\" style=\"font-size: 14pt;\">Google : un pas de plus dans la reconnaissance musicale</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Google avait d&eacute;j&agrave; lanc&eacute; une fonctionnalit&eacute; de reconnaissance musicale. Le seul probl&egrave;me : les utilisateurs pointent du doigt son manque de performance.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour pallier ce probl&egrave;me, Google a donc lanc&eacute; une nouvelle version, qui vous permet de trouver le titre d&rsquo;une chanson simplement en la fredonnant ou en la sifflotant. D&eacute;sormais, l&rsquo;intelligence artificielle qui s&rsquo;occupe de reconna&icirc;tre vos musiques contient une base de donn&eacute;es quatre fois plus importante que la version initiale.</p>\r\n<p dir=\"ltr\">Pour trouver votre chanson, il vous suffit de lancer l&rsquo;application &ldquo;Google Assistant&rdquo; et de lui demander &ldquo;Quelle est cette chanson ?&rdquo;. Gr&acirc;ce &agrave; un apprentissage automatique et &agrave; des algorithmes puissants, l&rsquo;assistance virtuelle utilise vos fredonnements pour les transformer en s&eacute;quences num&eacute;riques afin de les comparer &agrave; l&rsquo;empreinte digitale des morceaux existants.&nbsp;</p>\r\n<p dir=\"ltr\">Cette fonctionnalit&eacute; est disponible gratuitement dans une vingtaine de langues sous Android (dont le Fran&ccedil;ais) et seulement en anglais sur iOS.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">M&ecirc;me si d&rsquo;autres applications et logiciels comme SoundHound proposaient d&eacute;j&agrave; un syst&egrave;me de reconnaissance de musique par le fredonnement, Google risque de d&eacute;stabiliser ces diff&eacute;rents services du fait de sa forte influence et notori&eacute;t&eacute; &agrave; travers le monde&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://www.youtube.com/embed/DW61PpKJGm8?feature=emb_title\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.20minutes.fr/high-tech/2886763-20201016-google-assistant-permet-de-retrouver-une-musique-en-fredonnant-la-melodie\" target=\"_blank\" rel=\"noopener\">https://www.20minutes.fr/high-tech/2886763-20201016-google-assistant-permet-de-retrouver-une-musique-en-fredonnant-la-melodie</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.journaldugeek.com/2020/10/16/google-chanson-fredonne-reconnaitre/\" target=\"_blank\" rel=\"noopener\">https://www.journaldugeek.com/2020/10/16/google-chanson-fredonne-reconnaitre/</a></span></p>\r\n<p><span id=\"docs-internal-guid-cb8ad2dc-7fff-3d36-ba35-c20c5bcee405\" style=\"font-size: 10pt;\"></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://support.google.com/googleplaymusic/answer/2913276?hl=fr\" target=\"_blank\" rel=\"noopener\">https://support.google.com/googleplaymusic/answer/2913276?hl=fr</a></span></p>', 'Nous avons tous déjà entendu une musique sans pour autant savoir son nom... Notre premier réflexe est alors de sortir notre téléphone et de “shazamer” ce fameux morceau. L\'application Google nous permet désormais de reconnaître une musique juste en la fredonnant. Start-Win vous en dit plus !', 3, '2020-10-27 13:14:41', '2021-05-05 12:24:38'),
(7, 'Le télétravail et les sites e-commerce une nouvelle fois à l’appel', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Le t&eacute;l&eacute;travail fait son grand retour</span></strong></p>\r\n<p><span id=\"docs-internal-guid-14465b80-7fff-ab11-5142-ecccf582c8de\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Ce vendredi 30 octobre, l&rsquo;ensemble du territoire fran&ccedil;ais se retrouvera une fois de plus &agrave; l&rsquo;arr&ecirc;t. Au vu de la situation sanitaire toujours inqui&eacute;tante, Emmanuel Macron a pris la d&eacute;cision difficile de mettre en place un second confinement qui s&rsquo;&eacute;tendra a minima jusqu&rsquo;au 1er d&eacute;cembre.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-9ef49c31-7fff-3760-5c09-df14807617f4\"></span></p>\r\n<p dir=\"ltr\">Alors qu&rsquo;est-ce qui va changer pour notre vie professionnelle ? &ldquo;partout o&ugrave; c&rsquo;est possible&rdquo;, le t&eacute;l&eacute;travail va &ecirc;tre g&eacute;n&eacute;ralis&eacute;. Cependant, les services publics, les usines ou les exploitations agricoles devraient rester ouverts tout comme les commerces essentiels (supermarch&eacute;s, bureaux de tabac, &hellip;).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-3e16bbcd-7fff-c063-4036-2c48d19f356e\">Mais quels sont les avantages du t&eacute;l&eacute;travail ?</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Confinement/infographie-confinement_4.svg\" alt=\"infographie-confinement_4.svg\" width=\"600\" height=\"1494\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">L&rsquo;importance du e-commerce pour les commer&ccedil;ants locaux</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Face &agrave; la fermeture des commerces non-essentiels, de nombreuses boutiques locales vont devoir s&rsquo;adapter pour ne pas perdre un chiffre d&rsquo;affaire trop important. Un site vitrine est un bon d&eacute;part, mais un site e-commerce est encore mieux. En effet, avec les p&eacute;riodes de No&euml;l qui approche un grand pas, de nombreux fran&ccedil;ais vont effectuer leurs achats en ligne. Mais quels sont les avantages d&rsquo;un site e-commerce pour votre entreprise en p&eacute;riode de crise ?</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-195deba9-7fff-35b3-bfc1-e462af3bd89b\"></span></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><span id=\"docs-internal-guid-3a8611c1-7fff-2b7b-86e4-40f5f69cb5dd\"></span></p>\r\n<p>- Votre boutique reste ouverte 24h/24 et 7j/7.</p>\r\n<p>- Toucher des clients partout dans le monde.</p>\r\n<p>- G&eacute;n&eacute;rer des ventes malgr&eacute; la fermeture de votre magasin physique.</p>\r\n<p>- La facilit&eacute; de mettre en avant ses produits phares.</p>\r\n<p>- L&rsquo;adaptation facile aux tendances.</p>\r\n<p>- Varier les contenues.</p>\r\n<p>- Un confort pour le client.</p>\r\n<p>- Une source d&rsquo;information pour enrichir votre fichier client.</p>\r\n<p>- Se mettre en avant par rapport &agrave; la concurrence.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Reste &agrave; voir quelles vont &ecirc;tre les consignes pr&eacute;cises concernant le t&eacute;l&eacute;travail et l&rsquo;utilisation du e-commerce. En effet, Francis Palombi, pr&eacute;sident de la Conf&eacute;d&eacute;ration des commer&ccedil;ants de France, d&eacute;sire que les g&eacute;ants du e-commerce ne profiterons pas de ce deuxi&egrave;me confinement pour pouvoir faire de grandes promotions. Plus d&rsquo;informations sont &agrave; venir dans les prochains jours, restez actifs !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-db1414bd-7fff-ce1c-cd23-c9a116d8f3a6\">Nous vous rappelons que votre agence Start-Win peut se charger de la conception de votre site e-commerce. N&rsquo;h&eacute;sitez pas &agrave; nous contacter pour plus d&rsquo;informations.</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><em><span style=\"font-size: 10pt;\">Sources :</span></em></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.lemonde.fr/les-decodeurs/article/2020/10/28/reconfinement-ecoles-travail-deplacements-ce-qui-est-autorise-ou-interdit_6057712_4355770.html\" target=\"_blank\" rel=\"noopener\">https://www.lemonde.fr/les-decodeurs/article/2020/10/28/reconfinement-ecoles-travail-deplacements-ce-qui-est-autorise-ou-interdit_6057712_4355770.html</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.linternaute.com/sortir/magazine/2489135-commerces-ouverts-ou-fermes-en-confinement-liste-des-magasins-essentiels-ou-non/\" target=\"_blank\" rel=\"noopener\">https://www.linternaute.com/sortir/magazine/2489135-commerces-ouverts-ou-fermes-en-confinement-liste-des-magasins-essentiels-ou-non/</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.oberlo.fr/blog/avantages-et-inconvenients-e-commerce\" target=\"_blank\" rel=\"noopener\">https://www.oberlo.fr/blog/avantages-et-inconvenients-e-commerce</a></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><a href=\"https://www.l-expert-comptable.com/teletravail-motivation-limites-avantages-inconvenients-mise-en-place-offre-emploi-annonces-definition-secretariat-domicile\" target=\"_blank\" rel=\"noopener\">https://www.l-expert-comptable.com/teletravail-motivation-limites-avantages-inconvenients-mise-en-place-offre-emploi-annonces-definition-secretariat-domicile</a></span></p>', 'C’est officiel ! Un second confinement, à échelle nationale, a été annoncé ce mercredi 28 octobre par le président Emmanuel Macron. Cependant, plusieurs dispositions vont différer par rapport à la première version. Alors qu’est-ce qui va concrètement changer pour notre vie professionnelle ?', 3, '2020-10-29 15:52:12', '2021-05-05 12:28:40'),
(8, 'Site sur-mesure vs CMS', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Qu&rsquo;est-ce qu&rsquo;un CMS ? Quels sont ses inconv&eacute;nients ?&nbsp;</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un CMS, de son anglais Content Management System, est un syst&egrave;me de gestion de contenu. Il caract&eacute;rise l&rsquo;ensemble des logiciels qui permettent de concevoir, g&eacute;rer et mettre &agrave; jour des sites web ou applications mobiles.</p>\r\n<p dir=\"ltr\">Avec la d&eacute;mocratisation du web, de nombreuses soci&eacute;t&eacute;s se sont sp&eacute;cialis&eacute;es dans les CMS. Comme par exemple WordPress (logiciel le plus utilis&eacute;, avec plus de 60% des parts de march&eacute;), Wix, Joomla, Drupal, Solocal, ...</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Malgr&eacute; certains avantages comme un co&ucirc;t r&eacute;duit et une forte accessibilit&eacute;, l&rsquo;utilisation d&rsquo;un CMS pr&eacute;sente une majorit&eacute; d&rsquo;inconv&eacute;nients.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/CMS/inconvenients-des-cms.svg\" alt=\"inconvenients-des-cms.svg\" width=\"1917\" height=\"4793\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Pourquoi utiliser la solution sur-mesure de Start-Win ?</span></strong><br /><br /></p>\r\n<p dir=\"ltr\">Start-Win est la solution pour am&eacute;liorer l&rsquo;image de votre entreprise, augmenter votre visibilit&eacute; et acc&eacute;der &agrave; une meilleure gestion de contenus !<br /><br /></p>\r\n<p>- Notre &eacute;quipe est jeune et dynamique. Passionn&eacute;e et professionnelle, nous poss&eacute;dons des expertises dans la cr&eacute;ation d\'interface, dans l&rsquo;UX UI (experience utilisateur) ainsi que dans le d&eacute;veloppement d\'applications et dans les diff&eacute;rents langages de d&eacute;veloppement (PHP, JavaScript, &hellip;). &Agrave; l&rsquo;&eacute;coute des tendances, nous faisons preuve d\'adaptabilit&eacute; pour proposer le meilleur &agrave; nos clients.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">- Start-Win pr&eacute;sente une diversit&eacute; de services pour r&eacute;pondre au mieux &agrave; vos besoins : cr&eacute;ation de site vitrine et e-commerce, conception de logo et charte graphique, &eacute;laboration d&rsquo;application, r&eacute;f&eacute;rencement SEO, h&eacute;bergement, maintenance web et projets imprim&eacute;s.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">- Nous vous proposons une formule sur-mesure pour s&rsquo;adapter au mieux &agrave; vos attentes et envies. Contrairement au CMS comme WordPress ou Wix, nous imaginons et concevons votre site de A-Z (outils de gestion de contenu, &hellip;). Cela vous permet de ne pas &ecirc;tre limit&eacute; quant aux fonctionnalit&eacute;s.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">- Une fois votre site web en ligne, Start-Win met &agrave; votre disposition son outils &ldquo;clef en main&rdquo; qui vous permet de manager vous-m&ecirc;me votre page (gestions d&rsquo;images, de textes, de contenus couleurs et logo).</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">- Start-Win vous accompagne tout au long de votre projet en prenant soin d&rsquo;&ecirc;tre disponible, &agrave; l&rsquo;&eacute;coute et r&eacute;actif. Nous vous conseillons et nous nous adaptons facilement &agrave; vos besoins. Nous souhaitons placer le client au coeur du projet et instaurer une relation de confiance pour plus de proximit&eacute;. Tous nos clients qui nous ont fait confiance sont satisfaits de nos prestations.</p>\r\n<p>&nbsp;</p>\r\n<p>Alors n\'h&eacute;sitez plus, contactez Start-Win pour la r&eacute;alisation de votre site web !</p>', 'Aujourd’hui, un site web est indispensable pour augmenter son chiffre d’affaire et sa visibilité, mais aussi pour favoriser une bonne image. Mais avec une forte diversité d’offres, la question est : Vers qui se tourner pour la création de son site ?', 2, '2020-11-02 15:48:47', '2021-05-05 12:27:29'),
(9, 'Les aides à la digitalisation des entreprises (hors Covid)', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Au niveau local</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un grand nombre de r&eacute;gions proposent des aides pour accompagner les entreprises.&nbsp;Il s&rsquo;agit souvent d&rsquo;une subvention appel&eacute;e &ldquo;ch&egrave;que num&eacute;rique&rdquo; ou &ldquo;pass num&eacute;rique&rdquo;.&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Ces subventions permettent globalement l&rsquo;inclusion num&eacute;rique mais aussi, de r&eacute;pondre aux besoins de formations des citoyens (particuliers, salari&eacute;s, etc, &hellip;) en mati&egrave;re d&rsquo;utilisation des outils num&eacute;riques. Le pass permet notamment de financer :&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Le lancement d&rsquo;un e-commerce ou commerce en ligne,&nbsp;</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Un prestataire pour cr&eacute;er un nouveau site web,</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Le d&eacute;veloppement de la pr&eacute;sence de votre entreprise sur les r&eacute;seaux sociaux.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Cette aide varie bien &eacute;videmment selon votre r&eacute;gion, votre secteur d&rsquo;activit&eacute; et la taille de votre entreprise.</p>\r\n<p style=\"text-align: justify;\"><br /><br /></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><em>Exemples d&rsquo;aides dans l&rsquo;Ouest de la France :&nbsp;</em></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">R&eacute;gion Pays de la Loire :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\"><a href=\"https://www.paysdelaloire.fr/les-aides/pays-de-la-loire-investissement-numerique\" target=\"_blank\" rel=\"noopener\">Pays de la Loire Investissement num&eacute;rique</a> : jusqu&rsquo;&agrave; 15 000 euros.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\"><a href=\"https://www.paysdelaloire.fr/les-aides/ami-industrie-du-futur\" target=\"_blank\" rel=\"noopener\">AMI Industrie du Futur</a> : jusqu&rsquo;&agrave; 400 000 euros.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">R&eacute;gion Bretagne :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\"><a href=\"https://www.morbihan.cci.fr/sites/ccimorbihan/files/fiche_produit_cheque_numerique.pdf\" target=\"_blank\" rel=\"noopener\">Ch&egrave;que num&eacute;rique CCI Bretagne</a> : jusqu&rsquo;&agrave; 240 euros.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">R&eacute;gion Normandie :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\"><a href=\"https://aides.normandie.fr/sites/default/files/booster_ia.pdf\" target=\"_blank\" rel=\"noopener\">BOOSTER IA : &ldquo;pour un num&eacute;rique innovant et durable&rdquo;</a> : jusqu&rsquo;&agrave; 18 500 euros.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">R&eacute;gion Hauts-De-France :&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\"><a href=\"https://guide-aides.hautsdefrance.fr/aide784\" target=\"_blank\" rel=\"noopener\">Investissement Num&eacute;rique des Artisans / Commer&ccedil;ants (INAC)</a> : jusqu&rsquo;&agrave; 12 000 euros.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Au niveau national</strong></span></p>\r\n<p><span id=\"docs-internal-guid-028eb8de-7fff-a058-48b9-fc7bc36b4492\">&nbsp;</span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/aides-a-la-digitalisation/Aides%20%C3%A0%20la%20digitalisation.png\" alt=\"Aides &agrave; la digitalisation.png\" width=\"750\" height=\"1875\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Au niveau europ&eacute;en</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Les aides pour le d&eacute;veloppement num&eacute;rique existent &eacute;galement au niveau europ&eacute;en notamment avec le <a href=\"https://www.europe-en-france.gouv.fr/fr/fonds-europeens/fonds-europeen-de-developpement-regional-FEDER\" target=\"_blank\" rel=\"noopener\">FEDER (Fonds Europ&eacute;en de D&eacute;veloppement R&eacute;gional)</a>, qui peut accorder des subventions pour&nbsp; les th&eacute;matiques suivantes :&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">L&rsquo;innovation et la recherche.</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">La strat&eacute;gie num&eacute;rique.</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Le soutien aux petites et moyennes entreprises (PME).</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">L&rsquo;&eacute;conomie sobre en carbone.</p>\r\n</li>\r\n</ul>', 'Aujourd\'hui, il est indispensable pour votre entreprise de se digitaliser. Toutefois, les contraintes financières peuvent compliquer ce processus. Nombreuses sont les aides qui vous accompagneront dans votre digitalisation. Start-Win vous en dit plus !', 3, '2020-11-09 15:43:01', '2021-06-08 16:53:01');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(10, 'Le Click & Collect : une solution pour les commerçants locaux', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Le Click &amp; Collect c&rsquo;est quoi ? </strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Aussi appel&eacute; &ldquo;cliqu&eacute;-retir&eacute;&rdquo;, le Click &amp; Collect permet &agrave; l\'acheteur de pouvoir effectuer sa commande en ligne (click) puis de venir la r&eacute;cup&eacute;rer en magasin (collect).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>A qui s&rsquo;adresse-t-il ?</strong></span>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Le Click &amp; Collect s&rsquo;adresse &agrave; tous les commer&ccedil;ants qui disposent d&rsquo;une boutique physique.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Attention : l&rsquo;utilisation du Click and Collect n&rsquo;emp&ecirc;chera pas les commer&ccedil;ants ferm&eacute;s administrativement de b&eacute;n&eacute;ficier des aides gouvernementales : &laquo; Nous avons d&eacute;cid&eacute; que le chiffre d&rsquo;affaires g&eacute;n&eacute;r&eacute; par le retrait commande ne rentrera pas en compte dans le calcul du montant du fonds de solidarit&eacute; auquel les commerces ferm&eacute;s ont tous le droit. &raquo; &ndash; Bruno Le Maire</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">N&rsquo;h&eacute;sitez pas &agrave; lire <a href=\"../../../blog/les-aides-a-la-digitalisation-des-entreprises-hors-covid\" target=\"_blank\" rel=\"noopener\">notre article concernant les aides &agrave; la digitalisation des entreprises</a>.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong><span id=\"docs-internal-guid-051515dd-7fff-ca5a-e0a4-cdaad4323520\">Comment &ccedil;a fonctionne ? </span></strong></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Click%20and%20collect/infoclick%26collect.png\" alt=\"infoclick&amp;collect.png\" width=\"750\" height=\"1875\" /></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les avantages du Click &amp; Collect pendant le confinement&nbsp;</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Pendant le confinement, le Click and Collect peut &ecirc;tre une alternative face &agrave; la fermeture de votre commerce. En effet, en plus de favoriser le maintien de votre une activit&eacute;, celui-ci vous permet &eacute;galement :&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">D&rsquo;assurer la continuit&eacute; de vos ventes (de votre chiffre d&rsquo;affaires).</p>\r\n</li>\r\n</ul>\r\n<ul style=\"margin-top: 0; margin-bottom: 0;\">\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">De d&eacute;velopper votre visibilit&eacute; en attirant une nouvelle client&egrave;le.&nbsp;</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">D&rsquo;&eacute;conomiser sur vos frais de livraison.&nbsp;</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">De simplifier votre logistique (gain de temps).</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">De rester accessible 24h/24.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">De fid&eacute;liser vos clients habituels.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"line-height: 1.68; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">&nbsp;</span></strong></p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Start-Win s&rsquo;engage &agrave; soutenir les commer&ccedil;ant locaux durant le confinement</span></strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Les mesures gouvernementales imposent la fermeture de votre magasin ? Pas de panique ! Start-Win a la solution :</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Cr&eacute;ation de votre site Click &amp; Collect.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Mise en ligne de vos produits.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">S&eacute;curisation des paiements.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Prestations sur-mesure.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Continuez votre activit&eacute; pour le plaisir de vos clients !</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Contactez-nous d&egrave;s maintenant :</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Par t&eacute;l&eacute;phone : 06 83 23 86 53</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Par email : contact@start-win.fr</p>', 'Présentant un mode de fonctionnement particulièrement simple et de nombreux avantages, le Click & Collect peut vous permettre de favoriser le maintien de votre activité pendant le confinement. Start-Win vous en dit plus !', 3, '2020-11-23 08:15:09', '2021-05-05 12:13:34'),
(11, 'Professionnels : pourquoi Internet Explorer est à bannir ?', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Le moteur de recherche sign&eacute; Microsoft en chute libre</span></strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Avec une premi&egrave;re version sortie en 1995, Internet Explorer est un navigateur web d&eacute;velopp&eacute; par la soci&eacute;t&eacute; am&eacute;ricaine Microsoft.&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Entre la fin des ann&eacute;es 1990 et 2012, il est le navigateur le plus utilis&eacute; au monde. En effet, en octobre 2012, Internet Explorer occupait 54 % du march&eacute;, d&eacute;tr&ocirc;nant ainsi tous ses concurrents. Aujourd&rsquo;hui, il occupe seulement 1,96 % du march&eacute;, chass&eacute; de sa premi&egrave;re place par le g&eacute;ant du web Google Chrome.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">En 2015, Microsoft d&eacute;cide de sortir un nouveau navigateur web dans le but de remplacer Internet Explorer. C&rsquo;est la naissance de Microsoft Edge.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-weight: normal;\"><br /><br /></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>De nombreux probl&egrave;mes de s&eacute;curit&eacute;</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Internet Explorer est un navigateur tr&egrave;s critiqu&eacute;, notamment en raison d&rsquo;une faille de s&eacute;curit&eacute; importante. En effet, Microsoft a notifi&eacute; une vuln&eacute;rabilit&eacute; qui permettrait &agrave; des personnes mal-intentionn&eacute;es de prendre le contr&ocirc;le de votre ordinateur si vous ex&eacute;cutez Internet Explorer. Plus sp&eacute;cifiquement, le hacker pourrait rentrer un code et obtenir les m&ecirc;mes droits d&rsquo;administrateur que l&rsquo;utilisateur : il peut alors installer des programmes, modifier ou supprimer des donn&eacute;es&hellip;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">L&rsquo;US-CERT (service du d&eacute;partement de la S&eacute;curit&eacute; int&eacute;rieure des &Eacute;tats-Unis) a d&rsquo;ailleurs indiqu&eacute; que cette faille aurait d&eacute;j&agrave; &eacute;t&eacute; exploit&eacute;e par des hackers.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Par ailleurs, Microsoft recommande de ne plus utiliser Internet Explorer. En effet, selon Chris Jackson, un des chefs de la cybers&eacute;curit&eacute; chez Microsoft, &laquo; les d&eacute;veloppeurs ne font m&ecirc;me plus de tests pour Internet Explorer. Ils testent sur des navigateurs modernes &raquo;.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Enfin, Internet Explorer n&rsquo;est pas compatible avec les nouvelles technologies et notamment les nouveaut&eacute;s HTML, CSS ou encore Javascript.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Start-Win vous recommande de ne plus utiliser Internet Explorer. En effet, en tant que professionnels, il est essentiel de veiller &agrave; la bonne s&eacute;curisation des donn&eacute;es client.</p>', 'Internet Explorer, navigateur web de la société Microsoft, est encore utilisé par de nombreuses personnes à travers le monde. Il est pourtant conseillé de ne plus exécuter ce logiciel en raison de failles de sécurité importantes. Start-Win vous en dit plus !', 3, '2020-11-24 14:55:37', '2021-05-05 12:18:23'),
(12, 'Développeurs : PHP 8 enfin dévoilé', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">C&rsquo;est quoi le PHP ? </span></strong><br /><br /></p>\r\n<p style=\"text-align: justify;\"><span id=\"docs-internal-guid-f8a7609e-7fff-4d00-7e34-f15309c99a45\"></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Avec une premi&egrave;re version en 1994, Le PHP (de son anglais &ldquo;Hypertext Preprocessor&rdquo;) est un langage informatique qui permet de d&eacute;velopper un site web dynamique. &Eacute;tant l&rsquo;un des langages les plus utilis&eacute;s, il permet de g&eacute;n&eacute;rer du code HTML, CSS ou encore XHTML, des donn&eacute;es (en PNG, JPG, etc.) ou encore des fichiers PDF. En perp&eacute;tuel d&eacute;veloppement, le PHP est aujourd&rsquo;hui reconnu pour sa fiabilit&eacute; et sa performance.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">PHP 8 : un nouveau compilateur JIT&nbsp;</span></strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5 ans apr&egrave;s la sortie de sa version pr&eacute;c&eacute;dente (d&eacute;cembre 2015), PHP 8 a enfin &eacute;t&eacute; d&eacute;voil&eacute; pour le plus grand plaisir de nos amis d&eacute;veloppeurs. Avec pour objectif d&rsquo;am&eacute;liorer les performances, PHP 8 est dot&eacute; d\'un nouveau compilateur JIT (just in time) plus rapide et de nouvelles fonctionnalit&eacute;s.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Le nouveau compilateur JIT, nouveaut&eacute; propos&eacute;e par PHP 8, permet de rendre l\'ex&eacute;cution des programmes encore plus rapide. En effet, il va d&eacute;sormais compiler des parties du code pendant son ex&eacute;cution et agira donc de la m&ecirc;me mani&egrave;re qu&rsquo;une version en cache du code. Avec un r&eacute;sultat jusqu&rsquo;&agrave; 4 fois plus rapide et une meilleure utilisation de la m&eacute;moire, ce nouveau compilateur pr&eacute;sente cependant un b&eacute;mol : il n&rsquo;aurait pas d&rsquo;effets spectaculaires sur les performances des CMS (comme WordPress) et des frameworks (comme Symfony).</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"float: left;\" src=\"../../../files/Blog/PHP%208/schema.svg\" alt=\"schema.svg\" width=\"1920\" height=\"1094\" /></p>\r\n<p dir=\"ltr\"><em><span id=\"docs-internal-guid-780d7f75-7fff-e4e1-b646-7010a992e2ab\">Contribution relative du JIT &agrave; la performance de PHP 8</span></em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Et de nouvelles fonctionnalit&eacute;s...</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Encore dans un souci d\'efficacit&eacute;, PHP 8 apporte un grand nombre de nouvelles fonctionnalit&eacute;s, comme, entre autres :</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Les types d&rsquo;unions qui acceptent des valeurs de plusieurs types diff&eacute;rents pour la propri&eacute;t&eacute; d&rsquo;une seule classe.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Les attributs qui permettent d&rsquo;ajouter des m&eacute;tadonn&eacute;es afin de caract&eacute;riser les propri&eacute;t&eacute;s des objets, des &eacute;l&eacute;ments ou des fichiers.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Les WeakMap qui permettent d&rsquo;&eacute;conomiser des ressources lors de la manipulation des objets.&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">L&rsquo;op&eacute;rateur NullSafe qui permet d&rsquo;utiliser une cha&icirc;ne d&rsquo;appel au lieu de faire des v&eacute;rifications conditionnelles de null.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">L&rsquo;expression Match (similaire &agrave; Switch) est une expression qui signifie que son r&eacute;sultat peut &ecirc;tre enregistr&eacute; dans une variable ou retourn&eacute;.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Vous pouvez consulter la liste compl&egrave;te des nouveaut&eacute;s depuis <a href=\"https://www.php.net/releases/8.0/fr.php?lang=fr\" target=\"_blank\" rel=\"noopener\">l&rsquo;annonce officielle</a>.</p>', 'Chers développeurs… C’est Noël avant l’heure ! Le 26 novembre sortait la version 8 de PHP, présentant ainsi de nouvelles fonctionnalités, de nombreux changements et une amélioration globale des performances. Start-Win vous en dit plus !', 3, '2020-12-01 12:24:01', '2021-05-05 12:23:54'),
(13, 'Retour sur le monde de l’entreprise en 2020', 'Pauline Motheron', '<p style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\"><span id=\"p16\">Un peu de culture g&eacute;n&eacute;rale :</span><span id=\"p17\">&nbsp;les marques les plus puissantes en 2020&nbsp;</span></span></strong><br /><br /><span id=\"p21\">Parce qu&rsquo;il est toujours important d&rsquo;observer et d\'analyser nos concurrents, voici les marques les plus puissantes en 2020 selon <a href=\"https://interbrand.com/best-global-brands/\" target=\"_blank\" rel=\"noopener\">Interbrand</a> :</span></p>\r\n<p><span id=\"docs-internal-guid-e88bb6ff-7fff-256c-8edc-4fa1329b61e7\"></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">1 - Apple : 323 milliards $</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">2 - Amazon : 200,67 milliards $</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">3 - Microsoft : 166 milliards $</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">4 - Google : 165,44 milliards $</p>\r\n<p dir=\"ltr\" role=\"presentation\">5 - Samsung : 62,29 milliards $</p>\r\n<p dir=\"ltr\" role=\"presentation\">6 - Coca-Cola : 56,89 milliards $</p>\r\n<p dir=\"ltr\" role=\"presentation\">7 - Toyota : 51,60 milliards $</p>\r\n<p dir=\"ltr\" role=\"presentation\">8 - Mercedes : 49,27 milliards $</p>\r\n<p dir=\"ltr\" role=\"presentation\">9 - McDonald&rsquo;s : 42,82 milliards $</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">10 - Disney : 40,77 milliards $</p>\r\n<p>&nbsp;</p>\r\n<p>Les marques fran&ccedil;aises les plus puissantes en 2020 sont :&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>1 - Louis Vitton</p>\r\n<p>2 - Chanel</p>\r\n<p><span id=\"docs-internal-guid-652f40be-7fff-ea8f-cad0-187de7969693\"></span></p>\r\n<p dir=\"ltr\" role=\"presentation\">3 - Herm&egrave;s</p>\r\n<p>4 - l&rsquo;Or&eacute;al</p>\r\n<p>5 - AXA</p>\r\n<p dir=\"ltr\" role=\"presentation\">6 - Danone</p>\r\n<p dir=\"ltr\" role=\"presentation\">7 - Cartier</p>\r\n<p dir=\"ltr\" role=\"presentation\">8 - Dior</p>\r\n<p>9 - Hennessy</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Les grandes tendances du monde de l&rsquo;entreprise en 2020</span></strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">La virtualisation du poste de travail : avec les nouvelles tendances soci&eacute;tales (nos modes de vie, la transition &eacute;cologique, la digitalisation des relations, les crises sanitaires...), de nouveaux modes de travail s&rsquo;implantent, comme, notamment, le t&eacute;l&eacute;travail.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\"><span id=\"docs-internal-guid-6c10d72f-7fff-f472-f03e-5ae61e663acc\">Un lieu de travail qui doit se r&eacute;inventer chaque jour : de nombreuses personnes aspirent &agrave; une meilleure qualit&eacute; de vie au travail. Il est donc n&eacute;cessaire, en tant qu&rsquo;entreprise, d\'optimiser l&rsquo;espace de travail de ses salari&eacute;s afin de contribuer &agrave; leur bien-&ecirc;tre, et, ainsi, assister &agrave; l&rsquo;am&eacute;lioration de leurs performances.</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\"><span id=\"docs-internal-guid-6c10d72f-7fff-f472-f03e-5ae61e663acc\"></span>L&rsquo;exp&eacute;rience&nbsp;<span id=\"43\">client</span>&nbsp;au c&oelig;ur des strat&eacute;gies :<span id=\"p41\">&nbsp;vous connaissez sans doute l&rsquo;expression &ldquo;le client est roi&rdquo;.</span><span id=\"p42\">&nbsp;L&rsquo;exp&eacute;rience&nbsp;<span id=\"44\">client</span>&nbsp;s\'appuie sur le m&ecirc;me&nbsp;<span id=\"45\">principe mais</span> en se concentrant sur l&rsquo;am&eacute;lioration et la simplification des processus, ainsi que la digitalisation et l&rsquo;automatisation gr&acirc;ce &agrave; l&rsquo;Intelligence Artificielle.</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\"><span id=\"p42\"></span><span id=\"docs-internal-guid-d71919d1-7fff-680f-4387-bf6a3c84212b\">Une organisation et un management qui &eacute;voluent : de plus en plus d&rsquo;entreprises consid&egrave;rent leurs salari&eacute;s comme des acteurs &agrave; part enti&egrave;re, en les pla&ccedil;ant au c&oelig;ur des processus de prise de d&eacute;cisions, en leur permettant ainsi d&rsquo;avoir plus de responsabilit&eacute;s.</span><span id=\"docs-internal-guid-d71919d1-7fff-680f-4387-bf6a3c84212b\"></span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\"><span id=\"p48\"></span><span id=\"docs-internal-guid-c3127c92-7fff-8a63-a405-bc2efeb4532a\">Les entreprises engag&eacute;es : face aux enjeux environnementaux et soci&eacute;taux actuels, mais aussi &agrave; l&rsquo;opinion mondiale, les entreprises doivent int&eacute;grer dans leur strat&eacute;gie les pr&eacute;occupations sociales et environnementales &agrave; leurs activit&eacute;s. </span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\"><span id=\"p59\"><span id=\"70\">Covid</span>&nbsp;19 :</span><span id=\"p80\">&nbsp;le boom du num&eacute;rique</span></span></strong><br /><br /><span id=\"p62\">La crise sanitaire du&nbsp;<span id=\"72\">Covid</span>&nbsp;19 a boulevers&eacute; le monde du num&eacute;rique.</span><span id=\"p63\">&nbsp;En effet, face &agrave; l&rsquo;arr&ecirc;t de certains secteurs d&rsquo;activit&eacute;s et &agrave; la fermeture des commerces, les entreprises ont d&ucirc; pr&eacute;cipiter leur transformation num&eacute;rique.</span><span id=\"p64\"> Ceci aurait acc&eacute;l&eacute;r&eacute; la strat&eacute;gie de communication digitale des entreprises de 6,7 points en France <span id=\"p61\">(6 ans en moyenne)</span>.</span><br /><br /><span id=\"p65\">Pour les secteurs d&rsquo;activit&eacute;s ayant la possibilit&eacute; de t&eacute;l&eacute;travailler, l&rsquo;heure &eacute;tait d&eacute;sormais&nbsp;aux visioconf&eacute;rences&nbsp;via les logiciels Microsoft&nbsp;<span id=\"74\">Teams</span>, Zoom,&nbsp;<span id=\"75\">Slack</span>, Google&nbsp;<span id=\"76\">Meet</span>,&nbsp;<span id=\"77\">Discord</span>&hellip;</span><span id=\"p66\">&nbsp;</span><br /><br /><span id=\"p67\">Pour les commerces dits &ldquo;non-essentiels&rdquo;, les sites e-commerces ou encore le Click &amp; C<span id=\"79\">ollect</span>&nbsp;&eacute;taient au rendez-vous.</span><br /><br /><span id=\"p69\">Des aides ont d&rsquo;ailleurs &eacute;t&eacute; mises en place par l&rsquo;Etat pour soutenir les entreprises dans leur digitalisation, comme par exemple le Fonds de Solidarit&eacute; <span id=\"p68\">(subvention pouvant aller jusqu\'&agrave; 10 000 euros)</span>.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><strong><span id=\"p83\">Et 2021 ?</span><span id=\"p84\">&nbsp;</span></strong></span><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Retour%20sur%20l\'ann%C3%A9e%202020/New%20Year%20Card.png\" alt=\"New Year Card.png\" width=\"524\" height=\"372\" /></p>\r\n<p>&nbsp;</p>', 'Confinement, couvre-feu, règles sanitaires, fermeture des commerces, télétravail, diminution des interactions sociales… Malgré tout, cette année restera gravée dans nos mémoires. Start-Win vous en dit plus !', 3, '2020-12-31 10:35:59', '2021-05-05 12:19:19'),
(14, 'Le métier de Développeur Web', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>C&rsquo;est quoi un d&eacute;veloppeur web ?&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un d&eacute;veloppeur web, comme son nom l&rsquo;indique, est charg&eacute; du d&eacute;veloppement d&rsquo;interfaces web (sites Intranet, sites Internet, applications web... ). Pour ce faire, il doit d&eacute;finir et implanter des solutions techniques en utilisant des langages de programmation : HTML, CSS, JavaScript, MySQL, PHP... En r&eacute;sum&eacute;, il doit &ldquo;coder&rdquo;, tout en respectant certaines contraintes, comme par exemple, le r&eacute;f&eacute;rencement SEO ou le responsive design.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Il peut travailler au sein d&rsquo;une agence de communication, d&rsquo;une ESN (Entreprise de Services du Num&eacute;rique), directement en entreprise ou encore en freelance.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-c4b12333-7fff-2f93-d538-14355aed1d12\" style=\"font-size: 14pt;\">Quelles sont ses missions ? </span></strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20m%C3%A9tier%20de%20d%C3%A9veloppeur/My%20Morning%20Timeline.svg\" alt=\"My Morning Timeline.svg\" width=\"800\" height=\"2000\" /><br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><strong id=\"docs-internal-guid-38f89390-7fff-584e-8326-a26e06f33916\" style=\"font-weight: normal;\">&nbsp;</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Quelles sont ses comp&eacute;tences ?</span></strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit conna&icirc;tre les diff&eacute;rents langages de programmation (HTML5, CSS3, PHP8, Javascript...) et, de ce fait, effectuer une veille digitale permanente sur les nouvelles pratiques de code.</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit ma&icirc;triser les outils n&eacute;cessaires &agrave; la programmation : CMS (Content Management System), &eacute;diteurs de code&hellip;</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Il doit avoir des connaissances en architecture serveurs (microservices, SOA&hellip;).</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quelles formations pour devenir d&eacute;veloppeur ?&nbsp;</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Les formations d&eacute;butent au niveau bac + 2 et s&rsquo;&eacute;tendent jusqu&rsquo;&agrave; bac + 5.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Quelques exemples :&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac + 2 :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">DUT informatique,</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">BTS SN - syst&egrave;mes num&eacute;riques.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac + 3 :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Licence informatique,&nbsp;</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">LP d&eacute;veloppeur web et multim&eacute;dia.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac + 5 :&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Master pro conception et d&eacute;veloppement de solutions informatiques int&eacute;gr&eacute;es.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Master pro informatique professionnelle parcours langages et programmation.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Les &eacute;volutions de carri&egrave;re</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un d&eacute;veloppeur web peut s&rsquo;orienter vers un poste d&rsquo;Architecte web pour avoir davantage de responsabilit&eacute;s (m&eacute;tier &eacute;quivalent mais intervenant sur de plus gros projets et pr&eacute;sentant un aspect manag&eacute;rial). Il pourra &eacute;galement devenir Lead Developer, c&rsquo;est-&agrave;-dire qu&rsquo;il aura pour mission d&rsquo;encadrer et de former ses &eacute;quipes de d&eacute;veloppeurs en partageant ses comp&eacute;tences techniques.</p>\r\n<p style=\"text-align: justify;\"><br /><br /></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quel avenir pour le m&eacute;tier de d&eacute;veloppeur ?&nbsp;</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Aujourd&rsquo;hui, Internet ne cesse de muter et d&rsquo;&eacute;voluer. Dans une soci&eacute;t&eacute; 2.0, le m&eacute;tier de d&eacute;veloppeur web pr&eacute;sente un bel avenir, d&rsquo;autant plus que la course &agrave; l&rsquo;innovation en mati&egrave;re de site internet favorise la recherche de nouveaux talents.</p>', 'Bonne et heureuse année ! Passion, innovation et partage seront nos ingrédients pour une année 2021 placée sous l\'excellence. Aujourd’hui, Start-Win vous propose d’en savoir plus sur le métier de développeur web.', 1, '2021-01-04 12:33:47', '2021-05-05 12:16:02'),
(15, 'Le métier de Web Designer', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Un web Designer c&rsquo;est quoi?</span></strong></p>\r\n<p style=\"text-align: justify;\"><span id=\"docs-internal-guid-f208b0f7-7fff-78bc-ee8e-4b42879ec300\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un Web Designer, aussi appel&eacute; User interface (UI), est charg&eacute; de la conception et de la r&eacute;alisation de l&rsquo;identit&eacute; visuelle d&rsquo;un site internet ou d&rsquo;une application web pour lequel il cr&eacute;e l&rsquo;ensemble des &eacute;l&eacute;ments graphiques (illustrations, animations, banni&egrave;res&hellip;). Pour ce faire, il doit &eacute;tablir un cahier des charges du produit : ergonomie, mode de navigation, arborescence, sc&eacute;narisation, identit&eacute; visuelle et sonore, charte graphique&hellip; Il dessine, cr&eacute;e des maquettes et retouche des interfaces dans le but de s&eacute;duire les futurs utilisateurs du site. En r&eacute;sum&eacute;, Le Webdesigner est un cr&eacute;ateur du num&eacute;rique.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong><span id=\"docs-internal-guid-cdab52d4-7fff-713f-527c-76e5decb2b8e\">Quelles sont ses missions ?</span></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Web%20Designer/info.jpg\" alt=\"info.jpg\" width=\"800\" height=\"2000\" /></strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quelles sont ses comp&eacute;tences ?</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit &ecirc;tre dot&eacute; d&rsquo;un esprit cr&eacute;atif et imaginatif afin de proposer des chartes graphiques originales et adapt&eacute;es au positionnement de la marque</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit savoir ma&icirc;triser les diff&eacute;rents outils de cr&eacute;ation graphique et multim&eacute;dia (par exemple : Illustrator, AdobeXD, InVision studio, Photoshop&hellip;)</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Il doit savoir effectuer une veille digitale permanente pour &ecirc;tre au courant des derni&egrave;res tendances en termes de pratiques et usages sur le web (r&eacute;seaux sociaux, langage de d&eacute;veloppement&hellip;)</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quelles formations pour devenir Web Designer ?</strong></span>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Les formations d&eacute;butent au niveau bac + 2 et s&rsquo;&eacute;tendent jusqu&rsquo;&agrave; bac + 5.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Quelques exemples :&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +2 :</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">DUT MMI - m&eacute;tiers du multim&eacute;dia et de l\'internet</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +3 :</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Dipl&ocirc;mes d\'&eacute;coles sp&eacute;cialis&eacute;es (bachelor) dans les m&eacute;tiers du web, de la communication, du design et du multim&eacute;dia ou &eacute;cole d&rsquo;art</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">DN MADE mentions : graphisme, num&eacute;rique</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +5 :</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Master pro design d&rsquo;interfaces multim&eacute;dias et Internet</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Master pro arts, cr&eacute;ation et ing&eacute;nierie num&eacute;rique</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Les &eacute;volutions de carri&egrave;re</strong></span></p>\r\n<p style=\"text-align: justify;\"><span id=\"docs-internal-guid-0c852f73-7fff-122f-7e32-327601800d52\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un Web Designer peut devenir Chef de Projet Web ou Directeur Artistique. Il peut &eacute;galement &eacute;voluer vers les sp&eacute;cialisations de Designer UX / UI.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quel avenir pour le m&eacute;tier de Web Designer ?&nbsp;</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span id=\"docs-internal-guid-e723167c-7fff-d9c3-7b7e-f8ddf5c2fbd7\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Aujourd&rsquo;hui, Internet est en &eacute;volution permanente. De plus, il est devenu un v&eacute;ritable outil pour d&eacute;velopper la notori&eacute;t&eacute; et mettre en avant l&rsquo;image des entreprises. Le Web Designer devient donc de plus en plus recherch&eacute; par les recruteurs, tant pour sa ma&icirc;trise du web que pour ses qualit&eacute;s artistiques, et devient ainsi indispensable &agrave; la sph&egrave;re digitale.</p>', 'Avec l’essor d’Internet, nombreuses sont les professions qui ont un rapport direct avec la sphère digitale. Mais les connaissez-vous vraiment ? Pour développer vos connaissances, Start-Win vous en dit plus sur le métier de Web Designer !', 1, '2021-01-12 13:16:19', '2021-05-05 12:15:21'),
(16, 'Le métier de Chargé de Communication', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">C&rsquo;est quoi un Charg&eacute; de Communication ?</span></strong></p>\r\n<p style=\"text-align: justify;\"><span id=\"docs-internal-guid-0c7090ae-7fff-082a-c2d8-90a1953b099b\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un Charg&eacute; de Communication d&eacute;veloppe et met en &oelig;uvre la strat&eacute;gie de communication de l\'entreprise avec pour objectif d&rsquo;attirer et fid&eacute;liser la client&egrave;le. Il cr&eacute;e des supports de communication afin d&rsquo;am&eacute;liorer l&rsquo;image de l&rsquo;entreprise, en am&eacute;liorant ainsi sa notori&eacute;t&eacute; et indirectement son chiffre d&rsquo;affaires. Son champ d&rsquo;action est large : il peut s&rsquo;occuper de la communication interne et externe de l\'entreprise, de la communication commerciale (valoriser le produit / le service), de la communication institutionnelle (autour de l&rsquo;image de l\'entreprise), du digital (m&eacute;dias sociaux, etc)...</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong><span id=\"docs-internal-guid-3a93a4a8-7fff-69f8-3a15-e0fe5e849c37\">Quelles sont ses missions ? </span></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Charg%C3%A9e%20de%20Com/info.svg\" alt=\"info.svg\" width=\"800\" height=\"2000\" /><br /></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quelles sont ses comp&eacute;tences ?&nbsp;</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span id=\"docs-internal-guid-941cbd55-7fff-c791-9990-41be3d6b2714\">&nbsp;</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit savoir &eacute;laborer, mettre en place et piloter un plan de communication (positionnement, objectifs, cibles, &hellip;).</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit ma&icirc;triser la suite Adobe (photoshop, illustrator, inDesign, ...).</p>\r\n</li>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Il doit conna&icirc;tre le milieu de la communication et ses codes (signification des couleurs, des formes, &hellip;).</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Il doit ma&icirc;triser les techniques de communication &eacute;crite et orale.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><strong>Quelles formations pour devenir Charg&eacute; de Communication ?&nbsp;</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Les formations d&eacute;butent au niveau bac + 2 et s&rsquo;&eacute;tendent jusqu&rsquo;&agrave; bac + 5.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Quelques exemples :&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +2 :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">BTS Communication.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">BTS NDRC (N&eacute;gociation et Digitalisation de la Relation Client).</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +3 :&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Licence en information et communication ou en marketing.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" role=\"presentation\">Bachelor communication.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Bac +5 :&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: justify;\">\r\n<p dir=\"ltr\" role=\"presentation\">Master en communication.</p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\" style=\"text-align: justify;\" role=\"presentation\">Master en marketing digital.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Les &eacute;volutions de carri&egrave;re</span></strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Un Charg&eacute; de Communication peut devenir directeur de la communication ou &eacute;galement directeur marketing. Il peut &eacute;galement travailler pour une agence de communication ou de publicit&eacute; et ainsi prendre en charge plusieurs clients.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Quel avenir pour le m&eacute;tier de Charg&eacute; de Communication ?&nbsp;</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">La transformation digitale s\'op&eacute;rant &agrave; grande vitesse, les m&eacute;tiers de la communication et du digital sont promus &agrave; un bel avenir. En effet, les entreprises recherchent de plus en plus de jeunes dipl&ocirc;m&eacute;s dot&eacute;s d&rsquo;une grande cr&eacute;ativit&eacute; et &agrave; l&rsquo;aise avec les nouvelles technologies et les r&eacute;seaux sociaux.</p>', 'Aujourd’hui, une entreprise qui ne communique pas est une entreprise qui se met en danger. Il est donc important de faire appel aux professionnels de la communication. Pour développer vos connaissances, Start-Win vous en dit plus sur le métier de Chargée de Communication.', 1, '2021-01-18 11:07:16', '2021-05-05 12:12:18'),
(17, 'Les tendances du e-commerce en 2021', 'Pauline Motheron', '<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong><span id=\"docs-internal-guid-1ac0c795-7fff-0376-ac33-1c4bc1606ad8\">L\'exp&eacute;rience client : une priorit&eacute; pour les entreprises</span></strong></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">En 2020, les entreprises ont d&ucirc; s&rsquo;adapter et &eacute;voluer en termes de technologie et d&rsquo;innovation. L&rsquo;enjeu &eacute;tait de maintenir leurs ventes et de ne pas perdre leurs clients (fid&eacute;lisation) sans pouvoir assurer un accueil physique. Les entreprises ont alors d&ucirc; s&rsquo;adapter aux acheteurs et notamment aux commandes en ligne, aux retours de produits, au suivi des commandes, &hellip;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Pour r&eacute;pondre &agrave; cet enjeu, il vous est n&eacute;cessaire de comprendre les attentes des consommateurs (en g&eacute;n&eacute;ral un processus d&rsquo;achat fluide, un achat sur mobile plus ais&eacute;, des sites web plus rapides et une am&eacute;lioration des r&eacute;sultats de recherche des moteurs internes) et de mettre en place des technologies adapt&eacute;es (l&rsquo;automatisation, la robotisation, l&rsquo;intelligence artificielle, &hellip;) permettant ainsi d&rsquo;am&eacute;liorer l\'exp&eacute;rience de vos clients.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"call-to-action yellow mx-auto\"><a href=\"../../diagnostic/ux\">Diagnostic exp&eacute;rience utilisateur gratuit par Start-Win</a></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>E-commerce : les besoins des consommateurs </strong></span><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br /></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-family: Arial; font-size: 11pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/tendances-ecommerce-2021/infographie-tendances.jpg\" alt=\"infographie-tendances.jpg\" width=\"800\" height=\"2000\" /></span></span></p>\r\n<p><span style=\"font-size: 10pt;\"><em>*Taux de conversion : nombre de visiteurs d\'un site ayant effectu&eacute; une action par rapport au nombre de visiteurs total.</em></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>Le ReCommerce : une tendance port&eacute;e par la g&eacute;n&eacute;ration Z</strong></span></p>\r\n<p><span id=\"docs-internal-guid-b71819b6-7fff-85d8-0b28-95cf6608f683\"></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Aspirant &agrave; consommer de mani&egrave;re plus responsable, les consommateurs sont de plus en plus nombreux &agrave; vouloir acheter des produits de seconde main. Cette tendance est majoritairement port&eacute;e par la g&eacute;n&eacute;ration Z. En effet, 74% des 18-29 ans pr&eacute;f&egrave;rent acheter aupr&egrave;s de marques durables et le commerce de seconde main r&eacute;pond &agrave; ce crit&egrave;re.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Avec des consommateurs conscients r&eacute;alisant des achats judicieux, le march&eacute; en ligne mondial de l&rsquo;occasion devrait conna&icirc;tre en 2021 une croissance de 42 %.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>La r&eacute;tention client : un enjeu de taille</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Au second trimestre 2020, 41 millions de fran&ccedil;ais ont effectu&eacute; un achat en ligne. Ceci a permis aux e-commer&ccedil;ants d&rsquo;acqu&eacute;rir de nouveaux clients. Mais l&rsquo;enjeu ici est de garder ces nouveaux clients, &agrave; travers diff&eacute;rentes strat&eacute;gies, pour les fid&eacute;liser. En 2021, les d&eacute;penses consacr&eacute;es &agrave; la fid&eacute;lisation et &agrave; la r&eacute;tention client devraient conna&icirc;tre une hausse de 30 % en Europe.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pour fid&eacute;liser vos clients, plusieurs outils s&rsquo;offrent &agrave; vous : les newsletters, les commentaires et avis, les enqu&ecirc;tes en ligne, les ambassadeurs de marque, les programmes de fid&eacute;lisation, &hellip;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Gr&acirc;ce &agrave; votre agence Start-Win et sa solution sur-mesure, b&eacute;n&eacute;ficiez d&rsquo;une plateforme e-commerce performante vous permettant ainsi d&rsquo;acqu&eacute;rir plus de clients.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span class=\"call-to-action yellow mx-auto\"><a href=\"../../\">D&eacute;couvrez nos solutions sur mesure</a></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\">&nbsp;</p>', 'Face à la pandémie mondiale du Covid-19, le e-commerce a explosé. Afin de maximiser vos ventes et d\'acquérir de nouveaux clients, il est important d’anticiper les attentes des consommateurs. Pour cela, Start-Win vous dévoile les tendances du e-commerce en 2021.', 2, '2021-02-22 16:19:45', '2021-05-06 11:38:36');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(19, 'Content Marketing : le contenu à valeur ajoutée', 'Pauline Motheron', '<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Qu&rsquo;est-ce que c&rsquo;est le Content Marketing ?</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Le Content Marketing (marketing de contenu) est une strat&eacute;gie marketing qui consiste &agrave; cr&eacute;er et diffuser du contenu &agrave; forte valeur ajout&eacute;e &agrave; caract&egrave;re informatif, utile ou ludique dans le but d\'attirer des prospects afin d\'acqu&eacute;rir de nouveaux clients.&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Cette strat&eacute;gie, situ&eacute;e au c&oelig;ur de l&rsquo;Inbound Marketing*, se d&eacute;veloppe essentiellement par les canaux digitaux et vous permet de gagner en visibilit&eacute; et notori&eacute;t&eacute;, de cr&eacute;er de la valeur, d&rsquo;attirer des clients et gagner leur confiance. En effet, en cr&eacute;ant un contenu de qualit&eacute;, vous vous positionnez comme un expert dans votre secteur d&rsquo;activit&eacute; : ceci augmente votre cr&eacute;dibilit&eacute;.&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Pour acc&eacute;der &agrave; ces contenus, les visiteurs doivent g&eacute;n&eacute;ralement remplir un formulaire sur votre site internet, ce qui vous permet d&rsquo;obtenir leurs coordonn&eacute;es.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Ubuntu,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">*Inbound Marketing (marketing entrant) : technique visant &agrave; attirer les clients gr&acirc;ce &agrave; la diffusion de contenus de qualit&eacute; informatifs, p&eacute;dagogiques, voire inspirants (proposer et non imposer).</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les diff&eacute;rents types de contenus</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le Content Marketing pr&eacute;sente une vaste diversit&eacute; de formats et de supports. Voici les principaux types de contenus pertinents :</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>Les livres blancs / ebooks : guide pratique d&rsquo;un certain nombre de pages (plus longs, plus approfondis et plus d&eacute;taill&eacute;s que des articles de blog) consacr&eacute; &agrave; un produit, une probl&eacute;matique ou une technique. Destin&eacute;s aux prospects, ils vous permettent d&rsquo;affirmer votre expertise et d&rsquo;alimenter votre base de donn&eacute;es (en collectant les mails en &eacute;change du t&eacute;l&eacute;chargement)</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les infographies : tr&egrave;s appr&eacute;ci&eacute;es des internautes, ce format permet de synth&eacute;tiser des informations (parfois complexes). Souvent plac&eacute;es en milieu d&rsquo;articles, elles permettent de capter l&rsquo;attention du lecteur et de fluidifier votre contenu.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les newsletters / campagnes emailing : mensuelles, hebdomadaires ou quotidiennes, les newsletters et campagnes emailing sont des emails &agrave; vocation commerciale ou &eacute;ditoriale destin&eacute;es &agrave; des prospects ou des clients abonn&eacute;s.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les &eacute;tudes de cas : dans le cadre de l\'Inbound Marketing, les &eacute;tudes de cas permettent de pr&eacute;senter votre b&eacute;n&eacute;fice client sous forme de t&eacute;moignage. En effet, elles permettent de pr&eacute;senter le retour d\'exp&eacute;rience de vos clients et comment votre solution a particip&eacute; &agrave; l\'am&eacute;lioration de ses performances.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les webinars : ils d&eacute;signent les s&eacute;minaires virtuels (sur le web). Permettant d&rsquo;&eacute;viter tout d&eacute;placement pour les participants, ils permettent de faciliter la participation.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les articles de blog : tenir un blog vous permet de renforcer votre SEO (r&eacute;f&eacute;rencement naturel), de fid&eacute;liser votre communaut&eacute;, d&rsquo;attirer des prospects et clients mais aussi de multiplier les call-to-action (dans le but de g&eacute;n&eacute;rer des leads).</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les podcasts : contenus audios consultables sur Internet, les podcasts sont tr&egrave;s appr&eacute;ci&eacute;s et permettent de fid&eacute;liser les internautes.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\"><br />Les vid&eacute;os : format pr&eacute;f&eacute;r&eacute; des internautes, les vid&eacute;os permettent d&rsquo;augmenter votre trafic et de garder vos visiteurs plus longtemps sur votre site. Elles peuvent &ecirc;tre facilement partag&eacute;es sur les r&eacute;seaux sociaux (Facebook, Instagram, Youtube, Linkedin, &hellip;) et peuvent m&ecirc;me devenir virales.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-15ef562e-7fff-c7e5-00b6-19f706552151\" style=\"font-size: 14pt;\"><span style=\"font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Quelques exemples</span></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Content%20Marketing/infographie404works.png\" alt=\"infographie404works.png\" width=\"1080\" height=\"2160\" /></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><span style=\"font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-e9701e5c-7fff-413d-13fd-2fe60439ac38\" style=\"font-weight: normal;\"><span style=\"font-size: 11pt; font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">&rarr; </span></span></span></span><span id=\"docs-internal-guid-e9701e5c-7fff-413d-13fd-2fe60439ac38\">Infographie - 404Works</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Content%20Marketing/YvesRochernewsletters.jpg\" alt=\"YvesRochernewsletters.jpg\" width=\"713\" height=\"1065\" /></p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-e9701e5c-7fff-413d-13fd-2fe60439ac38\"></span><span style=\"font-size: 14pt;\"><span style=\"font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-family: Ubuntu, sans-serif; font-size: 14.6667px;\">&rarr; </span></span></span>Newsletter - Yves Rocher<span style=\"font-size: 14pt;\"><span style=\"font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br /></span></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Content%20Marketing/yukablog.png\" alt=\"yukablog.png\" width=\"1200\" height=\"595\" /></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><span style=\"font-family: Ubuntu, sans-serif; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-family: Ubuntu, sans-serif; font-size: 14.6667px;\">&rarr;</span></span></span> Article de blog - Yuka</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><iframe src=\"https://www.youtube.com/embed/MIr6QtAvzZM\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p dir=\"ltr\"><span style=\"font-family: Ubuntu, sans-serif; font-size: 14.6667px; font-weight: bold; white-space: pre-wrap;\">&rarr; </span>Vid&eacute;o - Nike</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a href=\"../../../contact\" target=\"_blank\" rel=\"noopener\"><span class=\"call-to-action yellow mx-auto\">Contactez-nous</span></a></p>', 'Comment être plus visible sur le web ? Comment attirer plus de visiteurs sur votre site ? Comment générer plus de leads ? Autant de questions que le Content Marketing peut résoudre. Start-Win vous en dit plus !', 2, '2021-02-25 13:51:27', '2021-05-06 11:36:25'),
(20, 'Mieux comprendre le Règlement Général sur la Protection des Données (RGPD)', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Qu&rsquo;est-ce que le R&egrave;glement G&eacute;n&eacute;ral sur la Protection des Donn&eacute;es (RGPD) ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Entr&eacute; en application le 25 mai 2018 et s\'inscrivant dans la continuit&eacute; de la Loi Informatique et Libert&eacute;s de 1978, le R&egrave;glement G&eacute;n&eacute;ral sur la Protection des Donn&eacute;es est un texte r&eacute;glementaire europ&eacute;en qui encadre le traitement des donn&eacute;es &agrave; caract&egrave;re personnel.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>Son objectif ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Ce r&eacute;glement europ&eacute;en a pour finalit&eacute;s de renforcer les droits des personnes concern&eacute;es et de responsabiliser les entreprises dans le traitement de donn&eacute;es &agrave; caract&egrave;re personnelles &agrave; travers une autorit&eacute; de contr&ocirc;le : la CNIL (Commission nationale de l\'informatique et des libert&eacute;s).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/RGPD/rgpd-crit%C3%A8res.jpg\" alt=\"rgpd-crit&egrave;res.jpg\" width=\"975\" height=\"500\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>&Agrave; qui s&rsquo;adresse-t-il ?</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le RGPD s&rsquo;applique &agrave; tout organisme public ou priv&eacute; (entreprise, associations, administrations publiques) effectuant de la collecte et/ou du traitement de donn&eacute;es et qui se situe sur le territoire europ&eacute;en*.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><em>*Le RGPD peut &eacute;galement s&rsquo;appliquer &agrave; tout organisme se situant hors de l&rsquo;Union Europ&eacute;enne dont l&rsquo;activit&eacute; cible des r&eacute;sidents europ&eacute;ens.</em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><strong>Vous souhaitez v&eacute;rifier si vous &ecirc;tes dans la loi en termes de protection des donn&eacute;es ?&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><a href=\"../../../diagnostic/rgpd\"><span class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-weight: bolder;\">Start-Win vous propose un diagnostic RGPD offert !</span></a></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 14pt;\"><strong>Quelles sont les donn&eacute;es concern&eacute;es par le RGPD ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Selon la CNIL, une donn&eacute;e personnelle concerne &laquo; toute information se rapportant &agrave; une personne physique identifi&eacute;e ou identifiable &raquo;. On distingue deux types de donn&eacute;es :</p>\r\n<p>- Identification directe (nom, pr&eacute;nom, ...)</p>\r\n<p dir=\"ltr\">- Identification indirecte (identifiant, num&eacute;ro, ...).</p>\r\n<p><br /><em>Exemple de traitement de donn&eacute;es personnelles : tenue d&rsquo;un fichier de ses clients, collecte de coordonn&eacute;es de prospects via un questionnaire, mise &agrave; jour d&rsquo;un fichier de fournisseurs et prestataires, ...</em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>En cas de non-respect : les sanctions pr&eacute;vues</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">En cas de contr&ocirc;le ou de plainte, la CNIL peut prononcer des sanctions &agrave; l\'&eacute;gard des responsables de traitements de donn&eacute;es qui ne respecteraient pas le texte en vigueur car en effet, il s\'agit d\'une violation du consentement ainsi que des droits et libert&eacute;s de la personne concern&eacute;e.</p>\r\n<p dir=\"ltr\">En effet, les acteurs concern&eacute;s pourront recevoir une amende allant de 2% &agrave; 4% de leur chiffre d&rsquo;affaires et jusqu&rsquo;&agrave; 20 millions d&rsquo;euros pour les infractions les plus graves.</p>\r\n<p dir=\"ltr\">La CNIL peut &eacute;galement prononcer un rappel &agrave; l&rsquo;ordre, enjoindre de mettre le traitement en conformit&eacute; (rectification), y compris sous astreinte, limiter temporairement ou d&eacute;finitivement un traitement, suspendre les flux de donn&eacute;es, ordonner de satisfaire aux demandes d\'exercice des droits des personnes (droit d\'opposition).</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><strong>Attention, la sentence peut &ecirc;tre irr&eacute;vocable.</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><strong>N&rsquo;attendez plus et profitez de notre diagnostic RGPD gratuit !</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span class=\"call-to-action yellow mx-auto\"><a style=\"display: inline !important;\" href=\"../../../diagnostic/rgpd\" target=\"_blank\" rel=\"noopener\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-weight: bolder;\">N&rsquo;attendez plus et profitez de notre diagnostic RGPD gratuit !</span></a></span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #222222; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les bons r&eacute;flexes &agrave; adopter</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">- Collectez les donn&eacute;es vraiment n&eacute;cessaires pour atteindre vos objectifs</p>\r\n<p dir=\"ltr\">- Soyez transparent (cookie, pr&eacute;sente politique de protection, niveau de protection, ...)</p>\r\n<p dir=\"ltr\">- Organisez (DPO, responsable du traitement, ...) et facilitez l&rsquo;exercice des droits des personnes (droit d\'acc&egrave;s, ...)</p>\r\n<p dir=\"ltr\">- Fixez une dur&eacute;e de conservation</p>\r\n<p dir=\"ltr\">- S&eacute;curisez les donn&eacute;es collect&eacute;es et identifiez les risques</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">- Inscrivez la mise en conformit&eacute; dans une d&eacute;marche continue</p>', 'La protection des données personnelles est aujourd’hui un enjeu majeur pour les entreprises. Il est donc important de mieux comprendre le Règlement Général sur la Protection des Données. Start-Win vous en dit plus !', 3, '2021-03-02 14:01:02', '2021-05-05 12:25:58'),
(22, 'Google analytics : comment analyser sa performance SEO ?', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Google analytics, c&rsquo;est quoi ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Google analytics est un service gratuit propos&eacute; par Google qui vous permet d&rsquo;analyser l&rsquo;audience de votre site internet ou de votre application. Utilis&eacute; par plus de 28 millions de sites (plus de 80% du march&eacute; mondial), cet outil simple d&rsquo;utilisation et de compr&eacute;hension vous aide entre-autre :&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- &Agrave; conna&icirc;tre et mesurer votre audience (provenance, caract&eacute;ristiques, comportements, &hellip;)</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- &Agrave; optimiser votre exp&eacute;rience utilisateur</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- &Agrave; mesurer votre retour sur investissement</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- &Agrave; &eacute;valuer votre r&eacute;f&eacute;rencement naturel (performance de vitesse de votre site, &eacute;tude de vos contenus, pertinence de vos mots-cl&eacute;s, &hellip;)&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">- &Agrave; acqu&eacute;rir de nouveaux clients et am&eacute;liorer vos ventes</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/google%20analytics/GA-Logo.png\" alt=\"GA-Logo.png\" width=\"1200\" height=\"413\" /></p>\r\n<p dir=\"ltr\" role=\"presentation\"><strong id=\"docs-internal-guid-3be15277-7fff-43d4-4cca-731c526d30ac\" style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"call-to-action yellow mx-auto\" style=\"font-weight: normal;\">Testez vos performances SEO</span></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Comment utiliser Google analytics pour g&eacute;rer votre SEO ?</strong></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Afin d&rsquo;am&eacute;liorer vos performances et votre positionnement dans les pages de r&eacute;sultats de recherche, voici les principales m&eacute;triques &agrave; suivre sur Google Analytics :</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Le trafic organique (organic search)</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><em>Le trafic organique correspond &agrave; l&rsquo;ensemble des visites ayant eu lieu sur votre site via les moteurs de recherche (sans avoir cliqu&eacute; sur des annonces payantes).</em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Il est essentiel pour votre business de surveiller et de mesurer votre trafic organique. Cette d&eacute;marche strat&eacute;gique vous permettra d&rsquo;obtenir un aper&ccedil;u r&eacute;el des performances de votre r&eacute;f&eacute;rencement naturel et donc d&rsquo;am&eacute;liorer votre visibilit&eacute; en ligne, d&rsquo;&ecirc;tre mieux positionn&eacute; dans les r&eacute;sultats de recherche et de g&eacute;n&eacute;rer davantage de trafic.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Comment mesurer votre trafic organique dans Google analytics ?</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Connectez-vous &agrave; votre compte Google Analytics.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- S&eacute;lectionnez &ldquo;Acquisition&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisissez &ldquo;tout le trafic&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Cliquez sur &ldquo;les canaux&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Rechercher et s&eacute;lectionner &ldquo;organic search&rdquo;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Ce qu&rsquo;il faut regarder :</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les pages de destination pr&eacute;sentant le trafic le plus organique,</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les mots-cl&eacute;s g&eacute;n&eacute;rant votre trafic organique,&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">Vos performances pass&eacute;es et vos performances actuelles (comparer diff&eacute;rentes p&eacute;riodes)</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/google%20analytics/google-analytics-canaux-acquisition.jpeg\" alt=\"google-analytics-canaux-acquisition.jpeg\" width=\"1220\" height=\"630\" /></p>\r\n<p dir=\"ltr\" role=\"presentation\"><em><span id=\"docs-internal-guid-0217708d-7fff-bcbc-0e8f-6cbdd7a2f454\">+ : Il vous est &eacute;galement possible d&rsquo;analyser le trafic provenant d&rsquo;un autre site, des r&eacute;seaux sociaux, d&rsquo;une newsletter, &hellip;</span></em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les temps de chargement des pages</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><em>Le temps de chargement d&rsquo;une page web correspond au temps que met une page &agrave; charger correctement tous les &eacute;l&eacute;ments qui la constituent (texte, image, vid&eacute;os, &hellip;).</em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">La vitesse de chargement d&rsquo;une page est un des nombreux crit&egrave;res de positionnement utilis&eacute; par Google. Il est donc important pour votre entreprise d&rsquo;optimiser votre temps de chargement et d&rsquo;en faire une priorit&eacute; dans votre strat&eacute;gie de r&eacute;f&eacute;rencement. Car en effet, si votre site est peu performant, il sera moins bien class&eacute; dans les r&eacute;sultats de recherche (diminution de la qualit&eacute; et de la quantit&eacute; de votre trafic).</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Comment mesurer le temps de chargement de vos pages dans Google analytics ?</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Connectez-vous &agrave; votre compte Google Analytics.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisir &ldquo;le comportement&rdquo;.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisissez &ldquo;la vitesse du site&rdquo;.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Cliquez sur &ldquo;temps de chargement des pages\'\'.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Ce qu&rsquo;il faut regarder :</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Le temps de chargement moyen de vos pages</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les suggestions relatives &agrave; la vitesse</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- La vitesse de votre site par navigateur</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/google%20analytics/google-analytics-taux-de-conversion-temps-chargement-pages.png\" alt=\"google-analytics-taux-de-conversion-temps-chargement-pages.png\" width=\"1200\" height=\"495\" /></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les conversions indirectes</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><em>Les conversions indirectes d&eacute;signent les canaux qui ont contribu&eacute; &agrave; g&eacute;n&eacute;rer une conversion (le visiteur accompli l&rsquo;action recherch&eacute;e - achat, formulaire, inscription, &hellip; - ).</em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">D&eacute;montrant le r&ocirc;le essentiel du r&eacute;f&eacute;rencement, les conversions indirectes sont importantes &agrave; observer pour votre soci&eacute;t&eacute;. Elles permettent de fournir une analyse pr&eacute;cise quant &agrave; la g&eacute;n&eacute;ration de vos revenus, vos prospects, &hellip; mais aussi d&rsquo;appr&eacute;cier la performance globale de votre site web.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Comment mesurer les conversions indirectes dans Google analytics ?</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Connectez-vous &agrave; votre compte Google Analytics.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- S&eacute;lectionnez &ldquo;les conversions&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisissez &ldquo;des entonnoirs multicanaux&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Cliquez sur &ldquo;Conversions indirectes&rdquo;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Ce qu&rsquo;il faut regarder :</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Vos principaux chemins de conversion</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Votre d&eacute;lai avant conversion</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">- Vos objectifs personnalis&eacute;s (que vous pouvez cr&eacute;er en vous rendant dans la section &ldquo;Admin&rdquo; puis, &ldquo;objectifs&rdquo; qui se trouve dans le menu &ldquo;affichage&rdquo;)</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/google%20analytics/ameliorer-conversion-google-analytics-conversions-indirectes.png\" alt=\"ameliorer-conversion-google-analytics-conversions-indirectes.png\" width=\"1200\" height=\"707\" /></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Les termes de recherche</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><em>Un terme de recherche est un terme saisi comme requ&ecirc;te par un utilisateur sur un moteur de recherche (ou sur votre site).</em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Analyser vos termes de recherche est une d&eacute;marche strat&eacute;gique importante pour votre organisation. Elle vous permet d&rsquo;am&eacute;liorer votre taux de clics en d&eacute;tectant les requ&ecirc;tes inadapt&eacute;es, et d&rsquo;accro&icirc;tre vos volumes de clics et de conversion en trouvant des mots-cl&eacute;s int&eacute;ressants &agrave; ajouter dans vos campagnes.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Comment mesurer vos termes de recherche dans Google analytics ?</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Connectez-vous &agrave; votre compte Google Analytics.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisir &ldquo;le comportement&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Choisissez &ldquo;site search&rdquo;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Cliquez sur &ldquo;les termes de recherche&rdquo;</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Ce qu&rsquo;il faut regarder :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Vos pages de recherche</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- L&rsquo;utilisation de recherche sur votre site</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Votre temps apr&egrave;s la recherche</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/google%20analytics/site-search-google-analytics.jpeg\" alt=\"site-search-google-analytics.jpeg\" width=\"930\" height=\"419\" /></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Maintenant que vous avez les informations principales pour analyser votre pratique SEO, testez les performances de votre r&eacute;f&eacute;rencement sur notre site et contactez-nous pour son optimisation.&nbsp;</span></p>', 'Le SEO vous permet d’optimiser la visibilité de votre marque et de son offre, et d’améliorer la visibilité de votre site web. Mais comment savoir si celui-ci est réellement performant ? Pour répondre à cette interrogation, Start-Win vous en dit plus quant au service Google analytics.', 2, '2021-04-13 13:28:41', '2021-05-05 12:17:36'),
(23, 'Un blog pour améliorer votre référencement', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\">Qu&rsquo;est-ce qu&rsquo;un blog d&rsquo;entreprise ?</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Le blog d&rsquo;entreprise est un blog dont le contenu n&rsquo;est pas publi&eacute; sur un site personnel mais sur le site web d&rsquo;une entreprise. Le contenu peut &ecirc;tre de nature variable : conseils, analyse de tendances, t&eacute;moignages clients, &hellip; Offrant une grande libert&eacute; &eacute;ditoriale et une interaction en temps r&eacute;el avec les internautes, un blog peut &ecirc;tre utilis&eacute; dans le domaine B2C (business to consumer) et B2B (business to business). Permettant une communication plus r&eacute;active et directe avec la client&egrave;le, un blog d&rsquo;entreprise compte de nombreux avantages marketing comme entre autres :</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Vous positionner en tant qu&rsquo;expert dans votre domaine d&rsquo;activit&eacute;.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">- Gagner en visibilit&eacute; et attirer de nouveaux clients.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" role=\"presentation\">Am&eacute;liorer votre r&eacute;f&eacute;rencement naturel.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\">Quels sont les avantages d&rsquo;un blog pour le r&eacute;f&eacute;rencement de votre site web ?</span></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Un blog vous permet de booster le r&eacute;f&eacute;rencement naturel de votre site web : les entreprises poss&eacute;dant un blog b&eacute;n&eacute;ficient de 97 % de liens suppl&eacute;mentaires vers leur site et 4 fois plus de pages index&eacute;es par Google. En travaillant votre strat&eacute;gie de contenu, vous augmentez votre visibilit&eacute;, le nombre de visiteurs sur votre site et le nombre de prospects.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">L&rsquo;utilisation de mots-cl&eacute;s :</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">Facile &agrave; mettre en place, le blog est une plue-value int&eacute;ressante qui permet d&rsquo;optimiser sa visibilit&eacute; sur les supports digitaux. Avec un contenu pertinent (point cl&eacute; num&eacute;ro 1), vous pourrez utiliser des mots-cl&eacute;s adapt&eacute;s en fonction de votre secteur d&rsquo;activit&eacute;. Plusieurs outils existent sur le web pour vous aider &agrave; choisir les bons mots-cl&eacute;s.</p>\r\n<p dir=\"ltr\"><em>Mots-cl&eacute;s : ensemble d&rsquo;expressions qui ont pour but de caract&eacute;riser un document (texte, vid&eacute;o, &hellip;) et qui permettent de faciliter son r&eacute;f&eacute;rencement naturel (notamment sur Google).</em></p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">La g&eacute;n&eacute;ration de backlinks</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;</p>\r\n<p dir=\"ltr\">En travaillant et en optimisant votre blog, votre trafic augmentera notamment par la cr&eacute;ation de nouvelles pages et la g&eacute;n&eacute;ration de backlinks. Avec des articles int&eacute;ressants, vous obtenez des liens entrants de mani&egrave;re quasi spontan&eacute;e. Les backlinks sont tr&egrave;s importants car ils permettent &agrave; Google d&rsquo;appr&eacute;cier la pertinence de votre site web.</p>\r\n<p dir=\"ltr\"><em>Backlink (&eacute;galement appel&eacute; lien entrant, lien arrivant, lien externe ou lien retour) : lien hypertexte qui envoie un internaute d\'un site web A vers un site web B.</em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/referencement\">Verifier maintenant</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Attention : ne pas d&eacute;finir de ligne &eacute;ditoriale ne vous permettra pas de constater de r&eacute;els b&eacute;n&eacute;fices et pourra avoir un impact sur votre image ou vos ventes. Si vous publiez des articles int&eacute;ressants pour vos lecteurs, vos articles contiendront naturellement des mots-cl&eacute;s et des backlinks seront naturellement cr&eacute;&eacute;s vers votre blog. C&rsquo;est en ce sens que votre r&eacute;f&eacute;rencement sera boost&eacute;. De plus, les effets b&eacute;n&eacute;fiques d&rsquo;un blog demandent d&rsquo;&ecirc;tre patient et pers&eacute;v&eacute;rant : si vous publiez du contenu de qualit&eacute; de mani&egrave;re r&eacute;guli&egrave;re, vous constaterez les b&eacute;n&eacute;fices sur votre r&eacute;f&eacute;rencement naturel les mois suivants.</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-5d405648-7fff-3496-5f01-77d58792bb1b\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Maintenant que vous avez toutes les cl&eacute;s en main, faites appel &agrave; votre agence Start-Win pour optimiser votre r&eacute;f&eacute;rencement.</p>', 'Comment faire pour gagner en visibilité ? mieux se positionner dans les résultats de recherche sur Google ? booster tout simplement votre référencement ? Start-Win vous en dit plus.', 2, '2021-04-19 11:46:42', '2021-05-05 12:11:24'),
(24, 'Pourquoi créer un site responsive ?', 'Pauline Motheron', '<p><span id=\"docs-internal-guid-63b94ddc-7fff-8ae6-2a65-b9a78e982a9c\" style=\"font-size: 14pt;\">Qu&rsquo;est-ce qu&rsquo;un site responsive ?</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un site responsive est un site web con&ccedil;u de telle sorte que son contenu s&rsquo;adapte automatiquement &agrave; toutes tailles d&rsquo;&eacute;crans (ordinateur, tablette, smartphone, &hellip;). Nous pouvons alors parler de responsive design, qui regroupe les diff&eacute;rentes techniques de conception d&rsquo;interface digitale permettant cette flexibilit&eacute; d&rsquo;affichage. Le responsive design fait partie int&eacute;grante de l&rsquo;UX (exp&eacute;rience utilisateur) et est fortement recommand&eacute;. En effet, selon Google, en 2017, 80 % des meilleurs sites utilisaient la technologie responsive.</p>\r\n<p><span id=\"docs-internal-guid-576aaa4e-7fff-a4d8-602d-004f503cf839\"></span></p>\r\n<p dir=\"ltr\">Son objectif est de faciliter la lecture et la navigation de l&rsquo;internaute, qu&rsquo;importe la technologie qu\'il utilise pour se rendre sur un site web.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-60fe3027-7fff-8188-6cb9-3bd7a472b924\" style=\"font-size: 14pt;\">Les avantages d&rsquo;un site responsive</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/responsive/infographie-avantages-responsive.png\" alt=\"infographie-avantages-responsive.png\" width=\"800\" height=\"2000\" /></span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\">Les bonnes pratiques &agrave; adopter pour la conception de votre site responsive :</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">- Configurez votre site en fonction de chaque type d&rsquo;appareil : les internautes vont visiter votre site web sur diff&eacute;rents types d&rsquo;appareils, c&rsquo;est pourquoi il est important de vous adapter &agrave; l&rsquo;affichage de chaque interface : mobiles, tablettes, desktop, t&eacute;l&eacute;visions, smartwatches. Ceci offrira alors une exp&eacute;rience utilisateur (UX) optimale.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">- Concevez des zones interactives faciles d&rsquo;acc&egrave;s : pour une navigation optimale depuis un smartphone, il doit y avoir suffisamment d&rsquo;espace entre les boutons, les liens ou les zones (\"&eacute;l&eacute;ments tactiles&rdquo;). En effet, si ceux-ci sont trop proches, les internautes ne pourront pas (ou difficilement) cliquer dessus.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">- Simplifiez la mise en page : si votre site web pr&eacute;sente un design simple, celui-ci aura plus de chance de devenir responsive. Utilisez une base &eacute;pur&eacute;e, la m&ecirc;me structure sur l&rsquo;ensemble des pages, des menus courts et bien organis&eacute;s, &hellip;&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">- Adapter l&rsquo;ergonomie &agrave; l&rsquo;usage mobile : la plupart des internautes et des moteurs de recherche privil&eacute;gient les t&eacute;l&eacute;phones mobiles. C&rsquo;est donc pourquoi vous devez adapter l\'ergonomie de votre site web en ce sens. Attention aux fonctionnalit&eacute;s qui pourraient g&ecirc;ner la lisibilit&eacute; et l\'exp&eacute;rience de l&rsquo;utilisateur : chat en ligne, fen&ecirc;tres pop-up, listes d&eacute;roulantes, &hellip;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Maintenant que nous vous avons renseign&eacute; quant &agrave; l&rsquo;importance d&rsquo;avoir un site web responsive pour votre entreprise, n&rsquo;h&eacute;sitez pas &agrave; nous contacter pour discuter de votre &eacute;ventuel projet !</p>', 'En 2020, 60% des recherches Google provenaient d\'appareils mobiles. Cependant, les internautes effectuent leurs recherches sur d’autres interfaces : tablettes, télévision, … Il est donc important pour votre business de créer un site responsive. Start-Win vous en dit plus.', 2, '2021-04-20 14:51:49', '2021-05-05 12:25:14'),
(25, 'Comment gérer vos avis clients ?', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 18pt;\">Les enjeux des avis clients</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Commentaires, notes, &eacute;toiles, ... Les avis clients sont des appr&eacute;ciations laiss&eacute;es par les consommateurs sur votre entreprise et ses produits et/ou ses services. On les retrouve g&eacute;n&eacute;ralement sur Google, Facebook, sur les plateformes de r&eacute;servations et sur les comparateurs et sites d&rsquo;avis en ligne. Ces avis peuvent avoir un <span class=\"text-secondBlue\"><strong>r&eacute;el impact sur votre chiffre d&rsquo;affaires, la fid&eacute;lisation de vos clients, l\'e-r&eacute;putation de votre entreprise</strong></span> (voire sur sa p&eacute;rennit&eacute;).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Ainsi, vos avis clients ont <span class=\"text-secondBlue\"><strong>une part importante dans le processus d&rsquo;achat de vos clients potentiels</strong></span>. En y portant attention, ils vous permettent :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D&rsquo;am&eacute;liorer votre image et votre notori&eacute;t&eacute;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De ma&icirc;triser votre e-r&eacute;putation</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De b&eacute;n&eacute;ficier d&rsquo;une v&eacute;ritable publicit&eacute;, gratuite et efficace</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De favoriser les conversions (achat d&rsquo;un produit, souscription &agrave; un service, demande de devis ou d&rsquo;informations, ...)</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Nos conseils pour g&eacute;rer vos avis clients</span></strong></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<ul>\r\n<li><strong><span class=\"text-secondBlue\">Encouragez les avis d&rsquo;internautes</span></strong> : ceci vous permet de valoriser le client (et de cr&eacute;er de la confiance). Apr&egrave;s chaque achat en ligne, vous pouvez envoyer un mail automatique afin de mesurer le degr&eacute; de satisfaction du client et l&rsquo;inciter &agrave; donner son avis.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Tenez compte des avis n&eacute;gatifs</span></strong> : pour y r&eacute;pondre restez courtois et professionnel. En restant le plus positif possible, vous am&eacute;liorez l&rsquo;image que vous renvoyez. Essayez de r&eacute;pondre &agrave; chacune des remarques n&eacute;gatives en privil&eacute;giant le sur-mesure et la personnalisation des r&eacute;ponses.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">R&eacute;pondez aux avis positifs</span></strong> : remerciez au minimum le client et essayez de personnaliser votre message pour lui montrer que vous vous souvenez de lui.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Suscitez l&rsquo;engagement des internautes sur vos r&eacute;seaux sociaux</strong></span> : mettez en avant vos r&eacute;seaux sociaux (Facebook, Instagram et Twitter principalement) sur votre page Google afin de montrer aux internautes que votre entreprise est active en termes de communication et de dialogue avec sa client&egrave;le.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Faites de la veille</strong></span> : surveillez quotidiennement les sites et plateformes sur lesquels vous &ecirc;tes inscrits afin de pouvoir r&eacute;pondre le plus rapidement possible aux nouveaux avis. Diff&eacute;rents outils gratuits ou payants existent pour surveiller votre e-r&eacute;putation : Google Alerts, Social Mention, Synthesio, &hellip;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/social\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&Eacute;ffectuez un diagnostic de vos r&eacute;seaux sociaux</span></a></strong></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt;\"><em><span style=\"font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></em></span></p>', 'Avant de passer à l’acte d’achat, 88 % des individus consultent des avis en ligne par le biais des moteurs de recherche (le plus souvent Google) ou des réseaux sociaux (généralement Facebook). Mais comment gérer vos avis négatifs ? Start-Win vous en dit plus !', 2, '2021-05-04 16:42:26', '2021-05-07 11:49:00'),
(26, 'Comment avoir plus d’abonnés sur votre page Facebook ?', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Comment avoir plus d&rsquo;abonn&eacute;s sur votre page <span id=\"7\">Facebook ?</span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Facebook/1.png\" alt=\"1.png\" width=\"800\" height=\"2000\" /></p>\r\n<p><strong><span style=\"font-size: 14pt;\">&nbsp;</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; word-break: break-all; transform: scale(1.2); font-weight: bold;\" href=\"../../diagnostic/social\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-family: Arial; font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&Eacute;ffectuez un diagnostic de vos r&eacute;seaux sociaux</span></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-ab163aea-7fff-0ee8-efe9-c6d295550573\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></p>', 'Pour le développement de votre entreprise, Facebook est une grande opportunité. Pour avoir plus d’abonnés, plusieurs méthodes d’acquisition sont à votre disposition. Start-Win vous en dit plus !', 2, '2021-05-11 10:22:24', '2021-06-08 12:08:17');
