(27, 'Comment avoir plus d’abonnés sur votre page Instagram ?', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Comment avoir plus d&rsquo;abonn&eacute;s sur votre page Instagram ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"font-size: 14pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Instagram/info-r%C3%A9seauxsociaux.png\" alt=\"info-r&eacute;seauxsociaux.png\" width=\"800\" height=\"2000\" /><br /></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; word-break: break-all; font-weight: bold;\" href=\"../../../diagnostic/social\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-family: Arial; font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&Eacute;ffectuez un diagnostic de vos r&eacute;seaux sociaux</span></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-adc80a59-7fff-af1e-f76e-20176fb57819\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></p>', 'Pour accroître la visibilité de votre entreprise, Instagram est une opportunité à saisir. Pour avoir plus d’abonnés, plusieurs pratiques sont à votre disposition. Start-Win vous en dit plus !', 2, '2021-05-11 11:56:12', '2021-06-16 16:17:42'),
(28, 'Comment avoir plus d’abonnés sur votre page Twitter ?', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Comment avoir plus d&rsquo;abonn&eacute;s sur votre page Twitter ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Twitter/3.png\" alt=\"3.png\" width=\"800\" height=\"2000\" /><br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><a class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; word-break: break-all; transform: scale(1.2); font-size: medium; font-weight: bold;\" href=\"../../diagnostic/social\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-family: Arial; font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&Eacute;ffectuez un diagnostic de vos r&eacute;seaux sociaux</span></a></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-668f51a2-7fff-32b2-b470-214a584b5c72\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></p>', 'Twitter est un réseau social qui peut vous aider à assurer la pérennité de votre entreprise. Pour avoir plus d’abonnés, plusieurs méthodes sont à votre disposition. Start-Win vous en dit plus !', 1, '2021-05-11 12:11:12', '2021-06-08 12:20:04'),
