r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">&nbsp;</p>\r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">&nbsp;</p>\r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\"><span id=\"docs-internal-guid-668f51a2-7fff-32b2-b470-214a584b5c72\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></p>', 'TikTok est de plus en plus utilisé par les entreprises pour communiquer. Pour avoir plus d’abonnés, plusieurs méthodes d’acquisition sont à votre disposition. Start-Win vous en dit plus !', 2, '2021-05-19 13:58:18', '2021-06-09 16:32:39'),
(31, 'Les nouvelles normes du paiement en ligne', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quels sont les changements pr&eacute;vus ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">&Agrave; partir du <span class=\"text-secondBlue\"><strong>15 mai, &ldquo;l&rsquo;authentification forte est demand&eacute;e</strong></span> par les banques fran&ccedil;aises, en concertation avec l&rsquo;&eacute;cosyst&egrave;me des paiements, pour les achats en ligne&rdquo;, a annonc&eacute; la F&eacute;d&eacute;ration Bancaire Fran&ccedil;aise (FBF).&nbsp;</p>\r\n<p>Cette mesure, qui <span class=\"text-secondBlue\"><strong>devra &ecirc;tre mise en &oelig;uvre progressivement sur une dur&eacute;e de 4 semaines</strong></span>, concerne ainsi les &eacute;metteurs de cartes bancaires, les banques, les op&eacute;rateurs de paiement et les commer&ccedil;ants en ligne.</p>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: center;\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/securite\">D&eacute;couvrez les failles de s&eacute;curit&eacute; de votre site</a></h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\">En quoi consiste l&rsquo;authentification forte ?</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Exigence technique de la Directive europ&eacute;enne sur les Services de Paiement (DSP2), l&rsquo;authentification forte consiste <span class=\"text-secondBlue\"><strong>&agrave; v&eacute;rifier si vous &ecirc;tes bien &agrave; l&rsquo;origine du paiement par Internet</strong></span> &agrave; l&rsquo;aide d&rsquo;au moins 2 des 3 &eacute;l&eacute;ments suivants :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Une information que vous connaissez</span></strong> : mot de passe, code secret, &hellip;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Un appareil que vous d&eacute;tenez</strong></span> : t&eacute;l&eacute;phone portable, montre connect&eacute;e, &hellip;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Une caract&eacute;ristique personnelle</strong></span> : empreinte digitale, reconnaissance faciale, &hellip;</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Elle permet notamment de lutter contre les fraudes, de renforcer le niveau de s&eacute;curit&eacute; des paiements et de mieux prot&eacute;ger les utilisateurs (consommateurs, entreprises, professionnels, ...).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; text-align: center;\" href=\"../../../diagnostic/securite\">D&eacute;couvrez les failles de s&eacute;curit&eacute; de votre site</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quels montants sont pris en compte ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-9c2e9948-7fff-840a-75b2-b845b5ef8c54\"></span></p>\r\n<div dir=\"ltr\" style=\"margin-left: 0pt;\" align=\"left\">\r\n<table style=\"border: none; border-collapse: collapse;\"><colgroup><col width=\"343\" /><col width=\"259\" /></colgroup>\r\n<tbody>\r\n<tr style=\"height: 21pt;\">\r\n<td style=\"vertical-align: top; background-color: #666666; padding: 4pt 8pt 4pt 8pt; overflow: hidden; overflow-wrap: break-word; border: solid #48494a 0.8333325pt;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-fam