w: hidden; overflow-wrap: break-word; border: solid #cccccc 0.8333325pt;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">100 euros</span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 21pt;\">\r\n<td style=\"vertical-align: top; background-color: #ffffff; padding: 4pt 8pt 4pt 8pt; overflow: hidden; overflow-wrap: break-word; border: solid #cccccc 0.8333325pt;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">15 mai 2021</span></p>\r\n</td>\r\n<td style=\"vertical-align: top; background-color: #ffffff; padding: 4pt 8pt 4pt 8pt; overflow: hidden; overflow-wrap: break-word; border: solid #cccccc 0.8333325pt;\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">30 euros</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div dir=\"ltr\" align=\"left\">&nbsp;</div>\r\n<p style=\"text-align: center;\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/securite\">D&eacute;couvrez les failles de s&eacute;curit&eacute; de votre site</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Comment faire si je suis en zone blanche ou que mon mobile est trop ancien ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Si vous avez un mod&egrave;le de smartphone trop ancien pour permettre l&rsquo;identification personnelle ou si vous r&eacute;sidez dans une zone blanche (qui n\'est pas desservie par un r&eacute;seau de t&eacute;l&eacute;phonie mobile ou par Internet), les banques ont mis en place la proc&eacute;dure suivante : soit vous recevez un bo&icirc;tier (g&eacute;n&eacute;ralement factur&eacute;) avec lequel vous r&eacute;cup&eacute;rez un code &agrave; usage unique, soit vous recevez un code personnel coupl&eacute; au code envoy&eacute; par SMS de l&rsquo;ancienne formule d&rsquo;identification.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Après la mise en place de certicodes et de la validation renforcée, on observe une volonté de maximiser la sécurisation des paiement en ligne qui s\'avère de plus en plus utilisée.</p>\r\n<p dir=\"ltr\">Afin de vous aider dans la mise en place de ce dispositif, faites appel &agrave; votre agence Start-Win.</p>', 'Depuis le 15 mai, de nouvelles modalités obligatoires doivent être respectées pour les achats en ligne avec une carte bancaire. Start-Win vous en dit plus !', 3, '2021-05-19 14:14:01', '2021-05-25 11:37:59'),
(32, 'Le design thinking', 'Racapé Camille', '<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\"><span class=\"text-secondBlue\">Le design thinking</span> ou conception cr&eacute;ative pour les francophones est un processus centr&eacute; sur la cr&eacute;ativit&eacute; pour r&eacute;soudre des enjeux dans de nombreuses disciplines. D&eacute;velopp&eacute; dans les ann&eacute;es 1960, le design thinking est aujourd&rsquo;hui enseign&eacute; dans des &eacute;tablissements scolaires tr&egrave;s prestigieux comme Harvard ou Stanford. C&rsquo;est le PDG actuel d&rsquo;IDEO, Tim Brown qui a popularis&eacute; le terme en exprimant le fait que la vocation du design thinking sert &agrave; rassembler les besoins et d&eacute;sirs d&rsquo;un utilisateur, les possibilit&eacute;s technologiques et les objectifs &eacute;conomiques d&rsquo;une entreprise.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Peu importe le domaine dans lequel elle &eacute;volue, l&rsquo;approche du design thinking est centr&eacute;e sur <span class=\"text-secondBlue\">l&rsquo;empathie, la cr&eacute;ativit&eacute; et le besoin des usagers</span>. La&thinsp;conception cr&eacute;ative aide ainsi &agrave; s&rsquo;adresser &agrave; des march&eacute;s qui n&rsquo;avaient pas encore &eacute;t&eacute; identifi&eacute;s. C&rsquo;est une m&eacute;thodologie <span class=\"text-secondBlue\">centr&eacute;e sur l&rsquo;humain, une approche multidisciplinaire et collaborative</span>. Les entreprises qui l&rsquo;utilisent vont ainsi se focaliser sur les humains qu&rsquo;elles servent et vont donc cr&eacute;er de meilleurs produits, de meilleures relations et de meilleurs services.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Une certaine m&eacute;thodologie permet le d&eacute;veloppement du design thinking. Tout d&rsquo;abord, <span class=\"text-secondBlue\">l&rsquo;empathie</span>. Identifier le probl&egrave;me et le projet pouvant le r&eacute;gler. Qui sont les utilisateurs, leur r&eacute;alit&eacute;, leurs besoins, leurs ressentis.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Ensuite, <span class=\"text-secondBlue\">la r&eacute;flexion</span>. R&eacute;unir l&rsquo;&eacute;quipe et d&eacute;finir la probl&eacute;matique. Suivie de <span class=\"text-secondBlue\">l&rsquo;imagination</span>. Cette phase de r&eacute;colte des id&eacute;es est tr&egrave;s int&eacute;ressante lorsqu&rsquo;elle implique plusieurs perspectives. On parle alors d&rsquo;intelligence collective. Il s&rsquo;agit ici d&rsquo;explorer les diff&eacute;rentes avenues et de sortir des sentiers battus. L&rsquo;objectif est de g&eacute;n&eacute;rer toujours plus d&rsquo;id&eacute;es et de construire des solutions &agrave; partir des id&eacute;es des autres.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Puis, <span class=\"text-secondBlue\">prototyper</span>. &Eacute;laborer des sch&eacute;mas pour apporter des changements et am&eacute;liorations selon les commentaires re&ccedil;us lors des &eacute;tapes pr&eacute;c&eacute;dentes. Les solutions prennent alors la forme de maquettes, plans et esquisses.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">La s&eacute;lection se fait pour proposer aux participants la s&eacute;lection de la meilleure id&eacute;e. Le projet se concr&eacute;tise ensuite et les ressources financi&egrave;res se d&eacute;finissent. Le moment arrive o&ugrave; les solutions pr&eacute;sent&eacute;es vont &ecirc;tre valid&eacute;es ou non.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Il s&rsquo;agirait de r&eacute;fl&eacute;chir sur les meilleures id&eacute;es qui font surface avant de d&eacute;cider quelles sont les meilleures solutions. On utilise donc le design thinking pour :</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<ul style=\"text-align: justify;\">\r\n<li style=\"text-align: left;\"><span style=\"font-family: georgia, palatino, serif;\">Revoir et tester une exp&eacute;rience en magasin,</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-family: georgia, palatino, serif;\">Revaloriser un espace public ou r&eacute;fl&eacute;chir sur l&rsquo;accueil d&rsquo;usagers dans un local,</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-family: georgia, palatino, serif;\">Imaginer un concept publicitaire, voir et revoir le design d&rsquo;un produit de consommation,</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-family: georgia, palatino, serif;\">D&eacute;finir une nouvelle interface pour un site internet ou une application mobile,</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-family: georgia, palatino, serif;\">Revoir des processus de services &agrave; la client&egrave;le.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><span style=\"font-family: georgia, palatino, serif;\">Le design thinking est <span class=\"text-secondBlue\">un mod&egrave;le circulaire</span>. En effet, il peut &ecirc;tre indispensable de revenir en arri&egrave;re pour remettre en question des choix ant&eacute;rieurs. C&rsquo;est &agrave; travers l&rsquo;apprentissage par l&rsquo;erreur que le design thinking avance.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/ux\" target=\"_blank\" rel=\"noopener\">Faites un diagnostic de votre UX</a></p>', 'Innover, résoudre des problèmes, répondre aux besoins des clients… tel est le quotidien des entrepreneurs.\r\n\r\nIl existe de nombreux outils pour les aider dans ces tâches, malheureusement souvent méconnus. Dans cette palette de méthodes se trouve le design thinking. Ce terme un peu barbare cache une démarche collective facile et efficace.', 1, '2021-05-26 14:52:01', '2021-06-08 12:36:14'),
(33, 'Extension du chèque France Num jusqu’au 30 juin', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les d&eacute;penses &eacute;ligibles au ch&egrave;que France Num</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pour votre entreprise, deux types de d&eacute;penses sont &eacute;ligibles.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">La premi&egrave;re concerne <span class=\"text-secondBlue\">l&rsquo;achat ou l&rsquo;abonnement &agrave; des solutions num&eacute;riques &eacute;tablies en France ou dans un &Eacute;tat membre de l&rsquo;union europ&eacute;enne</span> : site e-commerce ou promotionnel, contenus, paiement en ligne, place de march&eacute;, visibilit&eacute; internet, solution de r&eacute;servation / prise de rendez-vous, gestion des stocks / des commandes / des livraisons, logiciel de caisse, h&eacute;bergement, stockage de donn&eacute;es, gestion du nom de domaine, outils de cybers&eacute;curit&eacute;, gestion des clients, outil de gestion en masse des courriers &eacute;lectroniques / de lettres d&rsquo;informations.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">La deuxi&egrave;me concerne <span class=\"text-secondBlue\">l&rsquo;accompagnement &agrave; la num&eacute;risation</span> (diagnostic pour d&eacute;marrer sa transformation num&eacute;rique) par un consultant priv&eacute; r&eacute;f&eacute;renc&eacute; sur ce t&eacute;l&eacute;service.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Extension de l&rsquo;aide jusqu&rsquo;au 30 juin</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Ch&egrave;que forfaitaire de 500 euros, <span class=\"text-secondBlue\">le ch&egrave;que France Num est &eacute;tendu jusqu&rsquo;au 30 juin. </span>Pour les factures dat&eacute;es entre le 28 janvier 2021 et le 30 juin 2021, vous avez jusqu&rsquo;au 31 juillet pour en faire la demande. Concernant les justifications &agrave; fournir, il vous faudra communiquer une ou plusieurs factures dat&eacute;es entre le 30 octobre 2020 et le 30 juin 2021 (le montant total des factures d&eacute;pos&eacute;es doit &ecirc;tre sup&eacute;rieur ou &eacute;gal &agrave; 450 euros TTC) mais aussi une pi&egrave;ce d&rsquo;identit&eacute;.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 12pt;\"><br />Alors n&rsquo;attendez plus, b&eacute;n&eacute;ficiez du ch&egrave;que France Num et faites appel &agrave; votre agence Start-Win pour b&eacute;n&eacute;ficier du meilleur du web. B&eacute;n&eacute;ficiaire du ch&egrave;que France Num ? <span class=\"text-secondBlue\"><strong>Nous vous offrons une optimisation SEO ou un logo</strong> avec le ch&egrave;que France Num!</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 12pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 12pt;\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../contact\" target=\"_blank\" rel=\"noopener\">Demander mon logo offert</a></p>', 'Le gouvernement prolonge l\'éligibilité des dépenses du chèque France Num jusqu’au 30 juin. Depuis le 10 mai, cette aide s’adresse à la plupart des entreprises de moins de 11 salariés ayant une activité économique et qui ont fait des dépenses de numérisation. Start-Win vous en dit plus !', 3, '2021-06-09 16:17:56', '2021-06-09 18:21:36'),
(34, 'La signification des couleurs', 'Pauline Motheron', '<h1 dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>La signification des couleurs</strong></span></h1>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">La signification des couleurs peut &ecirc;tre impact&eacute;e par plusieurs &eacute;l&eacute;ments :&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Les diff&eacute;rences culturelles</span> </strong>: par exemple, en Chine, le rouge est synonyme de chance, alors qu&rsquo;en Afrique du Sud, c&rsquo;est la couleur du deuil.&nbsp;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Les &eacute;poques</span> </strong>: auparavant, le rouge &eacute;tait associ&eacute; &agrave; la force et &agrave; la masculinit&eacute; et le bleu &eacute;tait per&ccedil;u comme une couleur f&eacute;minine.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Le ton et les nuances</span> </strong>: la signification d&rsquo;une couleur peut varier en fonction des nuances utilis&eacute;es : claires, fonc&eacute;es, turquoise, n&eacute;ons, &hellip;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">La combinaison de couleurs</span> </strong>: deux couleurs peuvent se renforcer l&rsquo;une l&rsquo;autre ou cr&eacute;er un contraste. Attention, elles peuvent aussi &ecirc;tre en comp&eacute;tition l&rsquo;une contre l&rsquo;autre.</p>\r\n</li>\r\n</ul>\r\n<p><br />Cependant, <strong><span class=\"text-secondBlue\">certaines significations restent universelles</span></strong> :</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/signification%20couleurs/roue-des-couleurs.jpeg\" alt=\"roue-des-couleurs.jpeg\" width=\"830\" height=\"500\" /></p>\r\n<p><em><span id=\"docs-internal-guid-88ad937d-7fff-fa1d-e917-14e4e7e76266\">&copy; R&eacute;sonance Communication</span></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Des exemples de campagnes de communication exploitant la signification des couleurs</span></strong></p>\r\n<p><span id=\"docs-internal-guid-ff2c2849-7fff-afbf-7c64-d48c2345ac06\">&nbsp;</span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/signification%20couleurs/1603893232-coca-cola-et-le-rouge.png\" alt=\"1603893232-coca-cola-et-le-rouge.png\" width=\"1336\" height=\"661\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-fb559237-7fff-1c86-2c0c-22dbae027a14\">Coca-Cola : passion, d&eacute;sir, &eacute;nergie</span></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/signification%20couleurs/1603893228-oral-b.webp\" alt=\"1603893228-oral-b.webp\" width=\"1600\" height=\"590\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-85b93ad5-7fff-59dd-265b-8ebb8aa38ee2\">Oral-B : stabilit&eacute;, confiance, s&eacute;curit&eacute;</span></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/signification%20couleurs/Capture%20d%E2%80%99e%CC%81cran%202014-11-25%20a%CC%80%2022.01.09.png\" alt=\"Capture d&rsquo;écran 2014-11-25 à 22.01.09.png\" width=\"651\" height=\"447\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-d7310076-7fff-4e63-3acd-9400915dedb8\">Biocoop : &eacute;cologie, nature, sant&eacute;</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Attention : certaines marques nous influencent en utilisant la couleur verte dans leur campagne de communication. En effet, elles se donnent une image &eacute;co-responsable tr&egrave;s &eacute;loign&eacute;e de la r&eacute;alit&eacute;. On peut alors parler de <strong><span class=\"text-secondBlue\">Green Washing</span></strong> (strat&eacute;gie qui consiste &agrave; communiquer aupr&egrave;s du public en utilisant l\'argument &eacute;cologique).</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-0f10a4bb-7fff-d7f9-8098-933f2850d739\"><br />Vous savez d&eacute;sormais qu&rsquo;il est important de porter une attention particuli&egrave;re &agrave; l&rsquo;usage des couleurs dans vos campagnes de communication. <strong><span class=\"text-secondBlue\">Votre agence Start-Win vous accompagne dans la r&eacute;alisation de vos visuels gr&acirc;ce &agrave; son expertise en image de marque.</span></strong></span></p>', 'D’après plusieurs études, les couleurs influencent notre inconscient et ont la capacité de changer nos habitudes d’achats. Leur perception reste subjective mais certaines sont universelles. Start-Win vous en dit plus !', 3, '2021-06-22 11:44:01', '2021-07-08 18:52:50'),
(35, 'Comment avoir plus d’abonnés sur votre compte Pinterest ?', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Comment avoir plus d&rsquo;abonn&eacute;s sur votre compte Pinterest ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"font-size: 14pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Pinterest/info-re%CC%81seauxsociaux.jpg\" alt=\"info-réseauxsociaux.jpg\" width=\"800\" height=\"2000\" /><br /></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><a class=\"call-to-action yellow mx-auto\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; word-break: break-all; transform: scale(1.2); font-size: medium; font-weight: bold; display: inline !important;\" href=\"../../diagnostic/social\"><span style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; font-family: Arial; font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&Eacute;ffectuez un diagnostic de vos r&eacute;seaux sociaux</span></a></span></p>\r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">&nbsp;</p>\r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">&nbsp;</p>\r\n<p style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\"><span id=\"docs-internal-guid-668f51a2-7fff-32b2-b470-214a584b5c72\" style=\"--tw-shadow: 0 0 transparent; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent;\">Maintenant que vous avez l\'essentiel des clefs en main, faites appel &agrave; votre agence Start-Win pour vous conseiller et vous aider dans votre communication.</span></p>', 'Simple d\'utilisation et efficace en terme de résultats sur le long terme, Pinterest peut vous aider à acquérir de nouveaux clients. Pour avoir plus d\'abonnés sur votre compte, plusieurs méthodes sont à votre disposition. Start-Win vous en dit plus !', 2, '2021-06-30 15:39:02', '2021-06-30 16:35:26'),
(36, 'Comment rédiger un bon article de blog ?', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Nos conseils pour r&eacute;diger un bon article de blog</span></strong></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li dir=\"ltr\" role=\"presentation\">Avant de r&eacute;diger vos articles, il est indispensable de <strong><span class=\"text-secondBlue\">d&eacute;finir votre audience cible</span></strong>. Vous devez alors vous demander : qui est-elle (sexe, &acirc;ge, CSP, ect.) ? Quels sont ses d&eacute;sirs, ses besoins, ses pr&eacute;occupations et ses points de douleur ?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">R&eacute;digez un bon titre d&rsquo;article ; un bon titre doit :</p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\">&rarr; &ecirc;tre <span class=\"text-secondBlue\"><strong>court</strong></span>,</p>\r\n<p dir=\"ltr\">&rarr; &ecirc;tre attrayant,&nbsp;</p>\r\n<p dir=\"ltr\">&rarr; refl&eacute;ter le contenu de votre article,</p>\r\n<p dir=\"ltr\">&rarr; contenir le <span class=\"text-secondBlue\"><strong>mot-cl&eacute; principal </strong></span>(tr&egrave;s important dans le cadre de votre r&eacute;f&eacute;rencement naturel - SEO).</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">R&eacute;digez <span class=\"text-secondBlue\"><strong>une introduction en respectant la m&eacute;thode QQOQCCP</strong></span> : votre introduction doit &ecirc;tre claire, concise, informative et attrayante. Dans celle-ci, nous vous recommandons d&rsquo;offrir le maximum de r&eacute;ponses aux questions suivantes : qui ? quoi ? o&ugrave; ? quand ? comment ? combien ? pourquoi ? (m&eacute;thode QQOQCCP).</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Respectez les r&egrave;gles de base de la r&eacute;daction web :</p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\">&rarr; r&eacute;digez des <span class=\"text-secondBlue\"><strong>phrases courtes</strong></span>,&nbsp;</p>\r\n<p dir=\"ltr\">&rarr; &eacute;vitez les gros blocs de texte,&nbsp;</p>\r\n<p dir=\"ltr\">&rarr; utilisez des <span class=\"text-secondBlue\"><strong>phrases &agrave; la voix active</strong></span>,&nbsp;</p>\r\n<p dir=\"ltr\">&rarr; mentionnez les informations importantes le plus t&ocirc;t possible dans le texte,</p>\r\n<p dir=\"ltr\">&rarr; veillez &agrave; <span class=\"text-secondBlue\"><strong>bien structurer l\'article</strong></span> (titre, sous-titre, introduction, conclusion, liste &agrave; puces, call-to-action, &hellip;),</p>\r\n<p dir=\"ltr\">&rarr; utilisez des <span class=\"text-secondBlue\"><strong>mots-cl&eacute;s</strong></span> pour am&eacute;liorer le r&eacute;f&eacute;rencement naturel,</p>\r\n<p dir=\"ltr\">&rarr; cr&eacute;ez des liens pertinents&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Adaptez le ton de votre article &agrave; votre cible</strong></span> : afin de fid&eacute;liser votre lectorat et cr&eacute;er un lien entre votre entreprise et vos lecteurs, vous devez adapter votre ton d&rsquo;&eacute;criture &agrave; votre cible. En effet, on ne s&rsquo;adresse pas &agrave; un adolescent comme un adulte.</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Soignez la pr&eacute;sentation de votre article : afin de faire passer votre message, vous devez placer <span class=\"text-secondBlue\"><strong>les informations les plus importantes aux endroits de la page web les plus visibles pour le lecteur</strong></span>. Un internaute qui lit sur son ordinateur ou smartphone a pour habitude de :&nbsp;</p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\">&rarr; lire les titres,</p>\r\n<p dir=\"ltr\">&rarr; porter plus d&rsquo;attention aux &eacute;l&eacute;ments se trouvant sur la gauche de la page,</p>\r\n<p dir=\"ltr\">&rarr; &ecirc;tre attir&eacute; par les &eacute;l&eacute;ments visuels (image, video, formulaire, call-to-action, &hellip;)</p>\r\n<p dir=\"ltr\">&rarr; passer plus de temps sur les &eacute;l&eacute;ments en haut de page et porter moins d&rsquo;attention aux &eacute;l&eacute;ments en bas de page.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ol start=\"7\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Enfin, effectuez <span class=\"text-secondBlue\"><strong>une relecture et une correction</strong></span> avant la publication. Vous trouverez de nombreux correcteurs en ligne gratuits ou payants qui vous aideront &agrave; r&eacute;aliser cette t&acirc;che.</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><a class=\"call-to-action yellow mx-auto\" href=\"../../diagnostic/referencement\">V&eacute;rifiez votre SEO</a></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Vous avez maintenant toutes les cl&eacute;s pour r&eacute;diger un bon article &agrave; destination de votre blog. N&rsquo;attendez plus, faites appel &agrave; notre agence pour optimiser le seo de votre blog !</p>', 'Vous souhaitez augmenter la visibilité de votre entreprise sur le web ? Acquérir de nouveaux clients et gagner leur confiance ? Fidéliser votre communauté ? Tenir un blog est une solution à ne pas négliger. Start-Win vous en dit plus !', 2, '2021-07-01 11:43:31', '2021-07-13 14:48:20');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(37, 'Série web design : le chatbot', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">C&rsquo;est quoi un chatbot ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un chatbot est un <span class=\"text-secondBlue\"><strong>programme informatique</strong></span> &eacute;labor&eacute; pour <span class=\"text-secondBlue\"><strong>dialoguer avec des utilisateurs</strong></span> via une plateforme ou une application de messagerie. Il permet de <span class=\"text-secondBlue\"><strong>d&eacute;livrer une r&eacute;ponse pr&eacute;enregistr&eacute;e &agrave; un instant T</strong></span> afin de r&eacute;pondre aux questions des utilisateurs et de proposer des solutions et services adapt&eacute;s.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quels sont les diff&eacute;rents types de chatbot ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour votre site web ou vos r&eacute;seaux sociaux, vous pouvez opter pour <span class=\"text-secondBlue\"><strong>un chatbot simple ou un chatbot intelligent</strong></span>.</p>\r\n<p dir=\"ltr\">Avec le chatbot simple, l&rsquo;agent conversationnel guide la discussion <span class=\"text-secondBlue\"><strong>en puisant dans une biblioth&egrave;que de questions/r&eacute;ponses pr&eacute;format&eacute;es et pr&eacute;enregistr&eacute;es</strong></span>. &Agrave; contrario, un chatbot intelligent <span class=\"text-secondBlue\"><strong>int&egrave;gre une technologie de traitement et du langage naturel (NLP)</strong></span> permettant ainsi de d&eacute;livrer un contenu pertinent et pr&eacute;cis.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Au moment de d&eacute;velopper votre agent conversationnel, posez-vous la question suivante : &ldquo;quel va &ecirc;tre l&rsquo;objectif de mon chatbot ?&rdquo;. En effet, diff&eacute;rents types de chatbots s&rsquo;offrent &agrave; vous :&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Les chatbots d&rsquo;interactions client</strong></span>&nbsp;qui permettent de r&eacute;pondre aux besoins imm&eacute;diats des clients.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"pass_region.jpg\" width=\"382\" height=\"497\" /></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span id=\"docs-internal-guid-38484a87-7fff-8e3d-4b10-3b5541cd511f\"><span class=\"text-secondBlue\"><strong>Les chatbots d&rsquo;accompagnement client</strong></span> qui permettent de guider le consommateur vers les produits adapt&eacute;s &agrave; ses besoins. Pour votre entreprise, c&rsquo;est un moyen efficace pour augmenter vos ventes.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"sncf-chatbot.jpg\" width=\"501\" height=\"1077\" /></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span id=\"docs-internal-guid-a0d4fb53-7fff-ad7c-fc4d-4530ae569554\"><span class=\"text-secondBlue\"><strong>Les chatbots &agrave; but marketing</strong></span> qui permettent d&rsquo;envoyer r&eacute;guli&egrave;rement des informations cibl&eacute;es &agrave; vos prospects et clients. Pour votre entreprise, c&rsquo;est un moyen efficace d&rsquo;augmenter le trafic sur votre site web.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Chatbot/science%26vie-chatbot.jpg\" alt=\"science&amp;vie-chatbot.jpg\" width=\"793\" height=\"424\" /></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span id=\"docs-internal-guid-a374083a-7fff-a080-9dae-0e42c4495d20\"><span class=\"text-secondBlue\"><strong>Les chatbots destin&eacute;s aux r&eacute;seaux sociaux</strong></span> qui permettent de r&eacute;pondre en temps r&eacute;el et 24/24h aux demandes des clients. Pour votre entreprise, c&rsquo;est un moyen efficace d&rsquo;optimiser votre pr&eacute;sence sur les r&eacute;seaux sociaux.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Chatbot/sephora-chatbot.jpg\" alt=\"sephora-chatbot.jpg\" width=\"640\" height=\"906\" /></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quels sont les avantages d&rsquo;un chatbot ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un chatbot a de nombreux avantages pour vous et votre entreprise dont :&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Proposer une assistance et un accompagnement &agrave; tout moment.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Simplifier le processus d&rsquo;achat.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Optimiser l\'exp&eacute;rience utilisateur.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Fid&eacute;liser les clients.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Multiplier les points de contacts avec les prospects.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D&eacute;sencombrer le service ou support client.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">R&eacute;duire les co&ucirc;ts.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/ux\">Diagnostic exp&eacute;rience utilisateur</a></p>\r\n<p>&nbsp;</p>\r\n<p><br />Les chatbots permettent de r&eacute;pondre &agrave; cette probl&eacute;matique de rapidit&eacute; gr&acirc;ce &agrave; un service d\'assistance illimit&eacute;. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win et int&eacute;grez un chatbot sur vos diff&eacute;rentes plateformes web.</strong></span></p>', 'Les consommateurs attendent des entreprises une très grande réactivité. En 2021, le chatbot est l’une des grandes tendances du web design et permet de répondre à ce besoin de rapidité. Start-Win vous en dit plus !', 1, '2021-07-12 16:21:27', '2021-08-06 10:57:15');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(38, 'Série web design : les micros-interactions', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>C&rsquo;est quoi une micro-interaction ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Selon Dan Saffer, cr&eacute;ateur du terme et product designer chez Twitter, une micro-interaction d&eacute;signe des <span class=\"text-secondBlue\"><strong>&ldquo;petits instants pendant lesquels l&rsquo;utilisateur et l&rsquo;interface interagissent&rdquo;</strong></span>. Pour bien concevoir votre micro-interaction, vous devez prendre en compte 4 crit&egrave;res particuliers :</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Un d&eacute;clencheur :</strong></span> par exemple un survol, un clic, un scroll ou un affichage de page qui g&eacute;n&egrave;re l&rsquo;action.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Micro-interactions/micro-interaction-d%C3%A9clencheur.gif\" alt=\"micro-interaction-d&eacute;clencheur.gif\" /></p>\r\n<p style=\"text-align: center;\"><em>Ici, le clic</em></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-f8b50841-7fff-93f7-5d0e-5d026ef44162\"></span></p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Des r&egrave;gles qui d&eacute;finissent ce qui se produit</strong></span> : par exemple un zoom, une ombre ou une apparition.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Micro-interactions/micro-interaction-r%C3%A8gles.gif\" alt=\"micro-interaction-r&egrave;gles.gif\" width=\"800\" height=\"600\" />Ici, le zoom</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span id=\"docs-internal-guid-53e34167-7fff-2859-9722-589cbd93d13f\"><span class=\"text-secondBlue\"><strong>Le feedback</strong></span> qui informe l&rsquo;utilisateur sur ce qu&rsquo;il est en train de se passer ou o&ugrave; il en est dans un processus.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Micro-interactions/micro-interaction-feedback.gif\" alt=\"micro-interaction-feedback.gif\" width=\"434\" height=\"400\" /><em><span id=\"docs-internal-guid-d493fdf6-7fff-224a-8bac-3ae5d899c30f\">Ici, le client est inform&eacute; que le produit a &eacute;t&eacute; enregistr&eacute; dans les favoris</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<ul>\r\n<li><span id=\"docs-internal-guid-d8a30b87-7fff-ef58-3b28-447fad6ad262\"><span class=\"text-secondBlue\"><strong>Des boucles et des modes :</strong></span> par exemple une r&eacute;p&eacute;tition, un syst&egrave;me de like ou l&rsquo;annulation d&rsquo;une action.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Micro-interactions/micro-interaction-like.gif\" alt=\"micro-interaction-like.gif\" width=\"326\" height=\"158\" /><em>Ici, le like</em></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Pourquoi les micro-interactions sont-elles importantes ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Les micro-interactions pr&eacute;sentent de nombreux avantages pour vous et votre entreprise :&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Elles am&eacute;liorent l&rsquo;UX de votre site web et/ou application.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Elles garantissent un parcours utilisateur fluide et intuitif.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Elles optimisent le tunnel d&rsquo;achat et am&eacute;liorent la conversion (elles simplifient la navigation, encouragent &agrave; faire des actions lorsqu&rsquo;elles sont accompagn&eacute;es de call-to-action et r&eacute;compensent l&rsquo;utilisateur, permettant ainsi d&rsquo;influencer son comportement).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Elles aident les utilisateurs &agrave; se souvenir de votre marque.</p>\r\n</li>\r\n</ul>\r\n<p><br /><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/ux\">Diagnostic exp&eacute;rience utilisateur</a></p>\r\n<p>&nbsp;</p>\r\n<p><br />Les micro-interactions vous permettent d&rsquo;offrir une meilleure exp&eacute;rience utilisateur, plus engageante, chaleureuse et humaine. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win et int&eacute;grez des micro-interactions sur vos diff&eacute;rentes plateformes web.</strong></span></p>', 'Connaissez-vous les micro-interactions ? Guidant l’utilisateur à travers le site, elles jouent un rôle essentiel dans vos interfaces utilisateur. Start-Win vous en dit plus !', 1, '2021-07-12 16:53:58', '2021-08-06 10:56:16'),
(39, 'Série web design : le minimalisme', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">C&rsquo;est quoi le minimalisme dans le design web ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Aujourd&rsquo;hui, le minimalisme se r&eacute;sume &agrave; <span class=\"text-secondBlue\"><strong>&ldquo;faire beaucoup avec peu&rdquo;</strong></span>. Il en va de m&ecirc;me en web design : il s&rsquo;agit de ne <span class=\"text-secondBlue\"><strong>conserver que les &eacute;l&eacute;ments essentiels qui permettent aux utilisateurs de r&eacute;soudre rapidement et facilement leurs probl&egrave;mes</strong></span>.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Nos conseils pour un site minimaliste</strong></span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les espaces blancs</strong></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">Caract&eacute;ristiques propres &agrave; la conception des sites web minimalistes, ils vous permettent de centrer l&rsquo;attention de l&rsquo;utilisateur sur le contenu de votre site internet plut&ocirc;t que sur d&rsquo;autres &eacute;l&eacute;ments pouvant &ecirc;tre parasitaires.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20minimalisme/espaces-blancs-apple.jpg\" alt=\"espaces-blancs-apple.jpg\" width=\"1600\" height=\"747\" /></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les couleurs vives</strong></span></p>\r\n</li>\r\n</ul>\r\n<p><span id=\"docs-internal-guid-ada157bd-7fff-b426-a9ba-f3ea4c5b82dc\"></span></p>\r\n<p dir=\"ltr\">Il vous est &eacute;galement possible de jouer avec une couleur vive tout en faisant attention que celle-ci contraste bien avec le blanc ou le noir (couleurs &agrave; privil&eacute;gier pour les contenus textuels de votre site internet). Cependant, l&rsquo;utilisation des couleurs doit &ecirc;tre limit&eacute;e pour ne pas perdre l&rsquo;attention des utilisateurs : nous vous recommandons d&rsquo;en utiliser 2 maximum.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20minimalisme/couleurs-vives.jpg\" alt=\"couleurs-vives.jpg\" width=\"600\" height=\"282\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>La typographie</strong></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-6424ed3d-7fff-f8d7-8fb3-1c3f96e15be2\"></span></p>\r\n<p dir=\"ltr\">En mati&egrave;re de police, laissez libre cours &agrave; votre cr&eacute;ativit&eacute;. Cependant, choisissez des polices faciles &agrave; lire qui attirent le regard de l&rsquo;internaute. Permettant de hi&eacute;rarchiser les &eacute;l&eacute;ments, de faire comprendre aux visiteurs ce qui est le plus important et de les aider &agrave; naviguer &agrave; travers votre site, les polices doivent &eacute;galement &ecirc;tre lisibles sur mobile (s&rsquo;adapter au design responsive).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20minimalisme/Typographie.jpg\" alt=\"Typographie.jpg\" width=\"750\" height=\"384\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les images</strong></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-32424f24-7fff-58f3-ba78-87534827d958\"></span></p>\r\n<p dir=\"ltr\">Le choix des images et visuels peut porter atteinte &agrave; un design minimaliste. C&rsquo;est pourquoi il est important de mener une vraie r&eacute;flexion quant aux photos utilis&eacute;es sur votre site. Leur caract&eacute;ristique premi&egrave;re ? &Ecirc;tre simples.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20minimalisme/image.jpg\" alt=\"image.jpg\" width=\"564\" height=\"327\" /></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les blocs de texte</strong></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-2c3d1e60-7fff-db7c-b1ed-cd2fa9cb0175\"></span></p>\r\n<p dir=\"ltr\">Pour garantir une qualit&eacute; de navigation optimale pour vos utilisateurs, privil&eacute;giez des petits blocs de texte permettant d&rsquo;organiser toutes les donn&eacute;es de votre site. Ainsi, vos internautes n\'auront aucune difficult&eacute; pour trouver les informations souhait&eacute;es.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Le%20minimalisme/bloc-de-texte.jpg\" alt=\"bloc-de-texte.jpg\" width=\"600\" height=\"987\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/ux\">Diagnostic exp&eacute;rience utilisateur</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-2c23a4e5-7fff-f163-31ce-4f85411b97b1\">&Agrave; la mode depuis quelques ann&eacute;es, le minimalisme est consid&eacute;r&eacute; comme l&rsquo;une des grandes tendances web design en 2021. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win pour la conception de votre site web minimaliste</strong></span>.</span></p>', 'Le minimalisme, intemporel et très populaire, est déjà utilisé par de grandes marques comme Google ou Apple. Mais de plus en plus d’entreprises conçoivent leur site internet de cette façon. Start-Win vous en dit plus !', 1, '2021-07-19 13:55:11', '2021-08-06 10:55:19'),
(40, 'Série développement web : la Progressive Web App (PWA)', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Qu&rsquo;est-ce qu&rsquo;une progressive web app (PWA) ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Technologie d&eacute;velopp&eacute;e et mise en avant par Google,<span class=\"text-secondBlue\"><strong> une progressive web app peut se d&eacute;finir comme &eacute;tant un site web qui agit, cependant, comme une application</strong></span>. Elle offre une exp&eacute;rience similaire aux applications classiques :&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Le plein &eacute;cran,</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Une ic&ocirc;ne sur le bureau,</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Un chargement rapide,</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Un syst&egrave;me de notifications,</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Un fonctionnement hors-ligne.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Apr&egrave;s t&eacute;l&eacute;chargement via un site web ou des r&eacute;sultats de recherche internet, la PWA s&rsquo;installe automatiquement sur l&rsquo;appareil de l&rsquo;utilisateur (smartphones et tablettes). Vous n&rsquo;avez ainsi plus besoin de passer par un store comme Google Play ou l&rsquo;App store. Par la suite, cette application est en capacit&eacute; d&rsquo;utiliser certaines fonctionnalit&eacute;s du t&eacute;l&eacute;phone comme l&rsquo;appareil photo, la g&eacute;olocalisation, le microphone, &hellip;</p>\r\n<p dir=\"ltr\">Les contenus sont alors charg&eacute;s sur cette application au fur et &agrave; mesure des connexions, d\'o&ugrave; le terme &ldquo;progressive&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Exemple de progressive web apps :</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/PWA/pwa-starbucks.jpg\" alt=\"pwa-starbucks.jpg\" width=\"1269\" height=\"764\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/PWA/progressive-web-apps-aliexpress.jpg\" alt=\"progressive-web-apps-aliexpress.jpg\" width=\"1269\" height=\"764\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Les avantages des progressive web apps</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Les progressive web apps pr&eacute;sentent plusieurs avantages pour vous, votre entreprise et vos clients :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>n&eacute;cessitent beaucoup moins de temps et d&rsquo;argent</strong></span> contrairement au d&eacute;veloppement d&rsquo;une application classique (dite &ldquo;application native&rdquo;).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <strong><span class=\"text-secondBlue\">sont directement disponibles depuis un navigateur web </span></strong>: l&rsquo;internaute n&rsquo;a alors plus besoin de t&eacute;l&eacute;charger de logiciel, ni d\'en installer.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>peuvent acc&eacute;der aux fonctions natives d&rsquo;un appareil</strong></span> : notifications push, g&eacute;olocalisation, cam&eacute;ra, microphone, exp&eacute;rience tactile, d&eacute;tecteur de mouvement, &hellip;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>ne requi&egrave;rent pas de t&eacute;l&eacute;chargement, ni de mise &agrave; jour obligatoires</strong></span> : l&rsquo;application s&rsquo;actualise automatiquement lors de son chargement.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>ne n&eacute;cessitent presque pas d&rsquo;espace de stockage et moins de ressources</strong></span> que des applications classiques mais proposent d&rsquo;aussi bonnes performances.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>sont ind&eacute;pendantes des &eacute;cosyst&egrave;mes ferm&eacute;s des diff&eacute;rents app-stores</strong></span>.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Les PWA <span class=\"text-secondBlue\"><strong>boostent votre r&eacute;f&eacute;rencement SEO</strong></span> (qui boostera probablement l&rsquo;engagement et les conversions).</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://www.youtube.com/embed/XoIhPjS5y1M?t=24s\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/referencement\">V&eacute;rifiez votre SEO</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-e8ec1f33-7fff-1097-99e4-96c68e7c5f55\">Afin de cr&eacute;er un site web optimis&eacute; et proposer une meilleure exp&eacute;rience utilisateur, une PWA est une bonne solution. <strong><span class=\"text-secondBlue\">N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win et d&eacute;veloppez votre PWA</span></strong>.</span></p>', 'Depuis quelques années, les Progressive Web Apps ont envahi le marché du mobile. Mais de quoi s’agit-il ? Start-Win vous en dit plus !', 1, '2021-07-19 14:04:01', '2021-08-06 10:53:41'),
(41, 'Série développement web : les pages mobiles accélérées (AMP)', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Qu&rsquo;est-ce que c&rsquo;est les pages mobiles acc&eacute;l&eacute;r&eacute;es (AMP) ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">N&eacute;es et mises en place par Google en 2015, les pages mobiles acc&eacute;l&eacute;r&eacute;es sont des <span class=\"text-secondBlue\"><strong>pages web mobiles qui ont la particularit&eacute; de s&rsquo;afficher presque instantan&eacute;ment (90 % plus rapidement que d&rsquo;habitude)</strong></span>. Utilisant un logiciel open source, elles permettent d&rsquo;am&eacute;liorer l&rsquo;exp&eacute;rience utilisateur en fluidifiant la navigation web depuis un smartphone.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span class=\"text-secondBlue\">Pouvez-vous utiliser les pages mobiles acc&eacute;l&eacute;r&eacute;es sur votre site ?</span></strong> Oui, tout le monde peut exploiter cette technologie. Il vous suffit de mettre &agrave; disposition sur votre site une version AMP sur les pages que vous souhaitez (toutes ou seulement quelques-unes). Pour votre plus grand bonheur, vous avez m&ecirc;me la possibilit&eacute; d&rsquo;inclure des images, des vid&eacute;os, des publicit&eacute;s et certains scripts d&rsquo;audience.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Comment identifier les pages mobiles acc&eacute;l&eacute;r&eacute;es ?</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/AMP/AMP%20Example.jpg\" alt=\"AMP Example.jpg\" width=\"1051\" height=\"1136\" /></strong></span></p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/AMP/amp-example-in-google.jpg\" alt=\"amp-example-in-google.jpg\" width=\"500\" height=\"951\" /></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les avantages des pages mobiles acc&eacute;l&eacute;r&eacute;es (AMP)</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour votre business, utiliser cette technologie pr&eacute;sente plusieurs avantages :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les pages AMP am&eacute;liorent l&rsquo;exp&eacute;rience utilisateur </strong></span>des internautes car ils acc&egrave;dent &agrave; l&rsquo;information souhait&eacute;e de fa&ccedil;on beaucoup plus simple et plus rapide.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Le temps de chargement d&rsquo;une page est capital pour optimiser l&rsquo;exp&eacute;rience utilisateur. <span class=\"text-secondBlue\"><strong>Gr&acirc;ce &agrave; une AMP, le temps moyen de chargement est r&eacute;duit &agrave; 0,7 secondes</strong></span> contrairement &agrave; une page mobile classique qui s&rsquo;&eacute;l&egrave;ve &agrave; 22 secondes.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Contrairement &agrave; une page mobile classique, <span class=\"text-secondBlue\"><strong>les pages AMP sont beaucoup moins lourdes</strong></span>. All&eacute;g&eacute;, le serveur peut donc supporter un trafic plus important.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Les AMP ont une influence sur le r&eacute;f&eacute;rencement naturel (SEO)</span></strong>. En effet,&nbsp; la vitesse de chargement et la lisibilit&eacute; sont deux crit&egrave;res importants pour votre SEO.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\"><br /><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/referencement\">V&eacute;rifiez votre SEO</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><br />L&rsquo;AMP fait acc&eacute;l&eacute;rer la disponibilit&eacute; des pages sur les smartphones et tablettes et permet ainsi d&rsquo;optimiser l&rsquo;exp&eacute;rience utilisateur. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win et d&eacute;veloppez des pages mobiles acc&eacute;l&eacute;r&eacute;es (AMP) sur votre site web.</strong></span></p>', 'Aujourd’hui, l’expérience utilisateur est plus que jamais sur le devant de la scène. Mais comment l’améliorer ? Comment la rendre optimale ? Les pages mobiles accélérées (AMP) peuvent vous aider. Start-Win vous en dit plus !', 1, '2021-07-23 10:24:44', '2021-08-19 09:14:35'),
(42, 'Série développement web : les applications à page unique (SPA)', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Qu&rsquo;est-ce que c&rsquo;est une application &agrave; page unique (SPA) ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Une application &agrave; page unique (SPA), ou Single Page Application en anglais, est <span class=\"text-secondBlue\"><strong>une application qui utilise le navigateur de l&rsquo;internaute pour g&eacute;n&eacute;rer la page qu&rsquo;il doit afficher : le code est ex&eacute;cut&eacute; c&ocirc;t&eacute; client</strong></span>. Ceci permet d\'&eacute;viter le chargement d\'une nouvelle page &agrave; chaque action demand&eacute;e et donc de fluidifier et optimiser l\'exp&eacute;rience utilisateur. L&rsquo;ensemble des &eacute;l&eacute;ments de l\'application est charg&eacute; (html, images, javascript, ...) en une fois (en fonction des actions de l\'internaute). Cette application &agrave; page unique (SPA) est accessible via une adresse URL dans votre navigateur. Elle s&rsquo;int&egrave;gre ensuite &agrave; votre bureau ou &eacute;cran d\'accueil.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Comment fonctionne une SPA ?</strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/SPA/spa-lifecycle.jpg\" alt=\"spa-lifecycle.jpg\" width=\"776\" height=\"462\" /></strong><em>Diff&eacute;rences entre une page web traditionnelle et une SPA</em></p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-f19b4136-7fff-61c4-7d87-b6d88674bdbf\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Dans le cas d&rsquo;une page web traditionnelle, le serveur ex&eacute;cute un script pour envoyer aux utilisateurs la page web &agrave; afficher. Dans le cas d&rsquo;une SPA, le serveur envoie aux utilisateurs le script qui permet de g&eacute;n&eacute;rer la page.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Les avantages d&rsquo;une SPA</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">La SPA pr&eacute;sente de multiples avantages pour vous et votre business :&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>En termes de s&eacute;curit&eacute; :</strong></span> une application &agrave; page unique pr&eacute;serve la confidentialit&eacute; des donn&eacute;es. En effet, elle ne lit que les donn&eacute;es que l&rsquo;utilisateur d&eacute;signe et ne peut pas modifier les donn&eacute;es.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>En termes de robustesse : </strong></span>une application &agrave; page unique est capable de r&eacute;sister aux pannes. En r&eacute;sistant &agrave; la coupure Internet, la SPA ne pr&eacute;sente aucun risque de perte de donn&eacute;es.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">En termes de sobri&eacute;t&eacute; : </span></strong>une application &agrave; page unique est tr&egrave;s &eacute;conome en moyens et ressources d&rsquo;exploitation. En effet, il n&rsquo;y a pas besoin de serveur et aucune administration n&rsquo;est n&eacute;cessaire.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>En termes de performance : </strong></span>une application &agrave; page unique est tr&egrave;s confortable &agrave; utiliser. En effet, elle propose une fluidit&eacute; optimale et un chargement rapide s&rsquo;effectuant au fur et &agrave; mesure.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../diagnostic/performance\">Effectuez un diagnostic de vos performances</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><br />Permettant d\'&eacute;viter le chargement d\'une nouvelle page &agrave; chaque action demand&eacute;e, une application &agrave; page unique (SPA) permet de fluidifier l\'exp&eacute;rience utilisateur. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win et d&eacute;veloppez une application &agrave; page unique (SPA).</strong></span></p>', 'Vous souhaitez fluidifier et optimiser votre expérience utilisateur mais vous ne savez pas exactement comment vous y prendre ? Les applications à page unique peuvent vous permettre d’atteindre cet objectif, Start-Win vous en dit plus !', 1, '2021-08-06 09:18:22', '2021-08-19 10:42:51'),
(43, 'Série communication : les influenceurs', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Qu&rsquo;est-ce qu&rsquo;un influenceur ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un influenceur est une personne qui <span class=\"text-secondBlue\"><strong>diffuse ses opinions aupr&egrave;s des internautes</strong></span> par le biais d&rsquo;un <span class=\"text-secondBlue\"><strong>blog personnel et/ou d&rsquo;autres supports</strong></span> (r&eacute;seaux sociaux, forum, &hellip;).&nbsp;De ce fait, il est capable d&rsquo;<span class=\"text-secondBlue\"><strong>influencer sa communaut&eacute; en modifiant leurs modes de consommation</strong></span>. Il peut &ecirc;tre ambassadeur d&rsquo;une ou plusieurs marques ou agir pour son propre compte. Son pouvoir d&rsquo;influence r&eacute;sulte de <span class=\"text-secondBlue\"><strong>sa popularit&eacute;, de son expertise sur un sujet donn&eacute; et de l&rsquo;&eacute;tendue de sa cible </strong></span>(fans, followers, abonn&eacute;s).&nbsp;</p>\r\n<p dir=\"ltr\">Il existe ainsi plusieurs cat&eacute;gories d&rsquo;influenceurs, dont les principales sont :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les m&eacute;ga-influenceurs et c&eacute;l&eacute;brit&eacute;s</strong></span> : jouissant d&rsquo;une large communaut&eacute; et &eacute;tant tr&egrave;s populaire, ils offrent aux marques une visibilit&eacute; premium.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les macro-influenceurs</strong></span> : soutenus par une communaut&eacute; engag&eacute;e, ils b&eacute;n&eacute;ficient d&rsquo;une l&eacute;gitimit&eacute; accrue dans leur secteur.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Les micro-influenceurs</strong></span> : disposant d&rsquo;une plus petite communaut&eacute;, ils sont appr&eacute;ci&eacute;s de leur abonn&eacute;s pour leur authenticit&eacute; et leur proximit&eacute;.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Exemples d&rsquo;influenceurs :</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Influenceurs/caroline-receveur-influenceuse.jpg\" alt=\"caroline-receveur-influenceuse.jpg\" width=\"1600\" height=\"1176\" /><em><span id=\"docs-internal-guid-514eee6d-7fff-4e52-6634-4fa33b30e0fe\">Caroline Receveur, 4,2 millions d&rsquo;abonn&eacute;s</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Influenceurs/hugoposay-influenceur.jpg\" alt=\"hugoposay-influenceur.jpg\" width=\"1600\" height=\"1028\" /><span id=\"docs-internal-guid-32b87c02-7fff-00fa-6fa4-88393638324a\">Hugoposay, 1 millions d&rsquo;abonn&eacute;s</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Influenceurs/manon-julien-influenceurs.jpg\" alt=\"manon-julien-influenceurs.jpg\" width=\"1600\" height=\"1177\" /><span id=\"docs-internal-guid-662dd7aa-7fff-a407-8fd3-abc617a55a1b\">Margot et Julien alias hellotravelers_, 18,3 mille abonn&eacute;s</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../diagnostic/social\">Effectuez un diagnostic de vos r&eacute;seaux sociaux</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Un influenceur, pour quoi faire ?</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">V&eacute;ritable tendance, les influenceurs vont vous aider &agrave; :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Faire conna&icirc;tre votre marque :</strong></span> selon leur port&eacute;e, ils vont permettre de d&eacute;velopper la visibilit&eacute; et la notori&eacute;t&eacute; de votre marque aupr&egrave;s de leur cible.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>G&eacute;n&eacute;rer de la confiance et fid&eacute;liser vos clients : </strong></span>le plus grand pouvoir des influenceurs repose sur la confiance (celle-ci leur permet de d&eacute;velopper des communaut&eacute;s de fans fid&egrave;les). Ainsi, ils vont renforcer votre image de marque et votre cr&eacute;dibilit&eacute;.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Cibler votre public de mani&egrave;re pr&eacute;cise : </strong></span>vous devez choisir un influenceur qui est align&eacute; &agrave; votre image de marque et &agrave; la cible que vous souhaitez atteindre.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Renouveler votre strat&eacute;gie de contenu : </strong></span>gagnant leur vie en cr&eacute;ant du contenu attrayant, la collaboration avec un influenceur peut vous permettre de red&eacute;finir votre strat&eacute;gie de contenu en lui donnant une nouvelle perspective.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><strong><span class=\"text-secondBlue\">Am&eacute;liorer votre r&eacute;f&eacute;rencement naturel : </span></strong>les influenceurs, avec leur contenu unique et accrocheur, vous permettront d&rsquo;am&eacute;liorer votre classement sur les moteurs de recherche. De plus, ceux-ci am&eacute;liorent la notori&eacute;t&eacute; et l\'engagement de votre marque, et vous permettent de cr&eacute;er une communaut&eacute; plus &eacute;tendue et de g&eacute;n&eacute;rer plus de trafic. Enfin, les influenceurs conduisent des backlinks vers votre site web, ce qui va augmenter votre cote de popularit&eacute;.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Augmenter l&rsquo;engagement du public :</strong></span> Selon Hubspot, &ldquo;61 % des consommateurs interagissent au moins une fois par jour avec un influenceur&rdquo;. Les influenceurs vont permettre de booster les interactions sur vos r&eacute;seaux sociaux.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong><span style=\"text-align: center;\">Booster la conversion :</span></strong></span><span style=\"text-align: center;\"> gr&acirc;ce &agrave; des suggestions de shopping bien introduites, les influenceurs vous permettent de maximiser vos conversions en poussant l&rsquo;acte d&rsquo;achat.</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><a class=\"call-to-action yellow mx-auto\" href=\"../../diagnostic/performance\"><span style=\"text-align: center;\">Effectuez un diagnostic de vos performances</span></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-658d62a9-7fff-1bbe-fbd3-e5d067d62742\">Maintenant que vous en savez plus, pourquoi ne pas collaborer avec un ou plusieurs influenceurs pour la promotion de vos produits et services ?<strong> <span class=\"text-secondBlue\">Quoi qu&rsquo;il en soit, votre agence Start-Win vous propose un accompagnement personnalis&eacute; pour trouver davantage de clients avec ou sans influenceurs.</span></strong></span></p>', '46% des consommateurs suivent des influenceurs pour leurs recommandations et 80% des consommateurs ont déjà fait un achat suite à une recommandation d’un influenceur. Alors Start-Win a décidé de vous en dire plus...', 1, '2021-08-17 13:59:33', '2021-08-24 12:39:28'),
(44, 'Série communication : les couleurs les plus tendances en 2021', 'Pauline Motheron', '<p><span style=\"font-size: 14pt;\"><strong>Les couleurs les plus tendances en 2021</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Couleurs%20tendances%20communication/Les%20couleurs%20les%20plus%20tendances%20en%202021.jpg\" alt=\"Les couleurs les plus tendances en 2021.jpg\" width=\"800\" height=\"2000\" /></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Maintenant que vous connaissez les couleurs phares de cette ann&eacute;e, <span class=\"text-secondBlue\"><strong>confiez vos projets de communication &agrave; votre agence Start-Win : &eacute;laboration de votre identit&eacute; graphique, logotype, cartes de visite, flyers et contenus pour vos r&eacute;seaux sociaux.</strong></span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp;</span></p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../contact\">Contactez-nous pour tous vos projets de communication</a></p>', 'Les tendances changent de plus en plus vite. Et ça concerne bien évidemment les couleurs : dans la mode, la déco, le design, … et dans la communication ! Start-Win vous dévoile les couleurs les plus tendances en 2021 à utiliser pour votre communication.', 1, '2021-08-19 09:23:59', '2021-09-30 18:12:49'),
(45, 'Série communication : le live shopping', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>C&rsquo;est quoi le live shopping ?</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Le live shopping est <span class=\"text-secondBlue\"><strong>une technique de vente en ligne</strong></span>. Elle permet de <span class=\"text-secondBlue\"><strong>vendre et d&rsquo;acheter des produits sur les r&eacute;seaux sociaux</strong></span> (Facebook, Instagram, TikTok, &hellip;) aupr&egrave;s d&rsquo;influenceurs ou de vendeurs. Le principe ? <span class=\"text-secondBlue\"><strong>Montrer un produit en direct et donner envie aux spectateurs d&rsquo;acheter celui-ci instantan&eacute;ment gr&acirc;ce &agrave; un lien ou une page reli&eacute;e</strong></span>. Selon des estimations, le live shopping en Chine a g&eacute;n&eacute;r&eacute; 170 milliards de dollars de vente en 2020.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Mais &ccedil;a ne vous rappelle rien ? Notre bon vieux t&eacute;l&eacute;-achat, mais cette fois-ci en version 2.0.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em>Exemple de live shopping :</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"text-decoration: underline;\"><span class=\"text-secondBlue\"><a href=\"https://www.facebook.com/193769290673702/videos/1778633482187267\">Live shopping Sephora X Lanc&ocirc;me pour son produit &ldquo;Teint Miracle&rdquo; avec les influenceurs thedollbeauty et richaard2609.</a></span></span></li>\r\n<li dir=\"ltr\"><span style=\"text-decoration: underline;\"><span class=\"text-secondBlue\"><a href=\"https://www.fnac.com/sessions-hightech/Sonos#cast-open\">Live shopping Fnac pour son produit &ldquo;Enceinte Sonos Roam&rdquo; avec les YouTubeurs Jojol et Theicollection.</a></span></span></li>\r\n<li dir=\"ltr\"><span class=\"text-secondBlue\" style=\"text-decoration: underline;\"><a href=\"https://www.cdiscount.com/n-412633/corner-op-ac/live-shopping.html\">Live shopping Cdiscount pour pr&eacute;senter une s&eacute;lection d&rsquo;accessoires de cuisine avec Charline Stengel (candidate de la saison 12 de Top Chef) et le YouTubeur Herv&eacute; Cuisine.</a></span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"../../diagnostic/social\">Effectuez un diagnostic de vos r&eacute;seaux sociaux</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Le live shopping, mais pourquoi ?</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Le live shopping pr&eacute;sente de nombreux avantages pour vous et votre marque :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il est facile &agrave; mettre en place</strong></span> (utilisez votre site web, Facebook, Instagram, TikTok, YouTube, Twitch, LinkedIn&hellip; pour cr&eacute;er votre &eacute;v&eacute;nement en live).</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il est plus authentique et engageant</strong></span> (tout comme vous, votre communaut&eacute; peut interagir en direct. Vous pouvez ainsi d&eacute;tecter ses besoins et r&eacute;pondre &agrave; des demandes sp&eacute;cifiques).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il permet de fid&eacute;liser votre client&egrave;le</strong></span>.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Son contenu est r&eacute;utilisable facilement </strong></span>(proposez un replay de la vid&eacute;o et diffusez le sur d&rsquo;autres plateformes).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il permet de g&eacute;n&eacute;rer des ventes </strong></span>(m&ecirc;me si l&rsquo;achat n&rsquo;est pas imm&eacute;diat, il peut &ecirc;tre d&eacute;clench&eacute; suite &agrave; la vision du live shopping).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il augmente le trafic sur votre site web</strong></span>.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Il vous permet de proposer une exp&eacute;rience divertissante</strong></span>.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Live%20Shopping/InfluencerScreen-Updated._TTW_%20(1).jpg\" alt=\"InfluencerScreen-Updated._TTW_ (1).jpg\" width=\"867\" height=\"517\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-faaea03a-7fff-267d-3811-b9d3bd638f1a\"></span></p>\r\n<p dir=\"ltr\">Ph&eacute;nom&egrave;ne en vogue dans le monde de l&rsquo;e-commerce, le live shopping peut permettre &agrave; votre entreprise de proposer une exp&eacute;rience innovante &agrave; votre client&egrave;le tout en boostant consid&eacute;rablement vos ventes. <span class=\"text-secondBlue\"><strong>N&rsquo;attendez plus, faites appel &agrave; votre agence Start-Win pour la cr&eacute;ation de vos contenus &agrave; destination de vos r&eacute;seaux sociaux</strong></span>.</p>', 'Reprenant les grands principes du télé-achat, le live shopping peut vous permettre de booster davantage vos performances e-commerce. Mais qu\'est-ce que c’est concrètement ? Et quels sont ses avantages ? Start-Win vous en dit plus !', 1, '2021-08-19 11:35:12', '2021-08-24 11:10:02'),
(46, 'Les tendances et usages du Numérique en France (2020 & 2021)', 'Pauline Motheron', '<p><span id=\"p9\">Juste en dessous, retrouvez notre nouvelle infographie avec les chiffres-cl&eacute;s du num&eacute;rique.</span><span id=\"p10\">&nbsp;Sortez vos lunettes et soyez attentifs !</span><br /><em><span id=\"p11\">(<span id=\"13\">source</span>&nbsp;:</span><span id=\"p12\">&nbsp;<span id=\"14\">CREDOC</span>, &eacute;tude r&eacute;alis&eacute;e entre d&eacute;cembre 2020 et janvier&nbsp;<span id=\"15\">2021)</span></span></em></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Usages%20num%C3%A9rique/infographie_chiffres_cle%CC%81s_nume%CC%81rique.jpg\" alt=\"infographie_chiffres_clés_numérique.jpg\" width=\"800\" height=\"2000\" /></p>', 'Vous souhaitez en savoir plus sur les tendances et usages du Numérique en France ? Start-Win vous en dit plus !', 3, '2021-09-13 14:10:21', '2021-09-13 14:21:15');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(47, 'Pourquoi intégrer les jeux concours dans votre stratégie marketing ?', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">D&eacute;finition et objectifs</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Selon <a href=\"https://www.definitions-marketing.com/\">definitions-marketing.com</a>, le jeu concours est &ldquo;<span class=\"text-secondBlue\"><strong>une technique promotionnelle permettant d\'animer la relation client ou prospect, de travailler l\'image, de faire passer des messages et essentiellement de collecter des profils de participants</strong></span>&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pour votre entreprise, ses objectifs sont multiples. Il vous permet de :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Renforcer votre visibilit&eacute; en ligne</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D&eacute;velopper votre communaut&eacute;</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Collecter ou mettre &agrave; jour les informations de vos prospects ou de vos clients</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Promouvoir vos produits et services</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Cr&eacute;er du trafic sur votre site internet</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Fid&eacute;liser votre client&egrave;le</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\" style=\"font-size: 14pt; color: #000000;\"><strong>Les styles de jeux concours les plus utilis&eacute;s</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Le jeu concours traditionnel</strong></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Principe</strong></p>\r\n<p dir=\"ltr\">L&rsquo;utilisateur doit r&eacute;aliser une ou plusieurs actions : like, partage, commentaire, &hellip; Le gagnant est ensuite tir&eacute; au sort.</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Jeu%20concours/yves-rocher.jpg\" alt=\"yves-rocher.jpg\" width=\"1600\" height=\"886\" /></span><em><span id=\"docs-internal-guid-ca990a1c-7fff-192d-6dd4-b6ac06523807\">Jeu concours Yves Rocher</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\" style=\"font-size: 12pt;\"><strong>Les instants gagnants</strong></span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Principe</strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Apr&egrave;s avoir rempli un formulaire (nom, pr&eacute;nom, e-mail, &hellip;), le joueur clique sur un bouton et sait directement s&rsquo;il a gagn&eacute; un lot ou non. Les participants peuvent retenter leur chance tout au long du jeu concours.</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Jeu%20concours/jackpot-YOP.jpg\" alt=\"jackpot-YOP.jpg\" width=\"801\" height=\"619\" /></span><em><span id=\"docs-internal-guid-1c582952-7fff-efb8-991e-6a6760cbf258\">Jeu concours &ldquo;instants gagnants&rdquo; Yop</span></em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Le quiz</strong></span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Principe</strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pour gagner, l&rsquo;internaute doit r&eacute;pondre correctement &agrave; toutes les questions pos&eacute;es par la marque avant d&rsquo;&ecirc;tre tir&eacute; au sort.</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Jeu%20concours/QUIZZ-1-2-1030x647.jpg\" alt=\"QUIZZ-1-2-1030x647.jpg\" width=\"1030\" height=\"647\" /></span><em><span id=\"docs-internal-guid-6599af16-7fff-b83f-a079-e5af666c1ad6\">Jeu concours &ldquo;quiz&rdquo; Biocoop</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\"><span class=\"text-secondBlue\"><strong>Le concours User Generated Content</strong></span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Principe</strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Pour participer, l&rsquo;internaute doit r&eacute;aliser et partager une photographie, une vid&eacute;o, un dessin ou tout autre contenu visuel sur un th&egrave;me d&eacute;fini o&ugrave; selon les conditions impos&eacute;es. L&rsquo;internaute qui r&eacute;colte le plus de likes, de partages ou de commentaires remporte le cadeau.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Jeu%20concours/actu_concours.jpg\" alt=\"actu_concours.jpg\" width=\"604\" height=\"860\" /><span id=\"docs-internal-guid-2baff74d-7fff-7ae3-2929-df5d2892a413\"></span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Jeu concours photo Air France</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Nos conseils pour bien organiser votre jeu concours</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour organiser au mieux votre jeu concours, Start-Win vous conseille :&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De d&eacute;finir les objectifs du jeu</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De d&eacute;terminer le type de jeu concours ad&eacute;quat</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D&rsquo;offrir une r&eacute;compense adapt&eacute;e</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D\'utiliser les hashtags</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">De publier un r&egrave;glement</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">D&rsquo;&ecirc;tre visuel : r&eacute;sumez la m&eacute;canique de votre jeu concours en une image attirante et originale</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><br /><br /></p>\r\n<p dir=\"ltr\">Le jeu concours, ind&eacute;modable et tr&egrave;s appr&eacute;ci&eacute; des internautes, vous permet de gagner en visibilit&eacute;. Pour &ecirc;tre accompagn&eacute; dans la mise en place d&rsquo;un jeu concours, <span class=\"text-secondBlue\"><strong>faites appel &agrave; votre agence Start-Win : conseil, mise en place, suivi du projet, cr&eacute;ation de contenu, ...</strong></span></p>', 'Réel levier marketing, le jeu concours est un bon moyen de promouvoir votre marque. Vous souhaitez en savoir davantage ? Start-Win vous en dit plus !', 1, '2021-09-13 14:45:22', '2021-09-17 11:07:25'),
(48, 'Optimiser le référencement d’une image sur Google', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Le nom de l&rsquo;image</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Objectifs :</strong></span> booster votre r&eacute;f&eacute;rencement naturel (SEO) et appara&icirc;tre dans les requ&ecirc;tes ad&eacute;quates sur le navigateur.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Rien de plus simple :</strong></span> donnez un nom qui indique &agrave; Google ce que repr&eacute;sente votre image. Attention, n&rsquo;utilisez pas de caract&egrave;res sp&eacute;ciaux, ni d&rsquo;accents : s&eacute;parer les termes distincts avec des tirets.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><em>Exemple :</em></p>\r\n<p dir=\"ltr\"><em>Nom de l&rsquo;image : salade-&eacute;t&eacute;-facile-et-pas-chere-anna-food.png</em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Optimiser%20images/anna-pelzer-IGfIGP5ONV0-unsplash.jpg\" alt=\"anna-pelzer-IGfIGP5ONV0-unsplash.jpg\" width=\"1350\" height=\"900\" /></em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p><strong><span id=\"p0\" style=\"font-size: 14pt;\">L&rsquo;attribut&nbsp;<span id=\"15\">ALT</span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"text-secondBlue\"><strong><span id=\"p1\">Objectif :</span></strong></span><span id=\"p2\"><span class=\"text-secondBlue\"><strong>&nbsp;</strong></span>remplacer votre image si celle-ci ne s&rsquo;affiche pas.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"p3\">L&rsquo;attribut&nbsp;<span id=\"18\">ALT</span>&nbsp;ou texte alternatif permet de donner une description courte et pr&eacute;cise de votre image.</span><span id=\"p4\">&nbsp;Int&eacute;gr&eacute; &agrave; la balise&nbsp;</span><span id=\"p5\"><span id=\"19\">dans</span>&nbsp;un document HTML, il remplace votre image si celle-ci n&rsquo;arrive pas &agrave; s&rsquo;afficher.</span><span id=\"p6\">&nbsp;Autre atout ?</span><span id=\"p7\">&nbsp;L&rsquo;attribut&nbsp;<span id=\"20\">ALT</span>&nbsp;est tr&egrave;s utile lorsque le robot d&rsquo;indexation Google analyse une image :</span><span id=\"p8\">&nbsp;il en comprend le th&egrave;me et la cat&eacute;gorise.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"text-secondBlue\"><strong><span id=\"p9\">Rien de plus simple :</span></strong></span><span id=\"p10\">&nbsp;r&eacute;diger une courte phrase &agrave; partir de mots-cl&eacute;s.</span><span id=\"p11\"></span></p>\r\n<p>&nbsp;</p>\r\n<p><em><span id=\"p12\">Exemple :</span></em></p>\r\n<p><em><span id=\"p13\"><span id=\"16\">Attribut</span>&nbsp;<span id=\"17\">ALT</span>&nbsp;:</span><span id=\"p14\">&nbsp;&ldquo;coupes de cheveux pour femmes&rdquo;</span></em></p>\r\n<p>&nbsp;</p>\r\n<p><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Optimiser%20images/jessie-dee-dabrowski-www-jessiedee-net-W6cwaL7PMSw-unsplash.jpg\" alt=\"jessie-dee-dabrowski-www-jessiedee-net-W6cwaL7PMSw-unsplash.jpg\" width=\"600\" height=\"900\" /></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><strong><span id=\"p71\">Les titres et l&eacute;gendes</span></strong></span><br /><br /><span class=\"text-secondBlue\"><strong><span id=\"p73\">Objectif :</span></strong></span><span id=\"p74\">&nbsp;faciliter l&rsquo;exp&eacute;rience utilisateur&nbsp;<span id=\"p72\">(crit&egrave;re capital pour Google)</span>.</span><br /><br /><span id=\"p75\">Attention, le titre d&rsquo;une image est diff&eacute;rent de son nom :</span><span id=\"p93\">&nbsp;il correspond &agrave; ce qui est pr&eacute;sent dans l&rsquo;attribut optionnel.</span><br /><br /><span class=\"text-secondBlue\"><strong><span id=\"p78\">Pour le titre, rien de plus simple :</span></strong></span><span id=\"p79\">&nbsp;utilisez des mots-cl&eacute;s&nbsp;<span id=\"p77\">(diff&eacute;rents que ceux de l&rsquo;attribut&nbsp;<span id=\"89\">ALT</span>)</span>.</span><span id=\"p80\">&nbsp;Votre titre doit donner un compl&eacute;ment d&rsquo;information &agrave; votre image.</span><span id=\"p81\"></span><br /><span class=\"text-secondBlue\"><strong><span id=\"p82\">Pour la l&eacute;gende, rien de plus simple :</span></strong></span><span id=\"p83\"> r&eacute;digez une courte phrase &agrave; partir de mots-cl&eacute;s.</span><span id=\"p84\"></span><br /><br /><em><span id=\"p85\">Exemple :</span></em><br /><em><span id=\"p86\"><span id=\"90\">Titre</span>&nbsp;:</span><span id=\"p87\">&nbsp;<span id=\"91\">L</span>&rsquo;entretien de votre jardin par&nbsp;<span id=\"92\">Jardin&eacute;o</span></span></em><br /><em><span id=\"p57\">L&eacute;gende :</span><span id=\"p58\">&nbsp;b&eacute;n&eacute;ficiez d&rsquo;un accompagnement personnalis&eacute; pour tous vos projets de jardin :</span><span id=\"p59\">&nbsp;entretien, plantation,&nbsp;<span id=\"65\">rev&ecirc;tement,&nbsp;</span>&hellip;</span></em></p>\r\n<p>&nbsp;</p>\r\n<p><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Optimiser%20images/boris-debusscher-9Rtp9uvTs3Q-unsplash.jpg\" alt=\"boris-debusscher-9Rtp9uvTs3Q-unsplash.jpg\" width=\"1226\" height=\"900\" /></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><strong><span id=\"p98\">Le format, la taille et le poids de l&rsquo;image</span></strong></span><br /><br /><span class=\"text-secondBlue\"><strong><span id=\"p99\">Objectifs :</span></strong></span><span id=\"p100\"><span class=\"text-secondBlue\"><strong>&nbsp;</strong></span>rendre votre image plus lisible, favoriser son affichage et r&eacute;duire le temps de chargement de votre page.</span><br /><br /><span class=\"text-secondBlue\"><strong><span id=\"p103\">Rien de plus simple :</span></strong></span><span id=\"p104\"><span class=\"text-secondBlue\"><strong>&nbsp;</strong></span>les formats que vous devez privil&eacute;gier sont le&nbsp;<span id=\"110\">JPG</span>, le PNG et le GIF.</span><span id=\"p105\">&nbsp;Pour la taille et le poids, renseignez la hauteur&nbsp;<span id=\"p102\">(<span id=\"109\">height</span>)</span>&nbsp;et la largeur&nbsp;<span id=\"p101\">(<span id=\"108\">width</span>)</span>.</span><span id=\"p106\">&nbsp;Attention, essayez de faire correspondre la taille de l&rsquo;image et la taille d&rsquo;affichage.</span><br /><br /><br /><span id=\"p107\">Maintenant que vous en savez plus pour optimiser le r&eacute;f&eacute;rencement de vos images sur Google, <span class=\"text-secondBlue\"><strong>faites appel &agrave; votre agence&nbsp;<span id=\"111\">Start-Win</span>&nbsp;et b&eacute;n&eacute;ficiez d&rsquo;un accompagnement personnalis&eacute; pour optimiser votre SEO.</strong></span></span></p>', 'Vous souhaitez améliorer votre classement dans Google Images ? Cet article est fait pour vous. Start-Win vous en dit plus !', 1, '2021-09-13 15:07:56', '2021-09-17 11:04:16'),
(49, 'Série “les outils de communication” : la charte graphique', 'Pauline Motheron', '<p><span style=\"font-size: 14pt;\"><strong><span id=\"p21\">C&rsquo;est quoi une charte graphique ?</span></strong></span><br /><br /><span id=\"p24\">La charte graphique est&nbsp;<span id=\"55\">un</span>&nbsp;guide qui contient <span class=\"text-secondBlue\"><strong>l&rsquo;ensemble des r&egrave;gles fondamentales d&rsquo;utilisation de votre logo</strong><strong>.</strong></span></span><span id=\"p25\">&nbsp;Ce document, &agrave; destination des professionnels de la communication&nbsp;<span id=\"p23\">(externe ou interne)</span>&nbsp;et de la cha&icirc;ne graphique&nbsp;<span id=\"p22\">(imprimeurs et graphistes)</span>, <span class=\"text-secondBlue\"><strong>est primordial pour que votre image soit utilis&eacute;e dans de bonnes conditions et afin de conserver la coh&eacute;rence de votre communication&nbsp;<span id=\"56\">visuelle </span></strong></span></span><span id=\"p26\"><span id=\"p27\">(respect des couleurs, de la typographie, des proportions, de la mise en&nbsp;<span id=\"57\">page, </span>...)</span>.</span><br /><br /><strong><span id=\"p28\">Mais pourquoi une charte graphique ?</span></strong><span id=\"p29\"></span><br /><span id=\"p65\">Gr&acirc;ce &agrave; une charte graphique, <span class=\"text-secondBlue\"><strong>votre communication restera homog&egrave;ne, personnalis&eacute;e, et par cons&eacute;quent identifiable et efficace dans le temps, et ce, sur tous les supports imaginables.</strong></span></span><br /><br /><br /><span style=\"font-size: 14pt;\"><strong><span id=\"p31\">Que doit contenir votre charte graphique ?</span></strong></span><br /><br /><span id=\"p32\">&bull; </span><span id=\"p32\">La pr&eacute;sentation du logotype</span><br /><span id=\"p34\">&bull; Une description du logotype <span id=\"p33\">(symbolique, dimensions et marges)</span></span><br /><span id=\"p37\">&bull; Les donn&eacute;es colorim&eacute;triques en <span id=\"60\">CMJN</span>&nbsp;<span id=\"p36\">(pour l&rsquo;imprimeur)</span>&nbsp;et&nbsp;<span id=\"61\">RVB</span>&nbsp;<span id=\"p35\">(pour le web)</span>&nbsp;pour chaque d&eacute;clinaison du logo</span><br /><span id=\"p43\">&bull; Le<span id=\"p42\">(s)</span>&nbsp;nom<span id=\"p41\">(s)</span>&nbsp;de<span id=\"p40\">(s)</span>&nbsp;la police<span id=\"p39\">(s)</span>&nbsp;de caract&egrave;re<span id=\"p38\">(s)</span></span><br /><span id=\"p44\">&bull; La repr&eacute;sentation du logo en noir et blanc</span><br /><span id=\"p45\">&bull; La repr&eacute;sentation du logo sur fond de couleur</span><br /><span id=\"p46\">&bull; La repr&eacute;sentation du logo dans ses diff&eacute;rentes postures :</span><span id=\"p47\">&nbsp;verticale, horizontale, avec et sans&nbsp;<span id=\"62\">baseline,&nbsp;</span>&hellip;</span><br /><span id=\"p49\">&bull; Les zones de protection <span id=\"p48\">(zone dans laquelle on ne doit pas placer de texte ou d\'objet)</span></span><br /><span id=\"p51\">&bull; Les permissions et les interdits dans l&rsquo;usage du logo <span id=\"p50\">(taille, positionnement des &eacute;l&eacute;ments du logo les uns par rapport aux autres, &hellip;)</span></span><br /><span id=\"p52\">&bull; La fa&ccedil;on dont le logo doit &ecirc;tre trait&eacute; sur les supports de communication des partenaires</span><br /><span id=\"p54\">&bull; La pr&eacute;sentation des d&eacute;clinaisons sur les principaux supports de communication sur lesquels le logo est amen&eacute; &agrave; vivre <span id=\"p53\">(cartes de visite, plaquette, signal&eacute;tique, objets publicitaires,&nbsp;<span id=\"64\">flyers</span>, &hellip;)</span></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span id=\"docs-internal-guid-39d07aa3-7fff-c159-36aa-bc3daf73f586\" style=\"font-size: 14pt;\">Exemples de chartes graphiques</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Charte%20graphique/exemple-charte-graphique-1.jpeg\" alt=\"exemple-charte-graphique-1.jpeg\" width=\"1000\" height=\"1263\" /><em><span id=\"docs-internal-guid-1a5af12a-7fff-3249-cfe3-7d843f44606a\">&rarr; La French Tech </span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Charte%20graphique/exemple-charte-graphique-2.jpg\" alt=\"exemple-charte-graphique-2.jpg\" width=\"1191\" height=\"842\" /><span id=\"docs-internal-guid-13e8bc59-7fff-8c66-fe63-242e68fd5726\">&rarr; 23th Studio</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Charte%20graphique/exemple-charte-graphique-3.png\" alt=\"exemple-charte-graphique-3.png\" width=\"669\" height=\"387\" /></em></p>\r\n<p style=\"text-align: center;\"><em><span id=\"docs-internal-guid-d9259941-7fff-ee0d-a75b-718f5e649adb\">&rarr; Skype</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Charte%20graphique/exemple-charte-graphique-4.jpg\" alt=\"exemple-charte-graphique-4.jpg\" width=\"1000\" height=\"625\" /><span id=\"docs-internal-guid-bf4f7a86-7fff-2416-3c02-2ea9aba38fa7\">&rarr; Web Design Touch</span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\">Pour plus d&rsquo;exemples, vous pouvez consulter le site suivant : <a href=\"https://chartes-graphiques.com/\">https://chartes-graphiques.com/</a></p>\r\n<p><span id=\"docs-internal-guid-af2d7243-7fff-745f-2109-b0ee769c1242\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Comme vous avez pu le comprendre, la charte graphique est la colonne vert&eacute;brale de votre communication. <span class=\"text-secondBlue\"><strong>Faites appel &agrave; votre agence Start-Win et b&eacute;n&eacute;ficiez d&rsquo;un accompagnement personnalis&eacute; pour l&rsquo;&eacute;laboration de votre charte graphique.</strong></span></p>', 'Votre logotype doit toujours être accompagné d’une charte graphique. Mais savez-vous exactement ce qu’est une charte graphique ? Start-Win vous en dit plus !', 1, '2021-09-21 14:16:25', '2021-09-21 14:17:30'),
(50, 'La communication et le numérique responsable', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Qu&rsquo;est-ce que la communication responsable ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Selon l&rsquo;ADEME, l\'agence de l\'environnement et de la ma&icirc;trise de l\'&eacute;nergie, la communication responsable &ldquo;correspond &agrave; la <span class=\"text-secondBlue\"><strong>mise en &oelig;uvre de l&rsquo;&eacute;co-conception des outils et des actions de la communication</strong></span> au sein des organisations (entreprises, collectivit&eacute;s ou autres)&rdquo;. Elle a pour finalit&eacute; de <span class=\"text-secondBlue\"><strong>r&eacute;duire les impacts environnementaux</strong></span> li&eacute;s aux pratiques des m&eacute;tiers de la communication.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Mais int&eacute;ressons-nous plus particuli&egrave;rement &agrave; la communication digitale avec le num&eacute;rique responsable.</p>\r\n<p><br /><br /></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Le num&eacute;rique responsable</strong></span></p>\r\n<p><br />Selon le gouvernement, <span class=\"text-secondBlue\"><strong>le num&eacute;rique responsable est &ldquo;une d&eacute;marche d&rsquo;am&eacute;lioration continue qui vise &agrave; am&eacute;liorer l&rsquo;empreinte &eacute;cologique et sociale du num&eacute;rique&rdquo;.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span id=\"docs-internal-guid-8cdc38d4-7fff-2999-c606-e65a5123c316\">Mais connaissez-vous r&eacute;ellement l&rsquo;impact du web sur l&rsquo;environnement&hellip;?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Responsable/Infographie-com-responsable.jpg\" alt=\"Infographie-com-responsable.jpg\" width=\"800\" height=\"2000\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Comment mettre en place cette d&eacute;marche ?</strong></p>\r\n<p dir=\"ltr\">Pour concevoir votre site web et r&eacute;duire son empreinte environnementale, une solution majeure s&rsquo;offre &agrave; vous : <span class=\"text-secondBlue\"><strong>l&rsquo;&eacute;co-conception.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>L&rsquo;&eacute;co-conception d&rsquo;un site web consiste &agrave; concevoir un site ayant un impact environnemental le plus faible possible.</strong></span>&nbsp;La principale r&egrave;gle en &eacute;co-conception est de limiter les fonctionnalit&eacute;s non-essentielles. Cela vaut d&egrave;s la cr&eacute;ation du site mais aussi lors de la refonte d&rsquo;un site existant afin de le rendre plus respectueux de l&rsquo;environnement. C&rsquo;est alors tout le cycle de vie du site internet qui est pris en compte : conception, mise en ligne, suppression (lorsqu&rsquo;il arrive en fin de vie).</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Les bonnes pratiques</strong></p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">L&rsquo;h&eacute;bergement du site web : le choix de l&rsquo;h&eacute;bergeur et de la formule d&rsquo;h&eacute;bergement de votre site internet est tr&egrave;s important. <span class=\"text-secondBlue\"><strong>Start-Win vous recommande entre autres d&rsquo;utiliser un h&eacute;bergeur local et qui utilise des &eacute;nergies renouvelables.</strong></span></p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Le d&eacute;veloppement technique : ici, vous devrez r&eacute;duire au minimum les calculs n&eacute;cessaires pour le bon fonctionnement du site ainsi que la quantit&eacute; de donn&eacute;es &eacute;chang&eacute;e. <span class=\"text-secondBlue\"><strong>Start-Win vous recommande entre autres de limiter le nombre de requ&ecirc;tes HTTP, de minimiser les fichiers CSS et Javascript et de compresser les pages.</strong></span></p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Le webdesign : pour &eacute;viter d&rsquo;alourdir inutilement les pages du site web, <span class=\"text-secondBlue\"><strong>Start-Win vous recommande entre autres de limiter l&rsquo;utilisation d&rsquo;images (en particulier de grandes images), d&rsquo;utiliser des images vectorielles optimis&eacute;es et de choisir des polices web s&eacute;curis&eacute;es.</strong></span></p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Le contenu : le contenu p&egrave;se lourd sur un site web, particuli&egrave;rement les images et les vid&eacute;os. <span class=\"text-secondBlue\"><strong>Start-Win vous recommande entre autres d&rsquo;optimiser chaque image afin d&rsquo;en pr&eacute;server la qualit&eacute; tout en r&eacute;duisant au maximum son poids.</strong></span></p>\r\n</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\">R&eacute;duire l&rsquo;impact environnemental du web est d&eacute;sormais un enjeu majeur pour l&rsquo;ensemble des organisations. <span class=\"text-secondBlue\"><strong>Chez Start-Win, nous vous accompagnons dans l&rsquo;&eacute;co-conception de vos supports de communication (et tout particuli&egrave;rement votre site web) pour une empreinte environnementale r&eacute;duite au maximum. </strong></span>N&rsquo;attendez plus, faites appel &agrave; votre agence engag&eacute;e, &eacute;thique et responsable.</span></p>', 'Comment être plus respectueux de l’environnement grâce à votre communication ? Qu’est-ce que la communication et le numérique responsable ? Start-Win vous en dit plus !', 1, '2021-10-19 12:48:52', '2021-10-19 12:49:22'),
(51, 'Zoom sur les moteurs de recherche écologiques', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">C&rsquo;est quoi un moteur de recherche &eacute;colo ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Un moteur de recherche solidaire est <span class=\"text-secondBlue\"><strong>un moteur qui reverse une partie de ses revenus</strong></span> (g&eacute;n&eacute;r&eacute;s par les publicit&eacute;s) <span class=\"text-secondBlue\"><strong>&agrave; des causes humanitaires, sociales ou environnementales afin de compenser son empreinte carbone.&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Quel est l&rsquo;impact en CO2 de vos recherches en ligne ?</strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Selon <a href=\"https://www.planetoscope.com/\">Planetoscope</a>, &ldquo;une requ&ecirc;te sur Google produit 7g de C02 du fait de l\'immense quantit&eacute; d\'&eacute;nergie consomm&eacute;e par les quelque 500 000 serveurs du moteur de recherche am&eacute;ricain. Ces 7 grammes sont &agrave; multiplier par 200 millions de requ&ecirc;tes par jour (au minimum) tout au long de l\'ann&eacute;e, soit 511 millions de kilos de CO2/an au total (16 kilos par seconde)&rdquo;.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">INFO : cela repr&eacute;sente autant d&rsquo;&eacute;nergie que ce que consomme un pays comme le Laos.</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quelles sont les causes de la pollution num&eacute;rique ?</span></strong></p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-6c1a0d2c-7fff-ceb8-a711-e680a2e48dd3\">&nbsp;</span></p>\r\n<p dir=\"ltr\">Selon l&rsquo;&eacute;tude &laquo; <a href=\"https://www.greenit.fr/wp-content/uploads/2020/06/2020-06-iNum-etude-impacts-numerique-France-rapport.pdf\">iNum</a> &raquo;, les principales sources d&rsquo;impacts du num&eacute;rique en France sont <span class=\"text-secondBlue\"><strong>les &eacute;quipements des utilisateurs, les r&eacute;seaux qui relient les utilisateurs entre eux et aux centres informatiques et les centres informatiques qui h&eacute;bergent des serveurs.</strong></span> Voici leur impact &eacute;cologique :</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/moteurs%20de%20recherche%20ecolos/impact-eco-internet.png\" alt=\"impact-eco-internet.png\" width=\"1204\" height=\"736\" /></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Les moteurs de recherche &eacute;colos : une bonne solution pour r&eacute;duire son empreinte carbone sur le web</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Si votre entreprise vise l&rsquo;&eacute;cologie num&eacute;rique et souhaite permettre aux internautes de r&eacute;duire leur empreinte carbone, vous pouvez faire confiance &agrave;&hellip;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-4313da74-7fff-ca35-0d43-350ed3da909c\"></span></p>\r\n<p dir=\"ltr\"><strong>Ecosia</strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/moteurs%20de%20recherche%20ecolos/ecosia.png\" alt=\"ecosia.png\" width=\"1600\" height=\"754\" /></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Ecosia est un moteur de recherche qui reverse ses b&eacute;n&eacute;fices &agrave; des associations qui &oelig;uvrent au programme de reforestation des pays du Sud. </strong></span>Ecosia plante des arbres dans plus de 30 pays comme le Br&eacute;sil, le Burkina Faso ou l&rsquo;Indon&eacute;sie.</p>\r\n<p dir=\"ltr\">En juillet 2020, Ecosia passe la barre des 100 millions d\'arbres plant&eacute;s &agrave; travers le monde depuis sa cr&eacute;ation.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Info : il faut compter en moyenne environ 45 recherches pour planter un arbre.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Rendez-vous sur <a href=\"https://www.ecosia.org/\">https://www.ecosia.org/</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Ecogine</strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/moteurs%20de%20recherche%20ecolos/ecogine.png\" alt=\"ecogine.png\" width=\"638\" height=\"186\" /></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Ecogine.org est un moteur de recherche associatif fran&ccedil;ais dont les b&eacute;n&eacute;fices sont revers&eacute;s &agrave; des associations environnementales (choisies par les utilisateurs). Elle a &eacute;t&eacute; fond&eacute;e par trois &eacute;tudiants de Polytech\'Nantes, l\'&eacute;cole polytechnique de l\'Universit&eacute; de Nantes, en avril 2008.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><video controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"../../../files/Blog/moteurs%20de%20recherche%20ecolos/Ecogine_clip_promotion.mp4\" type=\"video/mp4\" /></video></p>\r\n<p dir=\"ltr\"><br />Rendez-vous sur <a href=\"https://ecogine.org/\">https://ecogine.org/</a></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>Lilo</strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><img src=\"../../../files/Blog/moteurs%20de%20recherche%20ecolos/lilo.jpg\" alt=\"lilo.jpg\" width=\"1600\" height=\"754\" /></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong><span id=\"p25\"><span id=\"37\">Lilo</span>&nbsp;est un moteur de recherche&nbsp;<span id=\"38\">fran&ccedil;ais</span>&nbsp;et solidaire qui vous permet de financer gratuitement des projets solidaires gr&acirc;ce &agrave; vos recherches internet.</span></strong></span><span id=\"p26\"><span class=\"text-secondBlue\"><strong>&nbsp;</strong></span>Vous pouvez par exemple choisir de lutter contre la d&eacute;forestation en Amazonie, d&rsquo;aider &agrave; r&eacute;aliser les r&ecirc;ves d&rsquo;enfants malades ou encore de prot&eacute;ger les tortues de Mayotte du braconnage.</span><span id=\"p27\">&nbsp;&Agrave; ce jour, 4 millions d&rsquo;euros ont ainsi &eacute;t&eacute; revers&eacute;s.</span><br /><br /><span id=\"p29\">Info :</span><span id=\"p30\">&nbsp;les recherches que vous&nbsp;effectuez&nbsp;&agrave; partir de&nbsp;<span id=\"40\">Lilo</span>&nbsp;vous permette de cumuler des gouttes gratuitement que vous redistribuez aux projets&nbsp;<span id=\"p28\">(environnementaux, &eacute;cologiques et solidaires)</span>&nbsp;de votre choix pour les soutenir.</span><span id=\"p31\"></span><br /><br /><span id=\"p32\">Rendez-vous sur&nbsp;<span id=\"41\">https://www.lilo</span>.</span><span id=\"p33\"><span id=\"42\">org/</span></span><br /><br /><br /><span id=\"p34\">Alors, quel moteur de recherche &eacute;cologique choisirez-vous pour r&eacute;duire votre empreinte carbone sur le web ?</span><span id=\"p35\">&nbsp;N\'attendez plus !</span><span id=\"p36\">&nbsp;<strong>Choisissez&nbsp;<span id=\"43\">Start-Win</span>, l&rsquo;agence engag&eacute;e, &eacute;thique et responsable, sp&eacute;cialiste de la transformation digitale qui vous accompagne vers une communication plus responsable.</strong></span></p>', 'Surfer sur Internet génère plus de gaz à effet de serre que de prendre l’avion… Alors comment lutter contre cette pollution numérique ? Quelles sont les solutions qui s\'offrent à vous et votre entreprise ? Start-Win vous en dit plus !', 1, '2021-11-22 11:17:08', '2021-11-23 14:34:27'),
(52, 'Zoom sur les moteurs de recherche qui respectent votre vie privée', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Quelles sont les donn&eacute;es qui sont collect&eacute;es quand vous effectuez une recherche sur le web ?</strong></span></p>\r\n<p dir=\"ltr\"><br />Quand vous effectuez une recherche sur le web, <span class=\"text-secondBlue\"><strong>de nombreuses donn&eacute;es peuvent &ecirc;tre collect&eacute;es</strong></span> comme :</p>\r\n<p dir=\"ltr\">- Votre nom et pr&eacute;nom,</p>\r\n<p dir=\"ltr\">- Votre date de naissance,</p>\r\n<p dir=\"ltr\">- Votre adresse (postale et/ou &eacute;lectronique),</p>\r\n<p dir=\"ltr\">- Votre num&eacute;ro de t&eacute;l&eacute;phone,</p>\r\n<p dir=\"ltr\">- Le type d&rsquo;appareil (ordinateur, tablette, portable, montre connect&eacute;e, &hellip;) que vous utilisez,</p>\r\n<p dir=\"ltr\">- Vos mots de passe,</p>\r\n<p dir=\"ltr\">- Les sites web que vous visitez et les vid&eacute;os que vous avez consultez,&nbsp;</p>\r\n<p dir=\"ltr\">- Votre adresse IP et les donn&eacute;es provenant de cookies*,</p>\r\n<p dir=\"ltr\">- Vos contacts,&nbsp;</p>\r\n<p dir=\"ltr\">- ...</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><em>*Cookies : selon <a href=\"https://www.e-marketing.fr/Thematique/data-1091/Tribune/Les-cookies-nuls-informatique-229748.htm\">e-marketing.fr</a>, &ldquo;les cookies sont de petits fichiers qui sont ins&eacute;r&eacute;s sur votre ordinateur par le site web, l&rsquo;application que vous utilisez ou par la publicit&eacute; que vous affichez. Ces fichiers vont enregistrer des informations vous concernant : un pseudo, votre &acirc;ge, certaines habitudes de navigation etc. Ces donn&eacute;es sont ensuite collect&eacute;es et analys&eacute;es afin de faciliter votre navigation ou vous proposer des publicit&eacute;s qui vous correspondent&rdquo;.</em></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>Mais que font les moteurs de recherche avec toutes mes donn&eacute;es ?</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Les moteurs de recherche utilisent vos donn&eacute;es pour :</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Rendre leurs services plus utiles, plus rapides et plus intelligents.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Am&eacute;liorer la s&eacute;curit&eacute; (par exemple, avec le filtre de spams Gmail).</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Afficher des publicit&eacute;s pertinentes (gr&acirc;ce &agrave; votre historique de recherches et votre position, les publicit&eacute;s sont mieux cibl&eacute;es et plus utiles).</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><strong>En chiffre :&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Google stocke toutes les 2 semaines pas moins de 23 000 pages de donn&eacute;es.</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">En un an, la quantit&eacute; de donn&eacute;es recueillies remplit 570 000 feuilles A4.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span id=\"p102\" style=\"font-size: 14pt;\">Alors, &agrave; quel moteur de recherche pouvez-vous faire confiance pour le respect de votre vie priv&eacute;e ?</span></strong><br /><br /><span class=\"text-secondBlue\"><strong><span id=\"p79\"><span id=\"91\">QWANT</span>&nbsp;:</span><span id=\"p103\">&nbsp;&laquo; le seul moteur de recherche qui prot&egrave;ge la vie priv&eacute;e de ses utilisateurs &raquo;</span></strong></span><br /><br /><span id=\"p81\"><span id=\"93\">Qwant</span>&nbsp;est <span class=\"text-secondBlue\"><strong>un moteur de recherche&nbsp;<span id=\"94\">fran&ccedil;ais</span>&nbsp;respectueux de la vie priv&eacute;e</strong></span>.</span><span id=\"p82\"></span><br /><br /><span id=\"p83\">Son fondateur, &Eacute;ric&nbsp;<span id=\"95\">L&eacute;andri</span>, vous explique :</span><span id=\"p84\">&nbsp;&ldquo;<span id=\"96\">Qwant</span>&nbsp;est le seul moteur de recherche qui prot&egrave;ge la vie priv&eacute;e de ses utilisateurs, en <strong><span class=\"text-secondBlue\">ne collectant strictement aucune donn&eacute;e personnelle lors des recherches</span></strong>.</span><span id=\"p85\">&nbsp;Nous n&rsquo;utilisons pas de cookie ni aucun autre outil de&nbsp;<span id=\"97\">tracking</span>&nbsp;qui permettrait de r&eacute;aliser le profil de l&rsquo;utilisateur et de l&rsquo;exploiter ou le revendre &agrave; des fins publicitaires ou autres.</span><span id=\"p86\">&nbsp;Cela veut dire pour l&rsquo;utilisateur que les r&eacute;sultats affich&eacute;s n&rsquo;ont pas &eacute;t&eacute; biais&eacute;s selon son profil, que nous&nbsp;<span id=\"98\">pr&eacute;sentons le</span>&nbsp;m&ecirc;me web &agrave; tout le monde, tel qu&rsquo;il est, sans pr&eacute;juger de qui recherche l&rsquo;information.</span><span id=\"p87\">&nbsp;C&rsquo;est une garantie de neutralit&eacute;, essentielle pour la libert&eacute; de chacun.</span><span id=\"p101\">&nbsp;Il y a tr&egrave;s peu de publicit&eacute;s affich&eacute;es, et celles qui le sont bas&eacute;es uniquement sur votre recherche du moment, sans aucun ciblage sur l&rsquo;individu.</span><span id=\"p89\">&rdquo;</span></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Moteurs%20de%20recherches%20respect%20vie%20priv%C3%A9e/qwant.jpg\" alt=\"qwant.jpg\" width=\"1600\" height=\"1120\" /><em><span style=\"font-size: 10pt;\">&copy; Cr&eacute;dit photo : AFP / &Eacute;ric L&eacute;andri</span></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>DuckDuckGo : \"Il n\'est pas n&eacute;cessaire de vous tracker pour vendre des liens sponsoris&eacute;s\"</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">DuckDuckGo est <span class=\"text-secondBlue\"><strong>un moteur de recherche am&eacute;ricain qui vise &agrave; pr&eacute;server la vie priv&eacute;e de ses utilisateurs.&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Son fondateur, Gabriel Weinberg, vous explique : &ldquo;DuckDuckGo est un moteur de recherche qui a la particularit&eacute; de ne pas &lsquo;tracker&rsquo; ses utilisateurs. <span class=\"text-secondBlue\"><strong>Nous ne conservons en effet aucune donn&eacute;e personnelle et toutes vos recherches sont enti&egrave;rement anonymes</strong></span>, car nous pensons que votre historique de recherche rel&egrave;ve de l&rsquo;intime. Le projet est n&eacute; en 2007 alors que je cherchais simplement &agrave; am&eacute;liorer ma propre exp&eacute;rience de recherche. DuckDuckGo compte aujourd&rsquo;hui une trentaine d&rsquo;employ&eacute;s et notre moteur enregistre plus de 9 millions de recherches par jour&rdquo;.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Moteurs%20de%20recherches%20respect%20vie%20priv%C3%A9e/duckduckgo-ceo-gabriel-weinberg-at-the-company-s-office.jpg\" alt=\"duckduckgo-ceo-gabriel-weinberg-at-the-company-s-office.jpg\" width=\"1246\" height=\"700\" /><em style=\"border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-transform: translateX(var(--tw-translate-x)) translateY(var(--tw-translate-y)) rotate(var(--tw-rotate)) skewX(var(--tw-skew-x)) skewY(var(--tw-skew-y)) scaleX(var(--tw-scale-x)) scaleY(var(--tw-scale-y)); --tw-border-opacity: 1; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-blur: var(--tw-empty, ); --tw-brightness: var(--tw-empty, ); --tw-contrast: var(--tw-empty, ); --tw-grayscale: var(--tw-empty, ); --tw-hue-rotate: var(--tw-empty, ); --tw-invert: var(--tw-empty, ); --tw-saturate: var(--tw-empty, ); --tw-sepia: var(--tw-empty, ); --tw-drop-shadow: var(--tw-empty, ); --tw-filter: var(--tw-blur) var(--tw-brightness) var(--tw-contrast) var(--tw-grayscale) var(--tw-hue-rotate) var(--tw-invert) var(--tw-saturate) var(--tw-sepia) var(--tw-drop-shadow);\"><span style=\"font-size: 10pt;\">&copy; Cr&eacute;dit photo : Protocole / Gabriel Weinberg</span></em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>StartPage : &ldquo;notre mission est de sensibiliser et, surtout, de prot&eacute;ger le droit des personnes &agrave; la vie priv&eacute;e dans le monde entier&rdquo;&nbsp;</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Startpage <span class=\"text-secondBlue\"><strong>est un m&eacute;tamoteur* de recherche sur le Web</strong></span>.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Startpage vous explique : &ldquo;fond&eacute; aux Pays-Bas en 2006, Startpage est le premier et le plus priv&eacute; des moteurs de recherche au monde. <span class=\"text-secondBlue\"><strong>Notre mission est de sensibiliser et, surtout, de prot&eacute;ger le droit des personnes &agrave; la vie priv&eacute;e dans le monde entier.&nbsp;</strong></span></p>\r\n<p dir=\"ltr\">Startpage aide les personnes qui se soucient de leur vie priv&eacute;e et refusent d\'&ecirc;tre manipul&eacute;es par les algorithmes ou la publicit&eacute; &agrave; prendre le contr&ocirc;le.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Nous fournissons les r&eacute;sultats de recherche les plus pr&eacute;cis et nous nous assurons que vous ne serez jamais profil&eacute; ou suivi par votre moteur de recherche. Chaque recherche effectu&eacute;e sur Startpage est trait&eacute;e gr&acirc;ce &agrave; notre technologie exclusive de protection des donn&eacute;es personnelles. En outre, Startpage prot&egrave;ge tout le monde gr&acirc;ce &agrave; des lois n&eacute;erlandaises et europ&eacute;ennes strictes en mati&egrave;re de protection de la vie priv&eacute;e (qui sont sans doute les plus strictes au monde), notamment le RGPD&rdquo;.</p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Moteurs%20de%20recherches%20respect%20vie%20priv%C3%A9e/startpage_og_image.png\" alt=\"startpage_og_image.png\" width=\"1024\" height=\"493\" /><em style=\"border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-transform: translateX(var(--tw-translate-x)) translateY(var(--tw-translate-y)) rotate(var(--tw-rotate)) skewX(var(--tw-skew-x)) skewY(var(--tw-skew-y)) scaleX(var(--tw-scale-x)) scaleY(var(--tw-scale-y)); --tw-border-opacity: 1; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-blur: var(--tw-empty, ); --tw-brightness: var(--tw-empty, ); --tw-contrast: var(--tw-empty, ); --tw-grayscale: var(--tw-empty, ); --tw-hue-rotate: var(--tw-empty, ); --tw-invert: var(--tw-empty, ); --tw-saturate: var(--tw-empty, ); --tw-sepia: var(--tw-empty, ); --tw-drop-shadow: var(--tw-empty, ); --tw-filter: var(--tw-blur) var(--tw-brightness) var(--tw-contrast) var(--tw-grayscale) var(--tw-hue-rotate) var(--tw-invert) var(--tw-saturate) var(--tw-sepia) var(--tw-drop-shadow);\"><span style=\"font-size: 10pt;\">&copy; Cr&eacute;dit photo : Startpage</span></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-5a6ced50-7fff-4ab0-f8d1-7659d0111efd\"></span></p>\r\n<p dir=\"ltr\">Alors, quel moteur de recherche priv&eacute;e choisirez-vous pour prot&eacute;ger vos donn&eacute;es sur le web ? N\'attendez plus ! <strong><span class=\"text-secondBlue\">Choisissez Start-Win, l&rsquo;agence engag&eacute;e, &eacute;thique et responsable, sp&eacute;cialiste de la transformation digitale qui vous accompagne dans la mise en place de votre RGDP.</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><a class=\"call-to-action yellow mx-auto\" href=\"contactez-nous\">Contactez-nous</a></p>', 'En 2020, Google a été sanctionné par la CNIL pour non-respect de la vie privée de ses utilisateurs. Alors quels moteurs de recherches respectent vraiment votre vie privée ? Start-Win vous en dit plus !', 1, '2021-11-30 15:29:13', '2021-12-05 15:38:51');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(53, 'Améliorer l\'expérience produit sur tous vos canaux', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Comment am&eacute;liorer l\'exp&eacute;rience produit sur tous vos canaux ?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Experience%20produit/infographie.jpg\" alt=\"infographie.jpg\" width=\"800\" height=\"2000\" /></p>\r\n<p style=\"text-align: center;\"><em><span style=\"font-size: 10pt;\">Infographie \"Am&eacute;liorez l\'experience produit sur tous vos canaux\" - Start-Win</span></em></p>\r\n<p style=\"text-align: center;\"><em><span style=\"font-size: 10pt;\">&copy; Pauline Motheron </span></em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\">Bien pr&eacute;senter vos produits est essentiel pour inciter vos consommateurs &agrave; l\'acte d\'achat.&nbsp;<span class=\"text-secondBlue\"><strong>Chez Start-Win, nous vous accompagnons dans la mise en avant de vos produit pour vous aider &agrave; acqu&eacute;rir plus de clients. </strong></span>N&rsquo;attendez plus, faites appel &agrave; votre agence engag&eacute;e, &eacute;thique et responsable.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><a class=\"call-to-action yellow mx-auto\" href=\"../../../realisations\"><span style=\"font-size: 12pt;\">D&eacute;couvrez nos r&eacute;alisations</span></a></p>', 'Pour vous, votre agence Start-Win a décrypté les enjeux autour de l’expérience produit et vous partage les bonnes pratiques à adopter.', 2, '2021-12-14 12:12:11', '2021-12-14 12:13:15');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(54, 'Communication : les tendances à suivre de près pour l’année 2022 (part. 1)', 'Pauline Motheron', '<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">#Tendance1 : la simplification</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">En 2022, <span class=\"text-secondBlue\"><strong>votre identit&eacute; de marque devra &ecirc;tre votre priorit&eacute;.</strong></span> Vous devrez l&rsquo;adapter aux tendances mais aussi &agrave; vos consommateurs. Mais quelles sont ses tendances ?</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span class=\"text-secondBlue\"><strong>La simplification</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span class=\"text-secondBlue\"><strong>La modernisation</strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span class=\"text-secondBlue\"><strong>Le retour aux sources</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Tendances%20com%202022/Rebrand-Renault.png\" alt=\"Rebrand-Renault.png\" width=\"1600\" height=\"864\" /><em><span id=\"docs-internal-guid-98620239-7fff-5e59-b50b-4dd03dc26fbc\">@icicestbranding</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span style=\"font-size: 12pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"../../../files/Blog/Tendances%20com%202022/jupdlc-article-1.png\" alt=\"jupdlc-article-1.png\" width=\"1200\" height=\"628\" /></span><span id=\"docs-internal-guid-4e045013-7fff-385e-741f-deddac721266\">@marketingpgc</span><span style=\"font-size: 12pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br /></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span style=\"font-size: 12pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"../../../files/Blog/Tendances%20com%202022/Rebrand-Total.png\" alt=\"Rebrand-Total.png\" width=\"1600\" height=\"864\" /></span><span id=\"docs-internal-guid-98620239-7fff-5e59-b50b-4dd03dc26fbc\">@icicestbranding</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em style=\"border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-transform: translateX(var(--tw-translate-x)) translateY(var(--tw-translate-y)) rotate(var(--tw-rotate)) skewX(var(--tw-skew-x)) skewY(var(--tw-skew-y)) scaleX(var(--tw-scale-x)) scaleY(var(--tw-scale-y)); --tw-border-opacity: 1; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-blur: var(--tw-empty, ); --tw-brightness: var(--tw-empty, ); --tw-contrast: var(--tw-empty, ); --tw-grayscale: var(--tw-empty, ); --tw-hue-rotate: var(--tw-empty, ); --tw-invert: var(--tw-empty, ); --tw-saturate: var(--tw-empty, ); --tw-sepia: var(--tw-empty, ); --tw-drop-shadow: var(--tw-empty, ); --tw-filter: var(--tw-blur) var(--tw-brightness) var(--tw-contrast) var(--tw-grayscale) var(--tw-hue-rotate) var(--tw-invert) var(--tw-saturate) var(--tw-sepia) var(--tw-drop-shadow);\"><span style=\"border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-transform: translateX(var(--tw-translate-x)) translateY(var(--tw-translate-y)) rotate(var(--tw-rotate)) skewX(var(--tw-skew-x)) skewY(var(--tw-skew-y)) scaleX(var(--tw-scale-x)) scaleY(var(--tw-scale-y)); --tw-border-opacity: 1; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-blur: var(--tw-empty, ); --tw-brightness: var(--tw-empty, ); --tw-contrast: var(--tw-empty, ); --tw-grayscale: var(--tw-empty, ); --tw-hue-rotate: var(--tw-empty, ); --tw-invert: var(--tw-empty, ); --tw-saturate: var(--tw-empty, ); --tw-sepia: var(--tw-empty, ); --tw-drop-shadow: var(--tw-empty, ); --tw-filter: var(--tw-blur) var(--tw-brightness) var(--tw-contrast) var(--tw-grayscale) var(--tw-hue-rotate) var(--tw-invert) var(--tw-saturate) var(--tw-sepia) var(--tw-drop-shadow);\"><span style=\"font-size: 12pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"../../../files/Blog/Tendances%20com%202022/Capture-de%CC%81cran-2021-01-07-a%CC%80-10.30.19.png\" alt=\"Capture-décran-2021-01-07-à-10.30.19.png\" width=\"963\" height=\"539\" /></span></span></em><em><span id=\"docs-internal-guid-9eed0789-7fff-340d-224e-a036ccf7ffd7\">@enekia</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\"><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Tendances%20com%202022/burger-king-logo-progression_dezeen_2364_col_0.jpeg\" alt=\"burger-king-logo-progression_dezeen_2364_col_0.jpeg\" width=\"1600\" height=\"900\" /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@designtour</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-218619d7-7fff-1b08-8bf0-9f9caae961a6\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>1 : 1994 / 2 : 2000 / 3 : 2021</em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><em><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"../../../files/Blog/Tendances%20com%202022/logonews_Peugeot_19602021.jpeg\" alt=\"logonews_Peugeot_19602021.jpeg\" width=\"827\" height=\"370\" /></span></em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><em><span id=\"docs-internal-guid-72c52eff-7fff-7331-e730-e8e48fa6bf97\">@logonews</span></em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: left;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: left;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">#Tendance2 : les engagements soci&eacute;taux</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">En 2022, <span class=\"text-secondBlue\"><strong>valorisez plus que jamais vos engagements soci&eacute;taux</strong></span>. Vos clients attendent que votre marque s\'investisse <span class=\"text-secondBlue\"><strong>dans des causes (qu&rsquo;elles soient sociales, environnementales, &hellip;) qui ont du sens</strong></span>. Valorisez vos engagements aupr&egrave;s de votre communaut&eacute; et vous ferez sans doute de nombreux ravies !&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Tendances%20com%202022/te%CC%81le%CC%81chargement.jpg\" alt=\"téléchargement.jpg\" width=\"1600\" height=\"900\" /></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@BETC</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-3faf8559-7fff-e009-92c1-69ecca509e5d\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>La Roche-Posay s&rsquo;engage contre les probl&egrave;mes de peau.</em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><em><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"data:image/jpeg;base64,\" alt=\"FETD0gzXsAAxkyj.jpeg\" width=\"950\" height=\"1431\" /></span><span id=\"docs-internal-guid-5741bebd-7fff-1971-675b-5ee445fbbc20\">@easyjet</span></em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\"><em><span style=\"font-size: 12pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"../../../files/Blog/Tendances%20com%202022/Gnota_58401.jpeg\" alt=\"Gnota_58401.jpeg\" width=\"832\" height=\"624\" /></span><span id=\"docs-internal-guid-d5e82446-7fff-e26a-b5e8-9881ca769615\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@dove</em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\"><em><span id=\"docs-internal-guid-d5e82446-7fff-e26a-b5e8-9881ca769615\">&ldquo;Fiert&eacute; dans chaque lavage&rdquo; - ici, la marque Dove (Porto Rico) soutien la cause LGBT</span></em></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: left;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-top: 0pt; margin-bottom: 0pt; text-align: left;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">#Tendance3 : communication interne</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">En 2022, <span class=\"text-secondBlue\"><strong>votre communication interne se devra d&rsquo;&ecirc;tre &eacute;tonnante et surprenante.</strong></span> Et oui, apr&egrave;s une ann&eacute;e pleine de tensions et d&rsquo;anxi&eacute;t&eacute;, <span class=\"text-secondBlue\"><strong>vous devez recr&eacute;er du lien avec vos collaborateurs.</strong></span> Quoi de mieux qu&rsquo;un effet &ldquo;Wahouuuu&rdquo; ?</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/Tendances%20com%202022/000460983_5.jpeg\" alt=\"000460983_5.jpeg\" width=\"624\" height=\"645\" /></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@LSAconso</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-3466329e-7fff-84e1-f609-6cc40d0da03d\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Pour f&eacute;d&eacute;rer ses collaborateurs et accro&icirc;tre leur sentiment d&rsquo;appartenance, Mondelez a cast&eacute; ses employ&eacute;s et s&eacute;lectionn&eacute; 80 d&rsquo;entre eux pour jouer dans sa webs&eacute;rie &laquo; Face Cach&eacute;e &raquo;.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><iframe src=\"https://www.youtube.com/embed/EWkSZ7zI7lI\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>&Agrave; travers cette campagne de communication interne, la marque <span id=\"64\">Somfy</span>&nbsp;lutte contre le sexisme au&nbsp;<span id=\"65\">travail.</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><span id=\"docs-internal-guid-733e776b-7fff-6802-9fa1-08eb4ecf7167\">Votre communication doit suivre les tendances d&rsquo;aujourd&rsquo;hui et de demain ! Alors, vous &ecirc;tes pr&ecirc;ts &agrave; relever le d&eacute;fi ? <strong>D&eacute;couvrez prochainement la deuxi&egrave;me partie de l&rsquo;article !</strong></span></p>', 'Ça y est, l’année 2021 se termine, laissant derrière elle une période mouvementée mais forte de changements et d’innovations. Maintenant, une nouvelle page se tourne.. et on vous laisse découvrir les tendances de la communication en 2022.', 3, '2021-12-29 15:01:32', '2021-12-29 15:28:51');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(55, 'Communication : les tendances à suivre de près pour l’année 2022 (part. 2)', 'Pauline Motheron', '<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>#Tendance4 : digital, je test &amp; j&rsquo;apprends</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Votre strat&eacute;gie digitale doit toujours prendre en compte le contexte actuel</strong></span>, que ce soit le contexte global, le contexte de votre marque ou le contexte de vos cibles. Et m&ecirc;me si le digital n&rsquo;est plus un secret pour vous, <span class=\"text-secondBlue\"><strong>vous devrez encore tester et apprendre &agrave; mesure de vos exp&eacute;riences. </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" alt=\"ouigo.jpg\" width=\"2244\" height=\"1237\" /></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Ouisncf</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Pour compenser plus d&rsquo;un an sans voyage, la SNCF a propos&eacute; aux Fran&ccedil;ais un </em><em>&laquo; billet de rattrapage &raquo; sous la forme d&rsquo;un jeu concours en partenariat avec Le Studio Danielle (adaptation au contexte global)</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"data:image/jpeg;base64,\" alt=\"lush.jpg\" width=\"2262\" height=\"2534\" /><br /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Lush</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-04e42ae6-7fff-d76f-c24f-b4c6e103e5df\">Ici, la marque Lush (entreprise de cosm&eacute;tiques) annonce son d&eacute;part des r&eacute;seaux sociaux. Pourquoi ? &laquo; En tant que cr&eacute;ateur de bombes de bain, ma priorit&eacute; est de proposer des produits qui aident &agrave; se d&eacute;connecter, se relaxer et prendre soin de son bien-&ecirc;tre. Certains r&eacute;seaux sociaux sont devenus l&rsquo;antith&egrave;se de cet objectif. &raquo;, affirme le Directeur du digital de l&rsquo;entreprise (adaptation au contexte de la marque)</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"data:image/jpeg;base64,\" alt=\"barilla.jpg\" width=\"2860\" height=\"1473\" /><br /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Barilla</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-77265b30-7fff-ff6d-123e-14518b6e98f5\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Ici, la marque de p&acirc;tes Barilla propose des playlists aux consommateurs o&ugrave; chacun des morceaux correspond au temps de cuisson exact d&rsquo;une vari&eacute;t&eacute; de p&acirc;te de la marque (adaptation au contexte de la cible)</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 14pt;\"><strong>#Tendance5 : &eacute;v&eacute;nementiel</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">M&ecirc;me si le contexte (merci Mr. Covid) ne le permet pas toujours, <span class=\"text-secondBlue\"><strong>vous devez continuer &agrave; organiser des &eacute;v&eacute;nements</strong><strong>.</strong></span> Mais comment me direz-vous ? <span class=\"text-secondBlue\"><strong>Misez sur &nbsp;les dispositifs phygitaux afin que vous puissiez vous adressez au plus grand nombre qu&rsquo;importent les conditions</strong></span> (selon <a href=\"http://www.wagrametvous.com\">www.wagrametvous.com</a>, un &eacute;v&eacute;nement dit &ldquo;phygital&rdquo; est un m&eacute;lange de pr&eacute;sentiel et de digital, c\'est-&agrave;-dire qu\'il se d&eacute;roule dans un lieu physique, avec les intervenants et quelques participants. Il est diffus&eacute; simultan&eacute;ment en ligne afin que d\'autres personnes puissent y assister). <span class=\"text-secondBlue\"><strong>Et attention, vos contenus devront &ecirc;tre sc&eacute;naris&eacute;s au maximum !</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><iframe src=\"https://www.youtube.com/embed/tRu1WL_KgcI?t=49s\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Vachequirit</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-0212ff04-7fff-b656-1d04-1b5654a68bf9\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Pour f&ecirc;ter ses 100 ans, la marque La Vache qui Rit, en partenariat avec l&rsquo;association Le Rire m&eacute;decin, &agrave; invit&eacute; ses consommateurs &agrave; enregistrer leurs rires afin de les transformer en don avec le #UnRireUnDon. De plus, la marque a propos&eacute; des animations en magasins : immersions, animations interactives, th&eacute;&acirc;tralisation, &hellip;</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/Tendances%20com%202022/bouygues.jpg\" alt=\"bouygues.jpg\" width=\"1601\" height=\"753\" /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Bouyguesconstruction</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-57639c12-7fff-db5b-9fc9-1dec86828f4a\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Bouygues Construction a propos&eacute; un challenge 100% digital &agrave; l&rsquo;&eacute;chelle mondiale, r&eacute;unissant une cinquantaine d&rsquo;&eacute;tudiants. L&rsquo;objectif &eacute;tait de faire d&eacute;couvrir les m&eacute;tiers et activit&eacute;s de l&rsquo;entreprise gr&acirc;ce &agrave; une exp&eacute;rience interactive.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">#Tendance6 : partenariats</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Ne n&eacute;gligez pas vos partenariats : <span class=\"text-secondBlue\"><strong>&ldquo;il n&rsquo;y a pas de petits partenariats, que des belles rencontres&rdquo;.</strong></span> Mais pour quoi faire ? D&eacute;fier la concurrence, mettre en valeur vos produits, atteindre une nouvelle cible, &hellip; &Agrave; vos marques, pr&ecirc;ts, partez !</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\">Et on a d&eacute;j&agrave; quelques exemples &agrave; vous montrer pour que vous puissiez vous inspirer !</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><iframe src=\"https://www.youtube.com/embed/PZHESOq-Gkw\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Balanciaga x @TheSimpsons</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-6b67bf3e-7fff-6746-ccab-d06d7303fd36\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Pour pr&eacute;senter sa nouvelle collection, la marque de luxe Balenciaga a conclu un partenariat avec les Simpsons. Retrouvez cet &eacute;pisode in&eacute;dit (d&eacute;voil&eacute; &agrave; l&rsquo;occasion de la Fashion Week), alliant &eacute;motion, humour et autod&eacute;rision.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\"><img src=\"../../../files/Blog/Tendances%20com%202022/bnp-paribas-cinema-commercants-affiches-jupdlc-4.jpeg\" alt=\"bnp-paribas-cinema-commercants-affiches-jupdlc-4.jpeg\" width=\"1200\" height=\"628\" /></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@BNPParibas x @UGC</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-3e4da3a5-7fff-199b-650e-70a19419c6c6\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>BNP Paribas a mis en sc&egrave;ne les commer&ccedil;ants du quartier de l&rsquo;Od&eacute;on &agrave; Paris en h&eacute;ros du grand &eacute;cran. Un partenariat qui permet de mettre en avant les h&eacute;ros du quotidien.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><iframe src=\"https://www.youtube.com/embed/oFJ1PzaCsSU\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Orange x @LonelyPlanet</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-bdfe01d9-7fff-b534-6037-ad00416976b9\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>La marque Orange s&rsquo;est associ&eacute;e &agrave; l&rsquo;&eacute;diteur de guides de voyage Lonely Planet pour &eacute;laborer la campagne &laquo; Il est temps de d&eacute;connecter &raquo;. Un spot po&eacute;tique, qui nous rappelle l&rsquo;importance du l&acirc;cher prise.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span id=\"docs-internal-guid-875d3ca6-7fff-b033-2b49-33e6936e80c9\">Votre communication doit suivre les tendances d&rsquo;aujourd&rsquo;hui et de demain ! Alors, vous &ecirc;tes pr&ecirc;ts &agrave; relever le d&eacute;fi ? <span class=\"text-secondBlue\"><strong>Faites appel &agrave; votre agence Start-Win et b&eacute;n&eacute;ficiez d&rsquo;un accompagnement personnalis&eacute; pour l&rsquo;&eacute;laboration de votre communication. Relevons ensemble les d&eacute;fis d&rsquo;aujourd&rsquo;hui et de demain.</strong></span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-33b508d3-7fff-3526-fca7-87758f28bbef\"></span></em></p>', 'Ça y est, notre calendrier affiche 2022. Toute l’équipe Start-Win vous souhaite une bonne année et vous laisse découvrir les tendances de la communication en 2022 (part. 2).', 1, '2022-01-05 15:44:10', '2022-01-05 16:21:48');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(56, 'Le e-commerce en 2021', 'Pauline Motheron', '<p><strong><span style=\"font-size: 14pt;\">Les tendances d&rsquo;achats en ligne des consommateurs fran&ccedil;ais en 2021</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../files/Blog/e-commerce2021/info-e-commerce.jpg\" alt=\"info-e-commerce.jpg\" width=\"800\" height=\"2200\" /></p>\r\n<p style=\"text-align: center;\"><em>Infographie r&eacute;alis&eacute;e par Pauline Motheron (Charg&eacute;e de Communication - Start-Win)</em></p>\r\n<p style=\"text-align: center;\"><em>Source : ChannelAdvisor &amp; Dynata (octobre 2021)</em></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong><span class=\"text-secondBlue\" style=\"font-size: 14pt;\">Vous souhaitez cr&eacute;er votre plateforme e-commerce ?</span></strong></p>\r\n<p style=\"text-align: center;\"><br /><a class=\"call-to-action yellow mx-auto\" href=\"../../contact\"><span style=\"font-size: 14pt;\">Contactez-nous</span></a></p>', 'Découvrez les tendances d’achats en ligne des consommateurs Français en 2021 (pénétration e-commerce par catégorie, canaux de découverte produit & impact de la pandémie du COVID-19).', 1, '2022-01-12 14:54:09', '2022-01-21 11:13:25');
INSERT INTO `blogs` (`id`, `title`, `author`, `content`, `resume`, `category_id`, `created_at`, `updated_at`) VALUES
(57, 'NFT : ces jetons virtuels qui rapportent gros', 'Pauline Motheron', '<p><strong><span id=\"p0\" style=\"font-size: 14pt;\">C&rsquo;est quoi un&nbsp;<span id=\"7\">NFT</span>&nbsp;?</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"p3\">Apparu pour la premi&egrave;re fois en 2017, un&nbsp;<span id=\"10\">NFT</span>&nbsp;<span id=\"p2\">(&lsquo;Non&nbsp;<span id=\"8\">Fungible</span>&nbsp;<span id=\"9\">Token</span>&rsquo;)</span>&nbsp;est <span class=\"text-secondBlue\"><strong>un jeton virtuel qui permet de vendre des &oelig;uvres diffus&eacute;es sur Internet</strong></span>, &agrave; travers <span class=\"text-secondBlue\"><strong>des titres de propri&eacute;t&eacute; num&eacute;rique infalsifiables et uniques.</strong></span></span><span id=\"p4\">&nbsp;Concr&egrave;tement, ce jeton permet de justifier la possession d&rsquo;une &oelig;uvre et de son authenticit&eacute;, c&rsquo;est-&agrave;-dire qu&rsquo;il s&rsquo;agit bien de la cr&eacute;ation originale&nbsp;<span id=\"p1\">(et non d&rsquo;une copie)</span>.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span id=\"p5\">Ces &oelig;uvres num&eacute;riques, qui s&rsquo;ach&egrave;tent en&nbsp;<span id=\"11\">crypto</span>&nbsp;monnaie, peuvent &ecirc;tre des&nbsp;<span id=\"12\">GIFs</span>, des Tweets, des &oelig;uvres d&rsquo;art&nbsp;digitalis&eacute;es, des vid&eacute;os<span id=\"14\">, &hellip;</span></span><span id=\"p6\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><em><span id=\"docs-internal-guid-c28cd6a7-7fff-785e-7044-049d4335b410\">Voici quelques exemples :</span></em></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"tweet-createur-twitter-nft.png\" width=\"1577\" height=\"613\" /></em></p>\r\n<p style=\"text-align: center;\"><em><span id=\"docs-internal-guid-18eec194-7fff-407d-4a9b-5ee48425879e\"></span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>Jack Dorsey, le fondateur de Twitter, a vendu le NFT de son premier Tweet pour 2,9 millions de dollars.</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/NFT/beeple-nft.jpg\" alt=\"beeple-nft.jpg\" width=\"1280\" height=\"720\" /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-119797ed-7fff-b414-75cc-12dd0f9c5ebc\">Le NFT de l\'&oelig;uvre num&eacute;rique &ldquo;Everydays: the First 5 000 Days&rdquo;, sign&eacute;e par le crypto-artiste am&eacute;ricain Beeple, s&rsquo;est vendue pour pr&egrave;s de 69,3 millions de dollars aux ench&egrave;res.</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/NFT/gif-nyan-cat-nft.gif\" alt=\"gif-nyan-cat-nft.gif\" width=\"500\" height=\"288\" /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@Gfycat</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-31c59801-7fff-95d5-5adb-c442f3a1109e\">Le NFT du c&eacute;l&egrave;bre meme Nyan Cat s&rsquo;est vendu &agrave; 500 000 dollars.</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><img src=\"../../../files/Blog/NFT/mcdonalds-nft.jpeg\" alt=\"mcdonalds-nft.jpeg\" width=\"640\" height=\"360\" /></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@CNEWS</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-06e33044-7fff-8094-4062-fbfa495c1648\">McDonald&rsquo;s, accompagn&eacute; par l&rsquo;agence DDB, a lanc&eacute; sa propre collection de NFT, autour de quatre de ses produits iconiques : le Big Mac&trade;, le sundae, les Chicken McNuggets&trade; et bien &eacute;videmment les frites.</span></em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\"><img src=\"../../../files/Blog/NFT/HbQ2bX_rAfdkc3P9.jpeg\" alt=\"kingsofleon-nft.jpeg\" width=\"720\" height=\"720\" /></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>@KingsOfLeon - Twitter</em></p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em><span id=\"docs-internal-guid-48f02862-7fff-e8b0-897d-40f7fff73102\">En mars 2021, le groupe de rock Kings Of Leon sort un album en NFT. Cette version offre des bonus avec un vinyle en &eacute;dition limit&eacute;e et une pochette anim&eacute;e. Un deuxi&egrave;me type de NFT, &laquo; billet d&rsquo;or &raquo;, offre quant &agrave; lui une place de concert au premier rang &agrave; vie, acc&egrave;s backstage et chauffeur priv&eacute;.</span></em></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Pourquoi les NFT font tant parler d&rsquo;eux ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span class=\"text-secondBlue\"><strong>Les NFT sont une nouvelle opportunit&eacute; pour le domaine de l&rsquo;art num&eacute;rique : ils permettent notamment de lutter contre les copies gr&acirc;ce &agrave; leur certificat d&rsquo;authenticit&eacute; num&eacute;rique infalsifiable.&nbsp;</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Comme vous avez pu le constater avec les exemples ci-dessus, <span class=\"text-secondBlue\"><strong>les NFT offrent &eacute;galement aux cr&eacute;ateurs un nouveau moyen de se faire beaucoup d&rsquo;argent</strong></span>, ce qui a fortement affol&eacute; la toile.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: center;\"><em>&ldquo;Des artistes utilisent du stockage de donn&eacute;es et des logiciels pour cr&eacute;er de l&rsquo;art et le diffuser sur Internet depuis plus de vingt ans, mais il n&rsquo;y avait pas [jusqu&rsquo;ici] de v&eacute;ritable moyen pour le poss&eacute;der et le collectionner. Avec le NFT, tout &ccedil;a a chang&eacute;&rdquo;</em> - Mike Winkelmann (artiste num&eacute;rique plus connu sous le nom de Beeple).</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Il faut &eacute;galement savoir que les NFT n&rsquo;int&eacute;ressent pas que le domaine de l&rsquo;art.&nbsp;</p>\r\n<p dir=\"ltr\"><strong>C&ocirc;t&eacute; sportif</strong>, on peut prendre l&rsquo;exemple de l&rsquo;application NBA Top Shot permettant d&eacute;sormais de collectionner et d&rsquo;&eacute;changer des vid&eacute;os contenant des actions d&rsquo;un match de basket par le biais de NFT.</p>\r\n<p dir=\"ltr\"><strong>C&ocirc;t&eacute; jeux vid&eacute;o</strong>, on peut prendre l&rsquo;exemple d&rsquo;Ubisoft qui a lanc&eacute; les Rabbids Tokens, des Lapins Cr&eacute;tins sous forme de jetons NFT dont les b&eacute;n&eacute;fices sont revers&eacute;s &agrave; l&rsquo;UNICEF.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong><span style=\"font-size: 14pt;\">Quel avenir pour les NFT ?</span></strong></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span id=\"docs-internal-guid-ad8ffc6a-7fff-02ef-9d03-ec3462c0807c\"></span></p>\r\n<p dir=\"ltr\">Les NFT ont un bel avenir devant eux et pour preuve : <span class=\"text-secondBlue\"><strong>en 2021</strong></span> (selon <a href=\"https://www.lenouveleconomiste.fr/\">lenouveleconomiste.fr</a>),<span class=\"text-secondBlue\"><strong> le march&eacute; des NFT repr&eacute;sentait 40 milliards de dollars</strong></span>. On attend avec impatience la suite !</p>', 'Vous avez sans doute dû entendre parler des NFT ? Mais qu’est-ce que c’est exactement ? Start-Win vous explique tout dans son nouvel article !', 1, '2022-01-19 15:45:44', '2022-01-19 15:47:22');
